(1, '526bd34', '<h2>premium baselayer shorts</h2>', '<p>Any challenge, anywhere.<br><br> Base layer fit<br> Double layer material to thigh and side leg<br> Solid and mesh material panelling<br> Contouring seam and cut lines<br> Low irritation marrow stitching<br> Lined mesh gusset<br> Elastic insert to waistband<br> Matte raised rubber Gymshark logo to thigh<br> Main: 75% Nylon, 25% Elastane. Mesh: 68% Nylon, 32% Elastane.<br> Model is 61 and wears size M<br> Label Colour: Black<br><br>The Premium Baselayer Shorts are assembled for elite-level outdoor performance. Guarantee you endure any environment without distraction thanks to a heavyweight, double-layered material for insulation and low-irritation stitching, a lined mesh insert and an elasticated waistband for consistent training comfort.</p>', 32, 40, NULL, NULL, 0, 1, 0, NULL, NULL, NULL, NULL, NULL, 'h2premium-baselayer-shortsh2', NULL, '2020-04-27 00:09:26', '2020-06-02 02:41:34'),
(2, '68125bb', '<h1 class=\"pinfo__heading\">element+ baselayer shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<p><strong>PRIMED FOR PERFORMANCE</strong><br><br>- Muscle shaping cover stitch seam<br>- Raised rubber print waistband<br>- Mesh panels and DRY technology<br>- Printed Gymshark logo<br>- Main: 90% Polyester, 10% Elastane. Mesh: 90% Polyester, 10% Elastane.<br>- Model is 6\'1\" and wears a size M<br>- Label Colour: Black Marl/White</p>\n<p>Supportive, functional and physique-enhancing, the Element+ Baselayer Shorts have been crafted for pristine performance. Maintain freshness and focus with sweat-wicking fabrics and maintain strength and endurance with supportive compression. Element+, assisting your training every rep of the way.</p>\n</div>', 31, 20, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingelement-baselayer-shortsh1', NULL, '2020-04-20 00:09:27', '2020-05-14 22:49:38'),
(3, '8C616e9', '<h1 class=\"pinfo__heading\">element+ baselayer shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<p><strong>PRIMED FOR PERFORMANCE</strong><br><br>- Muscle shaping cover stitch seam<br>- Raised rubber print waistband<br>- Mesh panels and DRY technology<br>- Printed Gymshark logo<br>- Main: 90% Polyester, 10% Elastane. Mesh: 90% Polyester, 10% Elastane.<br>- Model is 6\'1\" and wears a size M<br>- Label Colour:Eclipse Blue Marl</p>\n<p>Supportive, functional and physique-enhancing, the Element+ Baselayer Shorts have been crafted for pristine performance. Maintain freshness and focus with sweat-wicking fabrics and maintain strength and endurance with supportive compression. Element+, assisting your training every rep of the way.</p>\n</div>', 32, 20, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingelement-baselayer-shortsh1', NULL, '2020-04-20 00:09:28', '2020-05-14 22:49:38'),
(4, '30896b1', '<h1 class=\"pinfo__heading\">element+ baselayer shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<p><strong>PRIMED FOR PERFORMANCE</strong><br><br>- Muscle shaping cover stitch seam<br>- Raised rubber print waistband<br>- Mesh panels and DRY technology<br>- Printed Gymshark logo<br>- Main: 90% Polyester, 10% Elastane. Mesh: 90% Polyester, 10% Elastane.<br>- Model is 6\'1\" and wears a size M<br>- Label Colour: Hunter Green Marl</p>\n<p>Supportive, functional and physique-enhancing, the Element+ Baselayer Shorts have been crafted for pristine performance. Maintain freshness and focus with sweat-wicking fabrics and maintain strength and endurance with supportive compression. Element+, assisting your training every rep of the way.</p>\n</div>', 32, 20, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingelement-baselayer-shortsh1', NULL, '2020-04-20 00:09:29', '2020-05-14 22:49:38'),
(5, '6051756', '<h1 class=\"pinfo__heading\">vital seamless leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>ENDEAVOUR TO PERFORM</strong><br><br>  Baselayer fit<br>  Physique-enhancing seamless textures<br>  DRY technology<br>  Branded elasticated waistband<br>  Heat-sealed Gymshark logo to thigh and calf<br>  55% Nylon, 33% Polyester, 12% Elastane<br>  Model is 60 and wears size M<br>  Label Colour: Black Marl<br><br>Layer up for your highest intensity cardio or power up for your strongest lifts in the mens Vital Seamless Leggings. An optimal extra layer with or without shorts, these gym leggings are designed with sweat-wicking technology to maintain your focus and a baselayer fit to aid proprioception.</div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingvital-seamless-leggingsh1', NULL, '2020-04-20 00:09:30', '2020-05-14 22:49:38'),
(6, 'FCd6b13', '<h1 class=\"pinfo__heading\">element baselayer 3/4 leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>PRIMED FOR PERFORMANCE</strong><br><br>- Baselayer fit<br>- Muscle-shaping flatlock seams<br>- Raised rubber print waistband<br>- Mesh panelling for ventilation<br>- DRY technology<br>- Cropped 3/4 length<br>- Heat-sealed Gymshark logo<br>- Main: 85% Recycled Polyester, 15% Elastane. Panel: 89% Recycled Polyester, 9% Elastane, 2% Polyester.<br>- Model is 62 and wears size M<br>- Label Colour: Black<br><br>The Element Baselayer 3/4 Leggings were studied, designed and sculpted with performance at the fore. They\'re a baselayer crafted to support your movement, enhance your exertion and focus your attention when training. Element assisting your training every rep of the way.</div>', 32, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingelement-baselayer-34-leggingsh1', NULL, '2020-04-20 00:09:31', '2020-05-14 22:49:38'),
(7, '0281cb4', '<h1 class=\"pinfo__heading\">element baselayer 3/4 leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<strong>PRIMED FOR PERFORMANCE</strong><br><br><span>- Baselayer fit</span><br><span>- Muscle-shaping flatlock seams</span><br><span>- Raised rubber print waistband</span><br><span>- Mesh panelling for ventilation</span><br><span>- DRY technology</span><br><span>- Cropped 3/4 length</span><br><span>- Heat-sealed Gymshark logo</span><br><span>- Main: 85% Recycled Polyester, 15% Elastane. Panel: 89% Recycled Polyester, 9% Elastane, 2% Polyester.</span><br><span>- Model is 60 and wears size M</span><br><span>- Label Colour: Light Grey</span><br><br><span>The Element Baselayer 3/4 Leggings were studied, designed and sculpted with performance at the fore. They\'re a baselayer crafted to support your movement, enhance your exertion and focus your attention when training. Element assisting your training every rep of the way.</span><br>\n</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingelement-baselayer-34-leggingsh1', NULL, '2020-04-20 00:09:32', '2020-05-14 22:49:38'),
(8, 'E388458', '<h1 class=\"pinfo__heading\">element baselayer leggings</h1>\n', '<div class=\"pdp-accordion__body\"><p><strong></strong><strong>PRIMED FOR PERFORMANCE</strong><br><br>- Baselayer fit <br>- Muscle-shaping flatlock seams<br>- Raised rubber print waistband<br>- Mesh panelling for ventilation<br>- DRY technology<br>- Heat-sealed Gymshark logo<br>-Main: 85% Recycled Polyester, 15% Elastane. Panel: 89% Recycled Polyester, 9% Elastane, 2% Polyester.<br>- Model is 61 and wears size M<br>- Label Colour: Black<br><br>Every step of the Element Baselayer Leggings creation revolved around performance. These baselayer leggings have been sculpted for support, function and focus with sweat-wicking technology, breathable fabrics and a stay-put fit. Element assisting your training every rep of the way.</p></div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingelement-baselayer-leggingsh1', NULL, '2020-04-20 00:09:33', '2020-05-14 22:49:38'),
