(10, '01d96a4', '<h1 class=\"pinfo__heading\">element baselayer long sleeve high neck t-shirt</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>PRIMED FOR PERFORMANCE</strong><br><br>- Baselayer fit<br>- High-neck collar<br>- Mesh panelling for ventilation<br>- Muscle-shaping flatlock seams<br>- DRY technology<br>- Heat-sealed Gymshark logo<br>- Main: 85% Recycled Polyester, 15% Elastane. Panel: 89% Recycled Polyester, 9% Elastane, 2% Polyester.<br>- Model is 6\'0 and wears size M<br>- Label Colour: Black<br><br>Focus, confidence and performance are all assured in the Element Baselayer Long Sleeve High Neck Top. Combining lightweight, sweat-wicking fabrics with a low-profile construction and mesh panelling, you can rep, step and sprint with comfort throughout your training, so youre in control of your results.</div>', 32, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingelement-baselayer-long-sleeve-high-neck-t-shirth1', NULL, '2020-04-20 00:09:35', '2020-05-14 22:49:38'),
