(27, 'BD661ed', '<h1 class=\"pinfo__heading\">vital seamless leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>ENDEAVOUR TO PERFORM</strong><br><br>  Baselayer fit<br>  Physique-enhancing seamless textures<br>  DRY technology<br>  Branded elasticated waistband<br>  Heat-sealed Gymshark logo to thigh and calf<br>  55% Nylon, 33% Polyester, 12% Elastane<br>  Model is 511 and wears size S<br>  Label Colour: Athletic Marl<br><br>Layer up for your highest intensity cardio or power up for your strongest lifts in the mens Vital Seamless Leggings. An optimal extra layer with or without shorts, these gym leggings are designed with sweat-wicking technology to maintain your focus and a baselayer fit to aid proprioception.</div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingvital-seamless-leggingsh1', NULL, '2020-04-20 00:09:50', '2020-05-14 22:49:39'),
(28, '7Bf1cc1', '<h1 class=\"pinfo__heading\">premium baselayer shorts</h1>\n', '<div class=\"pdp-accordion__body\">Any challenge, anywhere.<br><br>  Base layer fit<br>  Double layer material to thigh and side leg<br>  Solid and mesh material panelling<br>  Contouring seam and cut lines<br>  Low irritation marrow stitching<br>  Lined mesh gusset<br>  Elastic insert to waistband<br>  Matte raised rubber Gymshark logo to thigh<br>  Main: 75% Nylon, 25% Elastane. Mesh: 68% Nylon, 32% Elastane.<br>  Model is 6\'0 and wears size M<br>  Label Colour: Light Grey<br><br>The Premium Baselayer Shorts are assembled for elite-level outdoor performance. Guarantee you endure any environment without distraction thanks to a heavyweight, double-layered material for insulation and low-irritation stitching, a lined mesh insert and an elasticated waistband for consistent training comfort.</div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingpremium-baselayer-shortsh1', NULL, '2020-04-20 00:09:51', '2020-05-14 22:49:39'),
(29, '4Cbb15a', '<h1 class=\"pinfo__heading\">premium baselayer t-shirt</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<span>Any challenge, anywhere.</span><br><br><span> Base layer fit</span><br><span> Thick, durable material</span><br><span> Solid and mesh material panelling</span><br><span> Contouring seam and cut lines</span><br><span> Low irritation marrow stitching</span><br><span> Fused construction to neck and hem</span><br><span> Fused taping to seams</span><br><span> Matte raised rubber Gymshark logo to chest and neck</span><br><span> Main: 75% Nylon, 25% Elastane. Mesh: 68% Nylon, 32% Elastane.</span><br><span> Model is 61 and wears size M</span><br><span> Label Colour: Light Grey</span><br><br><span>Engineered for outdoor training, the Premium Baselayer T-Shirt boasts innovative design and enduring construction. A heavyweight, durable material with ventilating mesh panels and fused seams reinforce your action, whether youre racking up miles on the road or tackling training on the pitch.</span>\n</div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingpremium-baselayer-t-shirth1', NULL, '2020-04-20 00:09:52', '2020-05-14 22:49:39'),
(30, 'E1e6e9d', '<h1 class=\"pinfo__heading\">premium baselayer t-shirt</h1>\n', '<div class=\"pdp-accordion__body\">Any challenge, anywhere.<br><br>  Base layer fit<br>  Thick, durable material<br>  Solid and mesh material panelling<br>  Contouring seam and cut lines<br>  Low irritation marrow stitching<br>  Fused construction to neck and hem<br>  Fused taping to seams<br>  Matte raised rubber Gymshark logo to chest and neck<br>  Main: 75% Nylon, 25% Elastane. Mesh: 68% Nylon, 32% Elastane.<br>  Model is 60 and wears size M<br>  Label Colour: Black<br><br>Engineered for outdoor training, the Premium Baselayer T-Shirt boasts innovative design and enduring construction. A heavyweight, durable material with ventilating mesh panels and fused seams reinforce your action, whether youre racking up miles on the road or tackling training on the pitch.</div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingpremium-baselayer-t-shirth1', NULL, '2020-04-20 00:09:53', '2020-05-14 22:49:39'),
(31, '407209e', '<h1 class=\"pinfo__heading\">fit tapered joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>FIT FOR EVERYTHING </strong><br><br>- Tapered fit <br>- Drawcord waist <br>- Zip pockets to each side <br>- Open pocket to back<br>- Zips to cuffs<br>- Embroidered logo to left thigh and back pocket<br>- 50% Polyester, 43% Cotton, 7% Elastane<br>- Model is 60 and wears size M<br>- Label Colour: Black<br><br>The Fit Tapered Bottoms are made to take you from your toughest training session to your most relaxed rest day. The tapered fit gives you loose-fitting freedom with a physique-enhancing tight cuff. Comfort and convenience are key, with an adjustable drawcord waistband, 3 pockets and a soft, cotton-blend fabric.</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingfit-tapered-joggersh1', NULL, '2020-04-20 00:10:25', '2020-05-14 22:49:39'),
(32, '428f4ef', '<h1 class=\"pinfo__heading\">fit tapered joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>FIT FOR EVERYTHING<span></span></strong><br><br><span>- Tapered fit</span><br><span>- Drawcord waist</span><br><span>- Zip pockets to each side</span><br><span>- Open pocket to back</span><br><span>- Zips to cuffs</span><br><span>- Embroidered logo to left thigh and back pocket</span><br><span>- 50% Polyester, 43% Cotton, 7% Elastane</span><br><span>- Model is 60 and wears size M</span><br><span>- Label Colour: Charcoal</span><br><br><span>The Fit Tapered Bottoms are made to take you from your toughest training session to your most relaxed rest day. The tapered fit gives you loose-fitting freedom with a physique-enhancing tight cuff. Comfort and convenience are key, with an adjustable drawcord waistband, 3 pockets and a soft, cotton-blend fabric.</span>\n</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingfit-tapered-joggersh1', NULL, '2020-04-20 00:10:26', '2020-05-14 22:49:39'),
