(34, '669da77', '<h1 class=\"pinfo__heading\">steve cook joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>THE STRENGTH COLLECTIVE</strong><br><br>  Slim fit<br>  Tapered-to-ankle shape<br>  Adjustable drawcord to waistband<br>  Ribbed ankle cuffs<br>  Zip side pockets<br>  Printed Steve Cook//Strength Collective branding<br>  62% Polyester, 33% Cotton, 5% Elastane<br>  Model is 6\'0 and wears size M<br>  Label Colour: Black<br><br>From gym floor to side walk, the Gymshark x Steve Cook Joggers are a complete reflection of the Strength Collective; confidence and character. Ribbed ankle cuffs and an elasticated waistband make them a reliable training partner, while a contemporary tapered fit and extroverted S//C branding promote a powerful presence thats true to the collective.</div>', 32, 55, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingsteve-cook-joggersh1', NULL, '2020-04-20 00:10:28', '2020-05-14 22:49:39'),
(35, '6Ea44a8', '<h1 class=\"pinfo__heading\">training joggers</h1>\n', '<div class=\"pdp-accordion__body\"><p><strong>IN YOUR LOCKER</strong><br><br>  Slim fit<br>  Tapered-to-ankle shape<br>  High-stretch material<br>  Part-elasticated, part-drawcord waistband<br>- Internal drawcord<br>  Elasticated ankle cuffs<br>  Zip side pockets<br>  Reflective Gymshark logo to upper leg<br>  78% Nylon, 22% Elastane<br>  Model is 6\'0 and wears size M<br>  Label Colour: Eclipse Blue<br><br>The kind of joggers that every locker needs. A super stretchy material and lightweight feel make the Training Joggers an all-rounder in conditioning, whether its big lifts or breathless cardio. Your training rotation just got even more versatile.</p></div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtraining-joggersh1', NULL, '2020-04-20 00:10:29', '2020-05-14 22:49:39'),
