(41, '2D51341', '<h1 class=\"pinfo__heading\">luxe legacy joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>THE NEXT GENERATION</strong><br><br><span> Slim fit</span><br><span> Tapered-to-ankle shape</span><br><span> Contrast block panels</span><br><span> Zip side pockets</span><br><span> Adjustable drawcord waistband</span><br><span> Embroidered classic Gymshark and Luxe logos to sides</span><br><span> 85% Cotton, 15% Elastane</span><br><span> Model is 62 and wears size M</span><br><span> Label Colour: Black</span><br><br><span>The Luxe Legacy Joggers are a genuine Gymshark original, featuring our famous tapered fit and classic Gymshark logo. Now, theyre back, with new zip side pockets and an improved material blend that mixes comfort and movement, alongside the renowned contrast colour blocks from the OG generation.</span>\n</div>', 32, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingluxe-legacy-joggersh1', NULL, '2020-04-20 00:10:34', '2020-05-14 22:49:39'),
(42, '48ffbf8', '<h1 class=\"pinfo__heading\">luxe legacy joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>THE NEXT GENERATION</strong><br><br>  Slim fit<br>  Tapered-to-ankle shape<br>  Contrast block panels<br>  Zip side pockets<br>  Adjustable drawcord waistband<br>  Embroidered classic Gymshark and Luxe logos to sides<br>  85% Cotton, 15% Elastane<br>  Model is 62 and wears size M<br>  Label Colour: Blue Lagoon<br><br>The Luxe Legacy Joggers are a genuine Gymshark original, featuring our famous tapered fit and classic Gymshark logo. Now, theyre back, with new zip side pockets and an improved material blend that mixes comfort and movement, alongside the renowned contrast colour blocks from the OG generation.</div>', 32, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingluxe-legacy-joggersh1', NULL, '2020-04-20 00:10:35', '2020-05-14 22:49:39'),
(43, '5268da2', '<h1 class=\"pinfo__heading\">luxe legacy joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>THE NEXT GENERATION</strong><br><br><span> Slim fit</span><br><span> Tapered-to-ankle shape</span><br><span> Contrast block panels</span><br><span> Zip side pockets</span><br><span> Adjustable drawcord waistband</span><br><span> Embroidered classic Gymshark and Luxe logos to sides</span><br><span> 85% Cotton, 15% Elastane</span><br><span> Model is 6\'1 and wears size M</span><br><span> Label Colour: White</span><br><br><span>The Luxe Legacy Joggers are a genuine Gymshark original, featuring our famous tapered fit and classic Gymshark logo. Now, theyre back, with new zip side pockets and an improved material blend that mixes comfort and movement, alongside the renowned contrast colour blocks from the OG generation.</span>\n</div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingluxe-legacy-joggersh1', NULL, '2020-04-20 00:10:36', '2020-05-14 22:49:39'),
(44, '3914416', '<h1 class=\"pinfo__heading\">critical joggers</h1>\n', '<div class=\"pdp-accordion__body\">Get the job done.<br><br>  Slim fit<br>  Tapered-to-ankle shape<br>  Ribbed cuffs<br>  Adjustable drawcord waist<br>  Side pockets<br>  Embroidered Gymshark logo<br>  60% Polyester, 35% Cotton, 5% Elastane<br>  Model is 6\'0\" and wears size M <br>- Label Color: Black<br><br>The joggers every gym bag needs: understated, comfortable and reliable. The multi-fabric construction of the Critical Joggers offers the stretch to support and endure training session upon training session.</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcritical-joggersh1', NULL, '2020-04-20 00:10:37', '2020-05-14 22:49:39'),
(45, 'DE3a6fd', '<h1 class=\"pinfo__heading\">tapered bottoms</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<p class=\"p1\"><span class=\"s1\">A true Gymshark original, boasting a refined and effortless design.</span></p>\n<p class=\"p1\"><span class=\"s1\">Constructed from soft stretch, cotton blend fabric, the Tapered Bottoms boast a liberating range of movement, whilst providing the perfect fit. Tailored for a subtle, relaxed fit, the Tapered Bottoms accentuate your physique effortlessly.</span></p>\n<p class=\"p1\"><span class=\"s1\">With adjustable drawcord waistband, concealed zip pockets and classic Gymshark printed logo, youre covered from your toughest training day to your most chilled rest day.</span></p>\n<p class=\"p1\"><span class=\"s1\">50% Polyester, 43% Cotton, 7% Elastane.</span></p>\n<p class=\"p1\"><span class=\"s1\">Model is 6\'1\" and wears a size M.</span></p>\n<p class=\"p1\"><span class=\"s1\">Label Colour: Hunter Green</span></p>\n</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtapered-bottomsh1', NULL, '2020-04-20 00:10:38', '2020-05-14 22:49:39'),
