(48, '07963a0', '<h1 class=\"pinfo__heading\">speed joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>STEP INTO CARDIO</strong><br><br>  Slim fit<br>  Tapered-to-ankle shape<br>  Lightweight material<br>  Air-mesh waistband with adjustable drawcords<br>  Mesh panelling to gusset and back<br>  Perforation to lower back leg<br>  Zip side pockets<br>  Printed Gymshark logo to thigh<br>  Main: 88% Polyester, 12% Elastane. Mesh: 85% Polyamide, 15% Elastane. Lower Leg: 80% Polyamide, 20% Elastane.<br>  Model is 62 and wears size S<br>  Label Color: Smokey Grey<br><br>Step into cardio in the Speed Pants. Theres no mile too far or speed too fast with a lightweight, supple polyester-elastane blend and reliable, stay-put fit. And - thanks to breathability features including mesh panels, an air-mesh waistband and perforation to the back leg - it doesnt matter how out of breath the cardios got you, these bottoms will continue breathing just fine.</div>', 32, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingspeed-joggersh1', NULL, '2020-04-20 00:10:40', '2020-05-14 22:49:39'),
(49, 'C1b5ba6', '<h1 class=\"pinfo__heading\">speed joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>STEP INTO CARDIO</strong><br><br>  Slim fit<br>  Tapered-to-ankle shape<br>  Lightweight material<br>  Air-mesh waistband with adjustable drawcords<br>  Mesh panelling to gusset and back<br>  Perforation to lower back leg<br>  Zip side pockets<br>  Printed Gymshark logo to thigh<br>  Main: 88% Polyester, 12% Elastane. Mesh: 85% Polyamide, 15% Elastane. Lower Leg: 80% Polyamide, 20% Elastane.<br>  Model is 511 and wears size S<br>  Label Color: Eclipse Blue<br><br>Step into cardio in the Speed Pants. Theres no mile too far or speed too fast with a lightweight, supple polyester-elastane blend and reliable, stay-put fit. And - thanks to breathability features including mesh panels, an air-mesh waistband and perforation to the back leg - it doesnt matter how out of breath the cardios got you, these bottoms will continue breathing just fine.</div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingspeed-joggersh1', NULL, '2020-04-20 00:10:41', '2020-05-14 22:49:39'),
(50, 'E9d0ea2', '<h1 class=\"pinfo__heading\">bold joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<strong>BE BOLD.</strong><br><br><span> Regular fit</span><br><span> Lightweight material build</span><br><span> Twin-needle stitching</span><br><span> Ribbed waistband and cuffs</span><br><span> Adjustable drawcord to waist</span><br><span> Zip side pockets</span><br><span> Screen-printed logo to thigh</span><br><meta charset=\"utf-8\">\n<span>- 62% Polyester, 33% Cotton, 5% Elastane<br> Model is 6\'1\" and wears size M</span><br><span> Label Color: Electric Blue</span><br><br><span>Loud, proud, Bold. The Bold Joggers make their identity known with a striking Gymshark logo to the thigh, while they support and comfort you through your workouts with a stay-put fit and soft cotton-elastane blend.</span>\n</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingbold-joggersh1', NULL, '2020-04-20 00:10:42', '2020-05-14 22:49:39'),
(51, '4601aff', '<h1 class=\"pinfo__heading\">bold joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<strong>BE BOLD.</strong><br><br><span> Regular fit</span><br><span> Lightweight material build</span><br><span> Twin-needle stitching</span><br><span> Ribbed waistband and cuffs</span><br><span> Adjustable drawcord to waist</span><br><span> Zip side pockets</span><br><span> Screen-printed logo to thigh</span><br>- 62% Polyester, 33% Cotton, 5% Elastane<br><span> Model is 6\'1\" and wears size M</span><br><span> Label Color: Hunter Green</span><br><br><span>Loud, proud, Bold. The Bold Joggers make their identity known with a striking Gymshark logo to the thigh, while they support and comfort you through your workouts with a stay-put fit and soft cotton-elastane blend.</span>\n</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingbold-joggersh1', NULL, '2020-04-20 00:10:43', '2020-05-14 22:49:39'),
(52, 'B116927', '<h1 class=\"pinfo__heading\">contrast joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>REPETITIONS, BUT NOT THE KIND YOU MIGHT THINK.</strong><br><br>  Slim fit<br> Adjustable drawcord waistband with contrast ends<br>  Ribbed ankle cuffs<br>  Printed Gymshark logo to leg<br>  Printed repeat Gymshark text to inside leg<br>  62% Polyester, 33% Cotton, 5% Elastane<br>  Model is 61 and wears size M<br>  Label Color: Emerald Green<br><br>Live, rest, repeat. The Contrast Joggers put the Gymshark name on rerun with a recurring pattern to the inside leg. Alongside a physique-enhancing fit and soft, supple fabric blend, these bottoms are a streetwear style that make themselves known.</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcontrast-joggersh1', NULL, '2020-04-20 00:10:44', '2020-05-14 22:49:39'),
