(55, '9456a15', '<h1 class=\"pinfo__heading\">maximize joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>BIG PRESENCE, BIGGER LIFTS.</strong><br><br><span>- Slim fit</span><br><span>- Drawcord waist</span><br><span>- Open side pockets</span><br><span>- Ribbed Cuffed ankles</span><br><span>- Printed Gymshark Logo</span><br><span>- 60% Polyester 35% Cotton 5% Elastane</span><br><span>- Model is 6\'0\" and wears a size M</span><br><span>- Label Color: Gravel Blue</span><br><br><span>Enhance your form when youre working out and your style when youre out and about. These classic joggers can take you through even your most intense workouts with flexible fabric and comfortable cut.</span>\n</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingmaximize-joggersh1', NULL, '2020-04-20 00:10:46', '2020-05-14 22:49:39'),
