(58, '6E73068', '<h1 class=\"pinfo__heading\">grade joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<p><strong>REST HARD</strong><br><br><span> Regular fit</span><br><span> Super-soft, thick material</span><br><span> Elasticated ankle cuffs</span><br><span> Adjustable drawcord waistband</span><br><span> Woven tab logo to pocket</span><br><span> 100% Polyester</span><br><span> Model is 6\'1 and wears size M</span><br><span> Label Color: Slate Grey</span><br><br><span>Sometimes rest comes before the reps, and the Grade Joggers provide rest day comfort you cant turn down. Created with an incredibly soft fleece fabric and stay-put cuffs and waistband, theyre made for easy-wear all day, any day. No matter how laid back you are, stay on form with versatile, one-tone colorways and casual silhouettes that highlight your style.</span></p>\n</div>', 32, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinggrade-joggersh1', NULL, '2020-04-20 00:10:49', '2020-05-14 22:49:39'),
(59, 'F2b753c', '<h1 class=\"pinfo__heading\">grade joggers</h1>\n', '<div class=\"pdp-accordion__body\"><p><strong>REST HARD</strong><br><br>  Regular fit<br>  Super-soft, thick material<br>  Elasticated ankle cuffs<br>  Adjustable drawcord waistband<br>  Woven tab logo to pocket<br>  100% Polyester<br>  Model is 6\'1 and wears size M<br>  Label Color: Black<br><br>Sometimes rest comes before the reps, and the Grade Joggers provide rest day comfort you cant turn down. Created with an incredibly soft fleece fabric and stay-put cuffs and waistband, theyre made for easy-wear all day, any day. No matter how laid back you are, stay on form with versatile, one-tone colorways and casual silhouettes that highlight your style.</p></div>', 32, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinggrade-joggersh1', NULL, '2020-04-20 00:10:51', '2020-05-14 22:49:39'),
(60, '8Cdb2e8', '<h1 class=\"pinfo__heading\">true knit joggers</h1>\n', '<div class=\"pdp-accordion__body\">The coolest warm up.<br><br>  Slim fit<br>  Tapered-to-ankle leg shape<br>  Multi-texture knit<br>  Adjustable drawcord waist<br>  Front zip pockets<br>  Raised rubber Gymshark logo<br>  100% Nylon<br>  Model is 6\'1\" and wears a size M<br>- Label Colour: Hunter Green.<br><br>The True Knit Joggers are the layer you mentally prepare in, and the layer you physically recover in. Their high-tech knit has a flattering fit with excellent stretch properties that promise style and comfort in equal measure.</div>', 31, 55, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtrue-knit-joggersh1', NULL, '2020-04-20 00:10:51', '2020-05-14 22:49:39'),
(61, 'D907e26', '<h1 class=\"pinfo__heading\">raw joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>JUST YOU AND THE WEIGHTS</strong><br><br><span> Slim fit</span><br><span> Tapered-to-ankle shape</span><br><span> High-stretch side panels</span><br><span> Durable loopback material</span><br><span> Adjustable drawcord waistband</span><br><span> Welt zip side pockets</span><br><span> Zips to ankle cuffs</span><br><span> Printed Gymshark logo to leg</span><br><span> 62% Polyester, 33% Cotton, 5% Elastane</span><br><span> Model is 60 and wears size M</span><br><span> Label Colour: Moss Khaki</span><br><br><span>Make the most of every all-or-nothing set and just one more rep with the Raw Joggers. These bottoms wont take care of handling the weight for you - thats down to you - but built with a high-stretch, knitted material and a comfortable fit, they allow you to press, pull and move through every lift in the gym, without any limits.</span>\n</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingraw-joggersh1', NULL, '2020-04-20 00:10:52', '2020-05-14 22:49:39'),
