(64, '355bb57', '<h1 class=\"pinfo__heading\">raid joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<strong>THE PURSUIT OF PROGRESS<span></span></strong><br><br><span> Slim fit</span><br><span> Tapered-to-ankle shape</span><br><span> Adjustable drawcords to Y-fold waistband</span><br><span> Welt zip side pockets</span><br><span> Popper buttons to ankle cuffs</span><br><span> Technical, high-stretch loopback material</span><br><span> Printed Gymshark logo to leg</span><br><span> 64% Cotton, 27% Polyester, 9% Elastane</span><br><span> Model is 60 and wears size M</span><br><span> Label Colour: Gravel Blue</span><br><br><span>Performance meets lifestyle with the Raid Joggers, introducing a more technical approach to training. Built equally for those who run, lift, HIIT and downright graft, these gym bottoms incorporate a technical, support-and-stretch loopback material and a lengthened in-seam gusset to cover every movement with confidence. Complete with unique popper buttons to the ankle.</span>\n</div>', 32, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingraid-joggersh1', NULL, '2020-04-20 00:10:55', '2020-05-14 22:49:39'),
