(66, '3918e99', '<h1 class=\"pinfo__heading\">force joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>WARNING: HEAVY LIFTERS IN OPERATION</strong><br><br>  Slim fit<br>  Tapered-to-ankle shape<br>  High-stretch ribbed panels to gusset, cuffs and waistband<br>  Physique-enhancing forward-facing seam lines<br>  Adjustable drawcord waistband<br>  Welt zip side pockets<br>  Printed reflective Gymshark logo to leg<br>  Main: 64% Cotton, 27% Polyester, 9% Elastane. Ribbed Panels: 88% Polyester, 12% Elastane.<br>  Model is 60 and wears size M<br>  Label Colour: Black<br><br>A powerful build, built for lifting. The Force Joggers are for the psych up and kickback either side of your heaviest sessions. Made with a cotton-heavy base with functional polyester-elastane side panels, moving through warm-ups and relaxing through cool-downs is done with ease. Muscle-shaping seams and a slim fit highlight the results of every rep.</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingforce-joggersh1', NULL, '2020-04-20 00:10:57', '2020-05-14 22:49:39'),
