(74, 'BF72763', '<h1 class=\"pinfo__heading\">crest joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>REST DAY THE CREST WAY</strong><br><br>  Slim fit<br>  Adjustable drawcord waistband<br>  Open side pockets and popper button back pocket<br>  Ribbed ankle cuffs<br>  Embroidered Gymshark logo to upper leg<br>  80% Cotton, 20% Polyester<br>  Model is 511 and wears size S<br>  Label Colour: Black<br><br>The Crest Joggers are a bottom layer you cant go wrong with. Whether its commute, rest or even a light workout, you can have full confidence in Crest with ribbed ankle cuffs and an adjustable waistband that keep in place as you move, and a super soft interior that provides relaxation and support throughout any rest day.</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcrest-joggersh1', NULL, '2020-04-20 00:11:04', '2020-05-14 22:49:39'),
