(79, 'EF17d3f', '<h1 class=\"pinfo__heading\">recharge joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>REST. RELAX. RECHARGE.</strong><br><br><span>- Slim fit</span><br><span>- High stretch textured material</span><br><span>- Elongated gusset</span><br><span>- Elasticated waistband with drawcord fastening</span><br><span>- Zip fastening to ankle cuff</span><br><span>- Gymshark woven tab to back of waistband</span><br><span>- Raised vertical logo to upper leg</span><br><span>- 100% Cotton</span><br><span>- Model is 62 and wears size S</span><br><span>- Label Colour: Hunter Green</span><br><br><span>Rest day as it should be: ultra-comfortable. The Recharge Joggers embody this philosophy, with a drawcord waist and zip fastening to the ankle cuff, as well as an elongated gusset so you can take your rest day comfort to the next level. After all, rest reaps rewards.</span><br>\n</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingrecharge-joggersh1', NULL, '2020-04-20 00:11:08', '2020-05-14 22:49:39'),
