(81, 'A6654b3', '<h1 class=\"pinfo__heading\">compound joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>PUSH. PULL. LIFT.</strong><br><br>  Regular fit<br>  Heavy-duty material build<br>  Double-layered material to lower leg to guard shins<br>  High-stretch rib panel to gusset and leg hem<br>  Adjustable drawcord waistband<br>  Open side pockets<br>  Single zip pocket to back<br>  Herringbone tape detailing<br>  Embroidered Gymshark logo to thigh<br>  Main: 87% Cotton, 13% Polyester. Rib: 100% Cotton.<br>  Model is 60 and wears size S<br>  Label Colour: Sand Stone<br><br>Stand up to the bar with max confidence and max power in the Compound Joggers. These bottoms offer the support and durability for every big lift, without the restrictive range of motion or Heavyweight feel of old school lifting joggers. Double-panelling to the Shins keeps you protected from the barbell, while high-stretch inserts means you can push and pull as heavy as possible.</div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcompound-joggersh1', NULL, '2020-04-20 00:11:10', '2020-05-14 22:49:39'),
