(87, '85ede85', '<h1 class=\"pinfo__heading\">maximize joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>BIG PRESENCE, BIGGER LIFTS.</strong><br><br>- Slim fit<br>- Drawcord waist<br>- Open side pockets <br>- Ribbed Cuffed ankles <br>- Printed Gymshark Logo<br>- 60% Polyester 35% Cotton 5% Elastane<br>- Model is 6\'0\" and wears a size M<br>- Label Color: Oat Beige<br><br>Enhance your form when youre working out and your style when youre out and about. These classic joggers can take you through even your most intense workouts with flexible fabric and comfortable cut.</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingmaximize-joggersh1', NULL, '2020-04-20 00:11:15', '2020-05-14 22:49:39'),
(88, '6373632', '<h1 class=\"pinfo__heading\">training joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>REFINED ATTENTION; MAXIMUM APPLICATION</strong><br><br><span> Regular fit</span><br><span> Tapered-to-ankle shape</span><br><span> Physique-enhancing flatlock seam lines</span><br><span> Elasticated waistband with tape drawcords</span><br><span> Elasticated ankle cuffs</span><br><span> Welt zip side pockets</span><br><span> Printed reflective logo to thigh</span><br><span> Stamped branding to waistband</span><br><span> 75% Nylon, 25% Elastane</span><br><span> Model is 60 and wears size M</span><br><span> Label Colour: Mushroom Grey</span><br><br><span>The Training Joggers refine your movement, your physique and your performance. Their nylon-elastane hybrid material stretches and reinforces every action of your training, forward-facing flatlock seams and a classic tapered fit are highly muscle-shaping and elasticated features to the waistband and cuffs guarantee durability of performance.</span>\n</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtraining-joggersh1', NULL, '2020-04-20 00:11:16', '2020-05-14 22:49:39'),
(89, 'E307f88', '<h1 class=\"pinfo__heading\">training joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>IN YOUR LOCKER</strong><br><br>  Slim fit<br>  Tapered-to-ankle shape<br>  High-stretch material<br>  Part-elasticated, part-drawcord waistband<br>- Internal drawcord<br>  Elasticated ankle cuffs<br>  Zip side pockets<br>  Reflective Gymshark logo to upper leg<br>  78% Nylon, 22% Elastane<br>  Model is 6\'2 and wears size M<br>  Label Colour: Black<br><br>The kind of joggers that every locker needs. A super stretchy material and lightweight feel make the Training Joggers an all-rounder in conditioning, whether its big lifts or breathless cardio. Your training rotation just got even more versatile.</div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtraining-joggersh1', NULL, '2020-04-20 00:11:17', '2020-05-14 22:49:39'),
(90, '60456fe', '<h1 class=\"pinfo__heading\">critical joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<span>Get the job done.</span><br><br><span> Slim fit</span><br><span> Tapered-to-ankle shape</span><br><span> Ribbed cuffs</span><br><span> Adjustable drawcord waist</span><br><span> Side pockets</span><br><span> Embroidered Gymshark logo</span><br><span> 60% Polyester, 35% Cotton, 5% Elastane</span><br><span> Model is 6\'1\" and wears a size M</span><br><span>- Label Colour: Athletic Marl</span><br><br><span>The joggers every gym bag needs: understated, comfortable and reliable. The multi-fabric construction of the Critical Joggers offers the stretch to support and endure training session upon training session.</span>\n</div>', 32, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcritical-joggersh1', NULL, '2020-04-20 00:11:18', '2020-05-14 22:49:39'),
(91, 'FC3d21a', '<h1 class=\"pinfo__heading\">legacy shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>BUILD YOUR LEGACY</strong><br><br>  Slim fit<br>  Durable loopback material<br>  Elasticated drawcord to waistband<br>  Open side pockets<br>  Printed Legacy logo to thigh<br>  80% Cotton, 20% Polyester.<br>  Model is 62 and wears size M<br>  Label Colour: Black<br><br>Train with passion and power in the Legacy Shorts. Slightly shortened to expose your lower quad and finished with our classic Legacy logo, these gym shorts unite a physique-boosting fit with our authentic bodybuilding look.</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-shortsh1', NULL, '2020-04-20 00:11:55', '2020-05-14 22:49:39'),
