(97, 'B92368c', '<h1 class=\"pinfo__heading\">vital seamless shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>ENDEAVOUR TO PERFORM</strong><br><br>  Regular fit<br>  8 inch in-seam length<br>  Physique-enhancing seamless textures<br>  DRY technology<br>  Raised rubber Gymshark logos to waistband<br>  Heat-sealed Gymshark logo to leg<br>  67% Nylon, 33% Polyester<br>  Model is 60 and wears size M<br>  Label Colour: Petrol Blue Marl<br><br>Train, sweat and perform in the Vital Seamless Shorts: a highly technical formation combined with an assuring design. DRY technology removes sweat from the skins surface to keep you focused and a seamless nylon-poly construction moves effortlessly with you. These gym shorts are Vital for your conditioning journey.</div>', 31, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingvital-seamless-shortsh1', NULL, '2020-04-20 00:12:00', '2020-05-14 22:49:39'),
