(99, 'E82ea86', '<h1 class=\"pinfo__heading\">element shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<div>\n<p class=\"p1\"><strong>BE IN YOUR ELEMENT, OWN YOUR PERFORMANCE.</strong></p>\n</div>\n<div></div>\n<div>\n<span style=\"white-space: pre;\"> - </span>Athletic, relaxed fit</div>\n<div>\n<span style=\"white-space: pre;\"> - </span>Branded flat internal drawcord</div>\n<div>\n<span style=\"white-space: pre;\"> - </span>Zipped pockets</div>\n<div>\n<span style=\"white-space: pre;\"> - </span>Tab logo</div>\n<div>\n<span style=\"white-space: pre;\"> - </span>9<span style=\"white-space: pre;\"><span>5% Polyester, 5% Elastane</span></span><br><meta charset=\"utf-8\">\n<span>- Model is 5\'11\" and wears a size S</span>\n</div>\n<div>\n<meta charset=\"utf-8\">\n<span>- Label Colour: Platinum Grey</span>\n</div>\n<div><span><br></span></div>\n<div></div>\n<div>The Element Shorts are your essential shorts for a gym workout, athletic training or sports practice. Protective, supportive and comfortable, they offer all you could need and more.</div>\n</div>', 32, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingelement-shortsh1', NULL, '2020-04-20 00:12:01', '2020-05-14 22:49:39'),
(100, '6C45851', '<h1 class=\"pinfo__heading\">element hiit 9\" shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>HIIT HARDER</strong><br><br>  Slim fit<br>  9 in-seam<br>  Breathable mesh panels<br>  Side split hem for increased range of motion<br>  Zip side pockets<br>  Adjustable drawcord to waistband<br>  Heat-sealed Gymshark logo to leg<br>  Main: 87% Polyester, 13% Elastane. Mesh Panels: 73% Recycled Polyester, 20% Polyester, 7% Elastane. Mesh Pocket Bags: 100% Polyester.<br>  Model is 511 and wears size S<br>  Label Colour: Black<br><br>The Element HIIT 9 Shorts are designed for you to HIIT every workout, hard. A subtle side split so you can move freely, an adjustable drawcord so you can move comfortably and zipped side pockets so you can move without distractions.</div>', 31, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingelement-hiit-9-shortsh1', NULL, '2020-04-20 00:12:02', '2020-05-14 22:49:39'),
(101, '817acdc', '<h1 class=\"pinfo__heading\">element hiit 7\" shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>HIIT HARDER</strong><br><br>  Slim fit<br>  7 in-seam<br>  Breathable mesh panels<br>  Side split hem for increased range of motion<br>  Zip side pockets<br>  Adjustable drawcord to waistband<br>  Heat-sealed Gymshark logo to leg<br>  Main: 87% Polyester, 13% Elastane. Mesh Panels: 73% Recycled Polyester, 20% Polyester, 7% Elastane. Mesh Pocket Bags: 100% Polyester.<br>  Model is 6\'0 and wears size M<br>  Label Colour: Black<br><br>Just like your training, sometimes you need a bit of variation. The Element HIIT 7 Shorts give you just that. A short with everything you need for every kind of training: an adjustable drawcord waistband, zipped side pockets and a split hem for full range of movement.</div>', 31, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingelement-hiit-7-shortsh1', NULL, '2020-04-20 00:12:03', '2020-05-14 22:49:39'),
(102, 'FB762c8', '<h1 class=\"pinfo__heading\">element hiit 2 in 1 shorts</h1>\n', '<div class=\"pdp-accordion__body\"><p><strong>HIIT HARDER</strong><br><br>  Slim fit<br>  Undershorts: Baselayer fit. Overshorts: Slim fit.<br>  7 in-seam<br>  Breathable mesh panels<br>  Side split hem for increased range of motion<br>  Zip side pockets<br>  Adjustable drawcord to waistband<br>  Heat-sealed Gymshark logo to leg<br>  Main: 87% Polyester, 13% Elastane. Mesh Panels: 73% Recycled Polyester, 20% Polyester, 7% Elastane. Mesh Pocket Bags: 100% Polyester.<br>  Model is 60 and wears size M<br>  Label Colour: Black<br><br>Move faster; lift heavier; HIIT harder. The Element HIIT 2-in-1 Shorts are created for you to be, and do, your best. With a baselayer fit undershort and slim overshorts for maximum comfort and confidence with mesh panels for maximum breathability and zip side pockets for maximum convenience.</p></div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingelement-hiit-2-in-1-shortsh1', NULL, '2020-04-20 00:12:04', '2020-05-14 22:49:39'),
