(109, '064c5f1', '<h1 class=\"pinfo__heading\">reset shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>MADE FOR MOVEMENT</strong><br><br>  Regular fit<br>  Angular contrast mesh panels<br>  Mesh channel to back yoke<br>  DRY technology<br>  Adjustable drawcord waistband<br>  Reflective Gymshark logo to leg<br>  86% Polyester, 14% Elastane<br>  Model is 60 and wears size M<br>  Label Colour: Black<br><br>The Reset Shorts have been engineered with a durable, high-stretch material, breathable mesh panels and sweat-wicking DRY technology to ensure movement, ventilation and focus. Its crucial that all concentration - while you perform - is on really performing; the design of these training shorts has been calculated to guarantee complete focus.</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingreset-shortsh1', NULL, '2020-04-20 00:12:11', '2020-05-14 22:49:39'),
