(112, 'D3a3a3e', '<h1 class=\"pinfo__heading\">bold shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<strong>BE BOLD.</strong><br><br><span> Regular fit</span><br><span> Lightweight material build</span><br><span> Twin-needle stitching</span><br><span> Ribbed waistband with adjustable drawcord</span><br><span> Zip side pockets</span><br><span> Screen-printed branding to thigh and lower back leg</span><br>- 62% Polyester, 33% Cotton, 5% Elastane<br><span> Model is 6\'0\" and wears size M</span><br><span> Label Color: Electric Blue</span><br><br><span>Show up and stand out in the Bold Shorts. The comfort and support of these gym shorts - provided by a cotton-elastane material and ribbed waistband - combines with a powerful aesthetic created by bright colourways and a unique Gymshark graphic to the back of the leg.</span>\n</div>', 32, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingbold-shortsh1', NULL, '2020-04-20 00:12:14', '2020-05-14 22:49:39'),
(113, '1457aa6', '<h1 class=\"pinfo__heading\">maximize shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>BIG PRESENCE, BIGGER LIFTS.</strong><br><br><span>- Slim fit</span><br><span>- Open side pockets</span><br><span>- Drawcord waistband</span><br><span>- Raw edge hem</span><br><span>- Printed Gymshark Logo</span><br><span>- 60% Polyester 35% Cotton 5% Elastane</span><br><span>- Model is 60 and wears size M</span><br><span>- Label Color: Deep Claret</span><br><br><span>Made for lifting, with added style. Maximize Shorts are perfect for those big movements with a physique shaping cut and form enhancing materials. Plus, with this range of color and our statement branding, youre sure to stand out, wherever you are.</span>\n</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingmaximize-shortsh1', NULL, '2020-04-20 00:12:15', '2020-05-14 22:49:39'),
(114, 'F5f6a1d', '<h1 class=\"pinfo__heading\">contemporary shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>FINE-TUNE YOUR TRAINING</strong><br><br>  Slim fit<br>  Mesh construction to back leg<br>  Forward-facing seams<br>  Adjustable drawcord to waistband<br>  Zip side pocket<br>  Reflective Gymshark logo to leg<br>  86% Polyester, 14% Elastane<br>  Model is 62 and wears size S<br>  Label Colour: Black<br><br>Stop working out and start performing in the Contemporary Shorts, a design focused on movement reinforcement. Boasting an unrestrictive fit with a high-stretch elastane content, alongside mesh structures and sweat-wicking properties, they offer freedom, ventilation and precision through those crucial moments of your training.</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcontemporary-shortsh1', NULL, '2020-04-20 00:12:16', '2020-05-14 22:49:39'),
(115, '2D3233b', '<h1 class=\"pinfo__heading\">tonal shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>THE ONE SHADE STYLE</strong><br><br>  Slim fit<br>  Thick material build<br>  Elasticated waistband with contrast tape drawcords<br>  Open side pockets<meta charset=\"utf-8\">\n<span>with internal zip pocket</span><br>  Tonal panel logo to thigh<br>  Be A Visionary print to hip<br>  70% Cotton, 30% Polyester<br>  Model is 60 and wears size M<br>  Label Colour: Olive Khaki<br><br>An everyday style, expressed by you. The Tonal Shorts are the base of any outfit you build with a one-tone design and low-profile construction, making them a versatile addition to your lifestyle wardrobe. However you style them, comfort is certain with a soft cotton-heavy material base.</div>', 32, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtonal-shortsh1', NULL, '2020-04-20 00:12:16', '2020-05-14 22:49:39'),
(116, '83d8089', '<h1 class=\"pinfo__heading\">element shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<div>\n<p class=\"p1\"><strong>BE IN YOUR ELEMENT, OWN YOUR PERFORMANCE</strong></p>\n</div>\n<span>- Athletic, relaxed fit</span><br><span>- Branded flat internal drawcord</span><br><span>- Zipped pockets</span><br><span>- Tab logo</span><br><span>- 95% Polyester, 5% Elastane</span><br><span>- Model is 5\'11\" and wears a size S</span><br><span>- Label Colour: Flame Red</span><br><br><span>The Element Shorts are your essential shorts for a gym workout, athletic training or sports practice. Protective, supportive and comfortable, they offer all you could need and more.</span>\n</div>', 32, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingelement-shortsh1', NULL, '2020-04-20 00:12:17', '2020-05-14 22:49:39'),
