(125, 'F42cac5', '<h1 class=\"pinfo__heading\">compound shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>PUSH. PULL. LIFT.</strong><br><br>  Regular fit<br>  Heavy-duty material build<br>  High-stretch rib panel to gusset<br>  Adjustable drawcord waistband<br>  Open side pockets<br>  Single zip pocket to back<br>  Herringbone tape detailing<br>  Embroidered Gymshark logo to thigh<br>  Main: 87% Cotton, 13% Polyester. Rib 100% Cotton.<br>  Model is 60 and wears size M<br>  Label Colour: Black Marl<br><br>New 1RM? No problem. The Compound collection has been specifically designed for just that: compound lifts. Whether its squat, bench or deadlift, the Compound Shorts are up to the test with a supportive, durable material and high-stretch panels to the inside of the leg. The only other question is, are you up to the test?</div>', 31, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcompound-shortsh1', NULL, '2020-04-20 00:12:25', '2020-05-14 22:49:39'),
