(130, '7Bb3bb5', '<h1 class=\"pinfo__heading\">vital seamless shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>ENDEAVOUR TO PERFORM</strong><br><br>  Regular fit<br>  8 inch in-seam length<br>  Physique-enhancing seamless textures<br>  DRY technology<br>  Raised rubber Gymshark logos to waistband<br>  67% Nylon, 33% Polyester<br>  Model is 5\'11 and wears size S<br>  Label Colour: Black Marl<br><br>Train, sweat and perform in the Vital Seamless Shorts: a highly technical formation combined with an assuring design. DRY technology removes sweat from the skins surface to keep you focused and a seamless nylon-poly construction moves effortlessly with you. These gym shorts are Vital for your conditioning journey.</div>', 31, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingvital-seamless-shortsh1', NULL, '2020-04-20 00:12:30', '2020-05-14 22:49:39'),
(131, '95db945', '<h1 class=\"pinfo__heading\">arrival shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<p><strong>REDEFINING YOUR POTENTIAL</strong><br><br><span> Slim</span>fit<br><span> Lightweight material</span><br><span> DRY technology</span><br><span> Elasticated waistband with flat drawcords</span><br><span> Welt zip side pockets</span><br><span> Printed Gymshark logo to thigh</span><br><span> 100% Polyester</span><br><span> Model is 511 and wears size S</span><br><span> Label Colour: Acid Lime</span><br><br><span>A collection here to help you realise everything youre capable of, Arrival turns exercise into purposeful performance. Ensure maximum movement and exertion throughout training with a lightweight, high-stretch material-build and keep revitalised through every action with DRY technology wicking sweat from the skin.</span></p>\n</div>', 31, 20, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingarrival-shortsh1', NULL, '2020-04-20 00:12:31', '2020-05-14 22:49:39'),
(132, 'D11d4e0', '<h1 class=\"pinfo__heading\">hybrid swim shorts</h1>\n', '<div class=\"pdp-accordion__body\"><p><strong>SUN SOLD SEPARATELY<br></strong><br><span> Slim fit</span><br><span> Street-to-beach hybrid</span><br><span> Adjustable drawcord waistband with popper button</span><br><span> 4-way stretch material</span><br><span> Anti-water saturation finish to material</span><br><span> Open side pockets and zip back pocket with D-Ring to waistband</span><br><span> Heat-sealed Gymshark logo</span><br><span> 43% CD Polyester, 43% Polyester, 14% Elastane</span><br><span> Model is 511 and wears size S</span><br><span> Label Colour:</span>Charged Emerald Marl<br><br><span>The Hybrid Swimshorts have been designed so you can take your rest day or vacation from street-to-beach with trend-inspired colourways and functional touches like a D-ring to the waistband to attach essentials, alongside a high-stretch material to keep you in check in the water.</span></p></div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinghybrid-swim-shortsh1', NULL, '2020-04-20 00:12:31', '2020-05-14 22:49:39'),
