(135, '4C64dd0', '<h1 class=\"pinfo__heading\">element shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<div>\n<p class=\"p1\"><strong>BE IN YOUR ELEMENT, OWN YOUR PERFORMANCE.</strong></p>\n</div>\n<div></div>\n<div>\n<span style=\"white-space: pre;\"> - </span>Athletic, relaxed fit</div>\n<div>\n<span style=\"white-space: pre;\"> - </span>Branded flat internal drawcord</div>\n<div>\n<span style=\"white-space: pre;\"> - </span>Zipped pockets</div>\n<div>\n<span style=\"white-space: pre;\"> - </span>Tab logo</div>\n<div>\n<span style=\"white-space: pre;\"> - </span>9<span style=\"white-space: pre;\"><span>5% Polyester, 5% Elastane</span></span><br><meta charset=\"utf-8\">\n<span>- Model is 6\'0\" and wears a size M</span>\n</div>\n<div>\n<meta charset=\"utf-8\">\n<span>- Label Colour: Black</span>\n</div>\n<div><span><br></span></div>\n<div></div>\n<div>The Element Shorts are your essential shorts for a gym workout, athletic training or sports practice. Protective, supportive and comfortable, they offer all you could need and more.</div>\n</div>', 32, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingelement-shortsh1', NULL, '2020-04-20 00:12:34', '2020-05-14 22:49:39'),
(136, 'B50a021', '<h1 class=\"pinfo__heading\">compound shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>PUSH. PULL. LIFT.</strong><br><br>  Regular fit<br>  Heavy-duty material build<br>  High-stretch rib panel to gusset<br>  Adjustable drawcord waistband<br>  Open side pockets<br>  Single zip pocket to back<br>  Herringbone tape detailing<br>  Embroidered Gymshark logo to thigh<br>  Main: 87% Cotton, 13% Polyester. Rib 100% Cotton.<br>  Model is 61 and wears size M<br>  Label Colour: Sand Stone<br><br>New 1RM? No problem. The Compound collection has been specifically designed for just that: compound lifts. Whether its squat, bench or deadlift, the Compound Shorts are up to the test with a supportive, durable material and high-stretch panels to the inside of the leg. The only other question is, are you up to the test?</div>', 32, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcompound-shortsh1', NULL, '2020-04-20 00:12:35', '2020-05-14 22:49:39'),
(137, 'CD2e8fe', '<h1 class=\"pinfo__heading\">critical shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<span>Get the job done.</span><br><br><span> Regular fit</span><br><span> Raw edge hem</span><br><span> Adjustable drawcord waist</span><br><span> Side pockets</span><br><span> Embroidered Gymshark logo</span><br><span> 60% Polyester, 35% Cotton, 5% Elastane</span><br><span> M</span><span>odel is 6\'0\" and wears a size M</span><br><span>- Label Colour: Athletic Marl</span><br><br><span>Tough and ready, the Critical Shorts keep things simple and do the basics well. A high-stretch elastane material coupled with an adjustable waistband supports and enables your movement while a simple design keeps you under the radar.</span>\n</div>', 32, 25, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcritical-shortsh1', NULL, '2020-04-20 00:12:36', '2020-05-14 22:49:39'),
(138, 'D1041ac', '<h1 class=\"pinfo__heading\">maximize shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>BIG PRESENCE, BIGGER LIFTS.</strong><br><br><span>- Slim fit</span><br><span>- Open side pockets</span><br><span>- Drawcord waistband</span><br><span>- Raw edge hem</span><br><span>- Printed Gymshark Logo</span><br><span>- 60% Polyester 35% Cotton 5% Elastane</span><br><span>- Model is 60 and wears size M</span><br><span>- Label Color: Black</span><br><br><span>Made for lifting, with added style. Maximize Shorts are perfect for those big movements with a physique shaping cut and form enhancing materials. Plus, with this range of color and our statement branding, youre sure to stand out, wherever you are.</span>\n</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingmaximize-shortsh1', NULL, '2020-04-20 00:12:36', '2020-05-14 22:49:39'),
