(142, '98987b7', '<h1 class=\"pinfo__heading\">element shorts</h1>\n', '<div class=\"pdp-accordion__body\">Be in your element, own your performance.<br><br>- Athletic, relaxed fit<br>- Branded flat internal drawcord<br>- Zipped pockets<br>- Tab logo<br>- 95% Polyester, 5% Elastane<br>- Model is 6\'0\" and wears a size M<br>- Label Colour: Electric Blue Marl<br><br>The Element Shorts are your essential shorts for a gym workout, athletic training or sports practice. Protective, supportive and comfortable, they offer all you could need and more.</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingelement-shortsh1', NULL, '2020-04-20 00:12:40', '2020-05-14 22:49:39'),
(143, '27caf25', '<h1 class=\"pinfo__heading\">arrival 5\" shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>REDEFINING YOUR POTENTIAL</strong><br><br><span> Slim fit</span><br><span> 5-inch inseam</span><br><span> Lightweight material</span><br><span> DRY technology</span><br><span> Elasticated waistband with flat drawcords</span><br><span> Welt zip side pockets</span><br><span> Heat-sealed Gymshark logo to thigh</span><br><span> 100% Polyester</span><br><span> Model is 511 and wears size S</span><br><span> Label Colour: Aqua Green</span><br><br><span>Give your training the freedom it needs to become purposeful performance with the Arrival 5 Shorts. With a short 5-inch inseam alongside a lightweight, sweat-wicking material and supportive adjustable waistband, you can trust that these shorts will allow you to move in every direction with ease and confidence, rep after rep or step after step.</span>\n</div>', 31, 20, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingarrival-5-shortsh1', NULL, '2020-04-20 00:12:41', '2020-05-14 22:49:39'),
(144, 'D09aefc', '<h1 class=\"pinfo__heading\">hyper sport shorts</h1>\n', '<div class=\"pdp-accordion__body\">Be the future.<br><br>  Regular fit<br>  Shortened 7 inseam<br>  Side split hem with bartack covered stitching<br>  Breathable feature waistband with flat drawcords<br>  4-way stretch mesh structures<br>  Laser cut detailing to waist<br>  Zip side pockets<br>  Woven-Jersey hybrid construction<br>  DRY technology<br>  Two-tone raised rubber logo<br>  Main: 85% Polyester, 15% Elastane. Mesh: 85% Nylon, 15 Elastane.<br>  Model is 61 and wears size M<br>  Label Colour: Black<br><br>The Hyper Sport Shorts have been engineered with futuristic conditioning in mind. Bringing the latest performance technology into the design of a highly innovative range, these shorts enhance your training today, to prepare your performance of tomorrow. Constructed with strategically-placed mesh panels, sweat-wicking DRY technology and a hybrid material build, they offer freedom of motion and breathability throughout.<br><br>\n</div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinghyper-sport-shortsh1', NULL, '2020-04-20 00:12:42', '2020-05-14 22:49:39');
