(145, '503fb15', '<h1 class=\"pinfo__heading\">contemporary shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>FINE-TUNE YOUR TRAINING</strong><br><br><span> Slim fit</span><br><span> Mesh construction to back leg</span><br><span> Forward-facing seams</span><br><span> Adjustable drawcord to waistband</span><br><span> Zip side pocket</span><br><span> Reflective Gymshark logo to leg</span><br><span> 86% Polyester, 14% Elastane</span><br><span> Model is 64 and wears size L</span><br><span> Label Colour: Olive Khaki</span><br><br><span>Stop working out and start performing in the Contemporary Shorts, a design focused on movement reinforcement. Boasting an unrestrictive fit with a high-stretch elastane content, alongside mesh structures and sweat-wicking properties, they offer freedom, ventilation and precision through those crucial moments of your training.</span>\n</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcontemporary-shortsh1', NULL, '2020-04-20 00:12:42', '2020-05-14 22:49:39'),
(146, '93e84cd', '<h1 class=\"pinfo__heading\">compound shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>PUSH. PULL. LIFT.</strong><br><br>  Regular fit<br>  Heavy-duty material build<br>  High-stretch rib panel to gusset<br>  Adjustable drawcord waistband<br>  Open side pockets<br>  Single zip pocket to back<br>  Herringbone tape detailing<br>  Embroidered Gymshark logo to thigh<br>  Main: 87% Cotton, 13% Polyester. Rib 100% Cotton.<br>  Model is 60 and wears size M<br>  Label Colour: Athletic Marl<br><br>New 1RM? No problem. The Compound collection has been specifically designed for just that: compound lifts. Whether its squat, bench or deadlift, the Compound Shorts are up to the test with a supportive, durable material and high-stretch panels to the inside of the leg. The only other question is, are you up to the test?</div>', 32, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcompound-shortsh1', NULL, '2020-04-20 00:12:43', '2020-05-14 22:49:39'),
(147, 'FD79829', '<h1 class=\"pinfo__heading\">critical shorts</h1>\n', '<div class=\"pdp-accordion__body\">Get the job done.<br><br>  Regular fit<br>  Raw edge hem<br>  Adjustable drawcord waist<br>  Side pockets<br>  Embroidered Gymshark logo<br>  60% Polyester, 35% Cotton, 5% Elastane<br>  Model is 6\'0\" and wears a size M<br>- Label Colour: Deep Claret<br><br>Tough and ready, the Critical Shorts keep things simple and do the basics well. A high-stretch elastane material coupled with an adjustable waistband supports and enables your movement while a simple design keeps you under the radar.</div>', 32, 25, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcritical-shortsh1', NULL, '2020-04-20 00:12:44', '2020-05-14 22:49:39'),
(148, 'E36cc1e', '<h1 class=\"pinfo__heading\">contrast shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>REPETITIONS, BUT NOT THE KIND YOU MIGHT THINK.</strong><br><br>  Slim fit<br> Adjustable drawcord waistband with contrast ends<br>  Printed Gymshark logo to leg<br>  Printed repeat Gymshark text to inside leg<br>  62% Polyester, 33% Cotton, 5% Elastane<br>  Model is 61 and wears size M<br>  Label Color: Emerald Green<br><br>The Contrast Shorts are built to live, rest and repeat, with a street-conscious silhouette and comfort-inspired design. Style with ease with singe-shade colorways and move with freedom thanks to a soft, stretchy blend of polyester, cotton and elastane. Complete with repeating Gymshark text to the inner leg for an aesthetic that makes itself known.</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcontrast-shortsh1', NULL, '2020-04-20 00:12:45', '2020-05-14 22:49:39'),
(149, '01102e6', '<h1 class=\"pinfo__heading\">tech shorts</h1>\n', '<div class=\"pdp-accordion__body\">Todays training; tomorrows tech.<br><br>  Regular fit<br>  4-way-stretch woven material<br>  Laser perforation details to hips<br>  Angular side seams and split hem<br>  Reverse zip pockets with self-fabric pocket bags<br>  Fused hem and covered bartack stitching<br>  Elasticated waistband with raised rubber Gymshark print<br>  Raised rubber Gymshark logo to leg<br>  88% Polyester, 12% Elastane<br>  Model is 61 and wears size M<br>  Label Colour: Black<br><br>Give your performance the edge it deserves with the advanced Tech Shorts. Uniting the breathability of laser perforation and lightweight fabrics with the reinforcement of a 4-way-stretch material and resilient elasticated waistband, these shorts combine innovations in design, construction and endurance.</div>', 31, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtech-shortsh1', NULL, '2020-04-20 00:12:46', '2020-05-14 22:49:39'),
(150, 'DDbe41f', '<h1 class=\"pinfo__heading\">tonal shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>THE ONE SHADE STYLE</strong><br><br> Slim fit<br> Thick material build<br> Elasticated waistband with contrast tape drawcords<br> Open side pockets with internal zip pocket<br> Tonal panel logo to thigh<br> Be A Visionary print to hip<br> 70% Cotton, 30% Polyester<br> Main Image/ Right Model is 61 and wears size M Left model is 6\'3\" and wears XXL<br> Label Colour: Eclipse Blue<br><br>An everyday style, expressed by you. The Tonal Shorts are the base of any outfit you build with a one-tone design and low-profile construction, making them a versatile addition to your lifestyle wardrobe. However you style them, comfort is certain with a soft cotton-heavy material base.</div>', 31, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtonal-shortsh1', NULL, '2020-04-20 00:12:47', '2020-05-14 22:49:39'),
(151, 'B617946', '<h1 class=\"pinfo__heading\">legacy hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>BUILD YOUR LEGACY</strong><br><br><span> Slim fit</span><br><span> Soft loopback material</span><br><span> Three-piece hood with drawcords and crossover neckline</span><br><span> Ribbed hem and cuffs</span><br><span> Open pouch pocket to front</span><br><span> Printed Legacy logo to front</span><br><span> 60% Cotton, 40% Polyester</span><br><span> Model is 6\'0 and wears sizeM</span><br><span> Label Colour: Blaze Orange</span><br><br><span>The Legacy Hoodie is an iconic design thats part of Gymsharks history. Boasting a flattering silhouette that stretches effortlessly and a classic printed Gymshark logo, it promises all the function and inspiration that any workout could need.</span>\n</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-hoodieh1', NULL, '2020-04-20 00:15:51', '2020-05-14 22:49:39'),
(152, '0F11486', '<h1 class=\"pinfo__heading\">legacy drop armhole hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>BUILD YOUR LEGACY</strong><br><br>  Slim fit<br>  Drop armhole<br>  Three-piece hood with drawcords and crossover neckline<br>  Printed Legacy logo to front<br>  100% Cotton<br>  Model is 6\'0 and wears size M<br>  Label Colour: Charged Emerald<br><br>A contemporary classic. The Legacy Drop Arm Hoodie was born in bodybuilding but its been rebuilt to help see you through your training. It still features the classic Gymshark logo and durable material youve come to expect from the Legacy range, and its drop armhole design gives you an increased freedom of movement throughout every lift.</div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-drop-armhole-hoodieh1', NULL, '2020-04-20 00:15:52', '2020-05-14 22:49:39'),
(153, '0F51174', '<h1 class=\"pinfo__heading\">legacy hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>BUILD YOUR LEGACY</strong><br><br>  Slim fit<br>  Soft loopback material<br>  Three-piece hood with drawcords and crossover neckline<br>  Ribbed hem and cuffs<br>  Open pouch pocket to front<br>  Printed Legacy logo to front<br>  60% Cotton, 40% Polyester<br>  Label Colour: Charged Emerald<br><br>The Legacy Hoodie is an iconic design thats part of Gymsharks history. Boasting a flattering silhouette that stretches effortlessly and a classic printed Gymshark logo, it promises all the function and inspiration that any workout could need.</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-hoodieh1', NULL, '2020-04-20 00:15:52', '2020-05-14 22:49:39'),
(154, '187f5b0', '<h1 class=\"pinfo__heading\">legacy drop armhole hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>BUILD YOUR LEGACY</strong><br><br><span> Slim fit</span><br><span> Drop armhole</span><br><span> Three-piece hood with drawcords and crossover neckline</span><br><span> Printed Legacy logo to front</span><br><span> 100% Cotton</span><br><span> Model is 6\'0 and wears size M</span><br><span> Label Colour: Blaze Orange</span><br><br><span>A contemporary classic. The Legacy Drop Arm Hoodie was born in bodybuilding but its been rebuilt to help see you through your training. It still features the classic Gymshark logo and durable material youve come to expect from the Legacy range, and its drop armhole design gives you an increased freedom of movement throughout every lift.</span>\n</div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-drop-armhole-hoodieh1', NULL, '2020-04-20 00:15:53', '2020-05-14 22:49:39'),
(155, '87aa92a', '<h1 class=\"pinfo__heading\">compound zip hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>PUSH. PULL. LIFT.</strong><br><br>  Regular fit<br>  Heavy-duty material build<br>  High-stretch rib panels to back to allow extra movement<br>  Full zip front with zip guard<br>  Funnel neck hood with drawcords<br>  Open side pockets<br>  Herringbone tape detailing<br>  Embroidered Gymshark logo to chest<br>  Main: 87% Cotton, 13% Polyester. Rib: 100% Cotton. Lining: 100% Cotton.<br>  Model is 60 and wears size M<br>  Label Colour: Sand Stone<br><br>The Compound Zip Hoodie is for serious lifters, seriously lifting. Push your lifts to the max or warm up without restriction thanks to super stretchy panels and a strong, durable material. With complete movement and support, youll know that when its time for that next heavy lift, its down to you, and only you.</div>', 31, 55, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcompound-zip-hoodieh1', NULL, '2020-04-20 00:15:54', '2020-05-14 22:49:39'),
(156, '83e5222', '<h1 class=\"pinfo__heading\">speed running jacket</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>STEP INTO CARDIO</strong><br><br>  Regular fit<br>  Super lightweight, water-repellent material<br>  Breathable overlap feature to mid-back<br>  Panelled design with bar tacks<br>  Funnel neck hood with adjustable toggle to back<br>  Zip side pockets<br>  Embossed Gymshark print<br>  100% Polyester<br>  Model is 60 and wears size M<br>  Label Color: Black<br><br>Run with speed come rain or shine in the Speed Running Jacket. Its water repellent, to ensure you stay dry step-after-step, and lightweight and breathable, to keep you cool when the running gets tough. Featured additions include a contemporary funnel neck and an embossed Gymshark x Speed print ensure you dont just talk-the-talk, but run-the-walk too.</div>', 32, 55, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingspeed-running-jacketh1', NULL, '2020-04-20 00:15:55', '2020-05-14 22:49:39'),
(157, 'F174913', '<h1 class=\"pinfo__heading\">maximize hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>BIG PRESENCE, BIGGER LIFTS.</strong><br><br><span>- Slim fit</span><br><span>- Kangaroo pocket</span><br><span>- Ribbed hem/cuffs</span><br><span>- Drawcord hood</span><br><span>- Printed Gymshark Logo</span><br><span>- 60% Polyester 35% Cotton 5% Elastane</span><br><span>- Model is 60 and wears size M</span><br><span>- Label Color: Black</span><br><br><span>For when the hard work is done, but the grind continues. The Maximize Pullover makes for the perfect pre and post workout additional layer so you can style it out in the streets just like you do in the gym.</span>\n</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingmaximize-hoodieh1', NULL, '2020-04-20 00:15:56', '2020-05-14 22:49:39'),
(158, '2103116', '<h1 class=\"pinfo__heading\">maximize hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>BIG PRESENCE, BIGGER LIFTS.</strong><br><br>- Slim fit <br>- Kangaroo pocket <br>- Ribbed hem/cuffs<br>- Drawcord hood<br>- Printed Gymshark Logo <br>- 60% Polyester 35% Cotton 5% Elastane<br>- Model is 62 and wears size M<br>- Label Color: Oat Beige<br><br>For when the hard work is done, but the grind continues. The Maximize Pullover makes for the perfect pre and post workout additional layer so you can style it out in the streets just like you do in the gym.</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingmaximize-hoodieh1', NULL, '2020-04-20 00:15:57', '2020-05-14 22:49:39'),
(159, '35b5fe4', '<h1 class=\"pinfo__heading\">grade hoodie</h1>\n', '<div class=\"pdp-accordion__body\"><p><strong>REST HARD</strong><br><br>  Regular fit<br>  Super-soft, thick material<br>  Crossover three-piece hood<br>  Raglan sleeves<br>  Woven tab logo to hood<br>  100% Polyester<br>  Model is 61 and wears size M<br>  Label Color: Black<br><br>Because your resting deserves a separate wardrobe from your training. The Grade Pullover is made with an incredibly soft fleece material for all-day, everyday ease of wear. Add in versatile, one-tone colorways and a casual silhouette, and this pullover highlights your style to its fullest.</p></div>', 31, 55, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinggrade-hoodieh1', NULL, '2020-04-20 00:15:58', '2020-05-14 22:49:39'),
(160, 'C8ffc71', '<h1 class=\"pinfo__heading\">windcheater</h1>\n', '<div class=\"pdp-accordion__body\">Zip the world out.<br><br>  Regular fit<br>  Water repellent exterior and mesh-lined interior<br>  4-way-stretch woven material<br>  Reverse zip front<br>  Three-piece hood with adjustable toggles<br>  Zip side and chest pockets<br>  Reflective Gymshark print to arm and centre back<br> Main: 85% Nylon, 15% Elastane. Lining: 100% Polyester.<br>  Model is 60 and wears size M<br>  Label Colour:<meta charset=\"utf-8\">\n<span>Hunter Green</span><br><br>On days when the its you vs the weather, you can call on the Gymshark Windbreaker. Its lightweight, 4-way-stretch polyester construction is designed to ensure you can continue to move through your day as you planned. A wind-breaking, water-repellent exterior, and three-piece hood plays its part in keeping focus away from the elements, and on business as usual.</div>', 31, 65, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingwindcheaterh1', NULL, '2020-04-20 00:15:59', '2020-05-14 22:49:39'),
(161, '072173d', '<h1 class=\"pinfo__heading\">puffer jacket</h1>\n', '<div class=\"pdp-accordion__body\">Zip the world out.<br><br> Regular fit<br> Water repellent exterior<br> Full zip front with chin-guard<br> Insulating poly fill padding<br> Muscle-shaping bafflement seam lines<br> Adjustable toggles to hem<br> Zip side and internal pockets<br> Inserted jersey material cuffs<br> Reflective Gymshark print to sleeve<br> Main: 100% Polyester. Lining: 100% Polyester.<br> Model is 61 and wears size M<br> Label Colour: Black <br><br>The Puffer Jacket is your cold weather blockade. With thick, padded baffles and inserted material cuffs, you can zip up and keep on moving in this coat. Complete with a water repellent material, an adjustable hem and muscle-shaping seam lines, it promises to keep you feeling fresh and looking on form too.</div>', 32, 90, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingpuffer-jacketh1', NULL, '2020-04-20 00:16:00', '2020-05-14 22:49:39'),
(162, '8E5e48e', '<h1 class=\"pinfo__heading\">hydro jacket</h1>\n', '<div class=\"pdp-accordion__body\">No climate too harsh.<br><br>  Regular fit<br>  Full zip front with velcro zip guard<br>  Waterproof exterior and fleece-lined interior<br>  Internally and externally taped seams<br>  Fused hood with forward peak<br>  Adjustable toggles to hem and hood<br>  Zip side and chest pockets and internal popper-button chest pocket<br>  Printed reflective Gymshark logo to chest<br>  Clear silicone co-ordinate print to left arm<br>  Main: 86% Polyester, 14% Elastane. Lining: 100% Polyester.<br>  Model is 6\'0 and wears size M<br>  Label Colour: Dark Navy<br><br>In the Hydro Jacket, no matter the climate, you come out on top. Assembled with a fleece-lined interior and waterproof exterior, its construction keeps your body heat in and the elements out. Adding in a peaked hood and multiple zip pockets for extra protection, this jacket emanates futuristic design with a sleek, matte finish and low profile structure.</div>', 32, 70, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinghydro-jacketh1', NULL, '2020-04-20 00:16:00', '2020-05-14 22:49:39'),
