(164, 'F0e6093', '<h1 class=\"pinfo__heading\">bold hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<strong>BE BOLD.</strong><br><br><span> Regular fit</span><br><span> Lightweight material build</span><br><span> Ribbed hem and cuffs</span><br><span> Three-piece drawcord hood</span><br><span> Screen-printed logo to chest</span><br>- 62% Polyester, 33% Cotton, 5% Elastane<br><span> Model is 6\'0\" and wears size M</span><br><span> Label Color: Electric Blue</span><br><br><span>The Bold Hoodie is never one to shy away. Turns heads when you train in the, fittingly, bold design of this gym pullover. Its comfortable fit and lightweight construction make it ready for out-and-out lifting, over-and-over again.</span>\n</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingbold-hoodieh1', NULL, '2020-04-20 00:16:02', '2020-05-14 22:49:39'),
