(181, '6464400', '<h1 class=\"pinfo__heading\">track hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>THE SPORT CULTURE</strong><br><br>  Regular fit<br>  Three-piece hood with functional drawcords<br>  Ribbed hem and cuffs<br>  Open pouch pocket<br>  Embroidered Gymshark text to chest<br>  Woven tab to hem<br>  Crossover neckline<br>  100% Cotton<br>  Model is 60 and wears size M<br>  Label Colour: Eclipse Blue<br><br>Stand authentic in the Track Hoodie, a look inspired by old school sportswear. With a simple, one-tone design and comfortable cotton material build, this hoodie is the ideal throw-on pre or post training to keep you in the look - and mindset - of an athlete.<br>\n</div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtrack-hoodieh1', NULL, '2020-04-20 00:16:17', '2020-05-14 22:49:39'),
(182, 'EF02f36', '<h1 class=\"pinfo__heading\">maximize hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>BIG PRESENCE, BIGGER LIFTS.</strong><br><br><span>- Slim fit</span><br><span>- Kangaroo pocket</span><br><span>- Ribbed hem/cuffs</span><br><span>- Drawcord hood</span><br><span>- Printed Gymshark Logo</span><br><span>- 60% Polyester 35% Cotton 5% Elastane</span><br><span>- Model is 60 and wears size M</span><br><span>- Label Color: Deep Claret</span><br><br><span>For when the hard work is done, but the grind continues. The Maximize Pullover makes for the perfect pre and post workout additional layer so you can style it out in the streets just like you do in the gym.</span>\n</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingmaximize-hoodieh1', NULL, '2020-04-20 00:16:18', '2020-05-14 22:49:39'),
(183, '4Ced205', '<h1 class=\"pinfo__heading\">critical hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<span>Get the job done.</span><br><br><span> Regular fit</span><br><span> Raglan sleeve construction</span><br><span> Straight hem</span><br><span> Three-piece drawcord hood</span><br><span> Side entry pouch pocket</span><br><span> Embroidered Gymshark logo</span><br><span> 60% Polyester, 35% Cotton, 5% Elastane</span><br><span> Model is 6\'0\" and wears a size M</span><br><span>- Label Colour: Athletic Marl</span><br><br><span>The Critical Hoodie keeps the focus on training. Whether its to support your pre-workout stretching or for the times you just want to sweat your way through a training session, its the gym pullover youll rely on time and time again.</span>\n</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcritical-hoodieh1', NULL, '2020-04-20 00:16:19', '2020-05-14 22:49:39'),
(184, '21bc2ff', '<h1 class=\"pinfo__heading\">legacy drop armhole hoodie</h1>\n', '<div class=\"pdp-accordion__body\">Build your Legacy.<br><br>  Regular fit<br>  Drop armhole cut<br>  Fleece-lined material<br>  Three-piece drawcord hood<br>  Printed classic Gymshark logo<br>  100% Cotton<br>  Model is 6\'4\" and wears a size XL<br> Label Colour: Black<br><br>A contemporary classic. The Legacy Drop Arm Hoodie was born in bodybuilding but its been rebuilt to help see you through your training. It still features the classic Gymshark logo and durable material youve come to expect from the Legacy range, and its drop armhole design gives you an increased freedom of movement throughout every lift.</div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-drop-armhole-hoodieh1', NULL, '2020-04-20 00:16:20', '2020-05-14 22:49:39'),
(185, 'CF05ef8', '<h1 class=\"pinfo__heading\">laundered jacket</h1>\n', '<div class=\"pdp-accordion__body\">Your oldest favourite, on day one.<br><br>  Regular, slightly elongated fit<br>  Crease-finished material<br>  Angular panelled design<br>  Single water repellent layer with mesh lining<br>  Toggle drawcords to neck and hem<br>  Full zip front and zip side pockets<br>  Tonal logo to back and clear silicone logo to arm<br>  Main: 100% Nylon. Mesh: 100% Polyester<br>  Model is 6\'0\" and wears a size M<br>  Label Colour: Charcoal<br><br>Youve never trusted a jacket more. Effortlessly performing all the functions of a coat while displaying a worn-in, aged appearance, the Laundered Jacket is both practical and characterful. Finished with subtle tonal branding to the back, theres a hint of Gymshark there too.</div>', 32, 60, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglaundered-jacketh1', NULL, '2020-04-20 00:16:20', '2020-05-14 22:49:39'),
(186, 'DD71307', '<h1 class=\"pinfo__heading\">legacy hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<p>The iconic Legacy.<br><br>  Fitted and flattering design<br>  Fleece-lined<br>  Deep hood and kangaroo pocket<br>  Printed classic Gymshark logo<br>  60% Cotton, 40% Polyester<br>  Model is 6\'2\" and wears a size L.<br><br>Featuring the original Gymshark logo and our renowned tapering fit, the Gymshark Fitness Hoodie is a timeless classic pullover. With soft fabrics and a flattering silhouette, it promises the ultimate in comfort and versatility for a gym workout and for a rest day.</p>\n</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-hoodieh1', NULL, '2020-04-20 00:16:21', '2020-05-14 22:49:39'),
(187, '67a32b4', '<h1 class=\"pinfo__heading\">luxe legacy zip hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>THE NEXT GENERATION</strong><br><br><span> Slim fit</span><br><span> Full zip to centre front</span><br><span> Contrast block panels</span><br><span> Funnel neck with three-piece hood and drawcords</span><br><span> Ribbed hem and cuffs</span><br><span> Open side pockets</span><br><span> Embroidered classic Gymshark and Luxe logos to chest</span><br><span> 85% Cotton, 15% Elastane</span><br><span> Model is 62 and wears size M</span><br><span> Label Colour: Blue Lagoon</span><br><br><span>The Luxe Legacy Zip Hoodie - with its physique-enhancing fit and bold design - began a bodybuilding revolution. Now - new and optimised - its back for an evolution. Coming with the same famous contrast colour blocks and classic Gymshark logo, weve refined the fit and material to improve your style in the streets and your sets in the gym.</span>\n</div>', 31, 55, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingluxe-legacy-zip-hoodieh1', NULL, '2020-04-20 00:16:22', '2020-05-14 22:49:40'),
(188, '62b613d', '<h1 class=\"pinfo__heading\">luxe legacy zip hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>THE NEXT GENERATION</strong><br><br>  Slim fit<br>  Full zip to centre front<br>  Contrast block panels<br>  Funnel neck with three-piece hood and drawcords<br>  Ribbed hem and cuffs<br>  Open side pockets<br>  Embroidered classic Gymshark and Luxe logos to chest<br>  85% Cotton, 15% Elastane<br>  Model is 60 and wears size M<br>  Label Colour: Black<br><br>The Luxe Legacy Zip Hoodie - with its physique-enhancing fit and bold design - began a bodybuilding revolution. Now - new and optimised - its back for an evolution. Coming with the same famous contrast colour blocks and classic Gymshark logo, weve refined the fit and material to improve your style in the streets and your sets in the gym.</div>', 31, 55, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingluxe-legacy-zip-hoodieh1', NULL, '2020-04-20 00:16:23', '2020-05-14 22:49:40'),
(189, '3451b3c', '<h1 class=\"pinfo__heading\">luxe legacy hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<p><strong>THE NEXT GENERATION</strong><br><br><span> Slim fit</span><br><span> Contrast block panels</span><br><span> Funnel neck with three-piece hood and drawcords</span><br><span> Ribbed hem and cuffs</span><br><span> Open pouch pockets to front</span><br><span> Embroidered classic Gymshark and Luxe logos to chest</span><br><span> 85% Cotton, 15% Elastane</span><br><span> Model is 60 and wears size M</span><br><span> Label Colour: Blue Lagoon</span><br><br><span>Inspired by the first generation, to inspire the next generation. The Luxe Legacy Pullover is a new addition to the OG Luxe Legacy collection, boasting the same physique-enhancing fit and classic Gymshark logo with a new and improved material blend to see you through rest day and chest day in equal measure.</span></p>\n</div>', 32, 55, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingluxe-legacy-hoodieh1', NULL, '2020-04-20 00:16:24', '2020-05-14 22:49:40'),
