(199, 'DF678dc', '<h1 class=\"pinfo__heading\">training 1/4 zip pullover</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>IN YOUR LOCKER</strong><br><br>  Slim fit<br>  Lightweight, high-stretch material<br>  Muscle-shaping seam lines<br>  1/4 zip to centre of the front<br>  Long raglan sleeves<br>  Reflective Gymshark logo to the chest<br>  78% Nylon, 22% Elastane<br>  Model is 6\'0 and wears size M<br>  Label Colour: Platinum Grey<br><br>This is the zip up for every warm up. Add the Training 1/4 Zip pullover to your training rotation for comfort and concentration throughout. Its been designed with a lightweight, stretchy material that follows your profile closely so every stretch and rep of your warm up, or full workout, has the focus it needs.</div>', 31, 55, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtraining-14-zip-pulloverh1', NULL, '2020-04-20 00:16:33', '2020-05-14 22:49:40'),
