(263, '0A49214', '<h1 class=\"pinfo__heading\">block long sleeve t-shirt</h1>\n', '<div class=\"pdp-accordion__body\"><p><strong>THE BIG KID ON THE BLOCK<br></strong><br><span> Slim fit</span><br><span> Long raglan sleeves</span><br><span> Crew neck</span><br><span> Dropped hem</span><br><span> Twin-needle stitching to arm and neck holes</span><br><span> Printed Block logo to chest</span><br><span> 95% Cotton, 5% Elastane</span><br><span> Model is 60 and wears size M</span><br><span> Label Colour:</span>Athletic Marl/White<br><br><span>The Block Long Sleeve T-Shirt is a loud style and a proud part of the Gymshark story. Designed for the street and built for movement, its long raglan sleeves shape your shoulders while a dropped hem and bold Block logo to the chest make a confident statement. A 5% elastane content ensures it stretches through your reps in the gym too.</span></p></div>', 31, 25, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingblock-long-sleeve-t-shirth1', NULL, '2020-04-20 00:18:08', '2020-05-14 22:49:40'),
(264, '8Ff80f6', '<h1 class=\"pinfo__heading\">raid t-shirt</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<strong>THE PURSUIT OF PROGRESS<span></span></strong><br><br><span> Regular fit</span><br><span> Mesh construction to back</span><br><span> DRY technology</span><br><span> Side split hem with popper buttons and drop to back</span><br><span> Set-in sleeves and crew neck</span><br><span> Fused bar tack stitches</span><br><span> Printed Gymshark logo to centre chest</span><br><span> Main: 74% Polyester 17% Viscose 9% Elastane. Mesh: 59% Polyester, 30% Nylon, 11% Elastane.</span><br><span> Model is 61 and wears size M</span><br><span> Label Colour: Golden Yellow</span><br><br><span>A hybrid of training, lifestyle and performance, the Raid Short Sleeve T-Shirt supports the everyday athlete in pursuit of ultimate results. Weve included a full mesh back for breathability, stretch and DRY technology so theres no sweat or restraints to detract from your training, making you the director of your results.</span>\n</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingraid-t-shirth1', NULL, '2020-04-20 00:18:09', '2020-05-14 22:49:40'),
(265, '37a105d', '<h1 class=\"pinfo__heading\">embroidered logo t-shirt</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>ALWAYS ON CALL</strong><br><br><span> Regular fit</span><br><span> Thick material build</span><br><span> Straight hem and set-in sleeves</span><br><span> Embroidered contrast Gymshark logo to centre chest</span><br><span> 95% Cotton, 5% Elastane</span><br><span> Main Image model is 63 and wears size XXL<br></span>- Other Model is 6\'1\" and wears size M<br><span> Label Colour: Athletic Marl</span><br><br><span>Whatever the workout, whenever the time, you can count on the Embroidered Logo T-Shirt. Its been built with a heavier-than-regular cotton base - with a supple 5% content - so it can endure and move through your reps, steps and stretches. Complete with a sharp contrast Gymshark embroidery to the chest.</span>\n</div>', 31, 25, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingembroidered-logo-t-shirth1', NULL, '2020-04-20 00:18:10', '2020-05-14 22:49:40'),
(266, 'E996b33', '<h1 class=\"pinfo__heading\">arrival t-shirt</h1>\n', '<div class=\"pdp-accordion__body\"><p class=\"p1\"><strong></strong><strong>REDEFINING YOUR POTENTIAL</strong><br><br><span> Slim fit</span><br><span> Lightweight material</span><br><span> Physique-accentuating flatlock seam lines</span><br><span> DRY technology</span><br><span> Straight hem</span><br><span> Set-in sleeves and crew neck</span><br><span> Printed Gymshark logo to chest</span><br><span> 88% Polyester, 12% Elastane</span><br><span> Model is 60 and wears size M</span><br><span> Label Colour: Electric Blue</span><br><br><span>The Arrival Short Sleeve T-Shirt is your admission to a new, purposeful approach to training. Created to encourage you to aspire more, perform more and achieve more, this gym top boasts fundamental performance technology for next-level results, with sweat-wicking DRY technology and a lightweight polyester-elastane material that enables maximum movement and exertion.</span></p></div>', 31, 15, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingarrival-t-shirth1', NULL, '2020-04-20 00:18:10', '2020-05-14 22:49:40'),
(267, '0Eec8ff', '<h1 class=\"pinfo__heading\">hyper sport t-shirt</h1>\n', '<div class=\"pdp-accordion__body\">Be the future.<br><br>  Regular fit<br>  4-way stretch mesh structures<br>  Raglan sleeves with taping feature<br>  Fused-edge collar<br>  Side split hem with taping feature<br>  Woven-Jersey hybrid construction<br>  DRY technology<br>  Printed tape to centre back<br>  Two-tone raised rubber logo<br>  Main: 88% Polyester, 12% Elastane. Mesh: 85% Nylon, 15% Elastane.<br>  Model is 61 and wears size M<br>  Label Colour: Black<br><br>Embody futuristic conditioning and limitless performance in the Hyper Sport T-Shirt. Technologically designed to ensure nothing distracts you from fulfilling your potential, this gym top hybrids a streamlined silhouette with 4-way stretch fabrics, strategically-placed mesh inserts and DRY technology for free motion, breathability and full focus.</div>', 31, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinghyper-sport-t-shirth1', NULL, '2020-04-20 00:18:11', '2020-05-14 22:49:40'),
(268, 'A429fbf', '<h1 class=\"pinfo__heading\">critical tank</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<span>Get the job done.</span><br><br><span> Regular fit</span><br><span> Straight hem</span><br><span> Printed Gymshark logo</span><br><span> 95% Cotton, 5% Elastane</span><br><span> Model is 6\'1\" and wears a size M.</span><br><span>- Label Color: White</span><br><br><span>A simple basic, perfect for training. Not making a noise but not compromising results, the Critical Tank is all you and your workout need. Its cotton-elastane fabric allows movement; its minimalist aesthetic ensures focus. It just gets the job done, no questions asked.</span>\n</div>', 31, 15, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcritical-tankh1', NULL, '2020-04-20 00:18:12', '2020-05-14 22:49:40'),
(269, 'BFe76dd', '<h1 class=\"pinfo__heading\">speed long sleeve t-shirt</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>STEP INTO CARDIO</strong><br><br>  Slim fit<br>  Super lightweight material<br>  All-over breathable perforation<br>  Taped shoulder seams<br>  Long set-in sleeves<br>  Straight hem and crew neck<br>  Printed Gymshark logo to chest<br>  Main: 90% Polyester, 10% Elastane. Panel: 91% Polyester, 9% Elastane.<br>  Model is 62 and wears size S<br>  Label Color: Electric Blue<br><br>With an incredibly lightweight material and all-over perforation, this running top continues to breathe, even if the cardios got you struggling for breath yourself. Add in taped shoulder seams and a movement-ready slim fit, and youll be confident in the Speed Long Sleeve T-Shirt, whether its your first step into cardio or your last mile.</div>', 32, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingspeed-long-sleeve-t-shirth1', NULL, '2020-04-20 00:18:13', '2020-05-14 22:49:40'),
