(308, 'CC729ed', '<h1 class=\"pinfo__heading\">legacy hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>BUILD YOUR LEGACY</strong><br><br><span> Slim fit</span><br><span> Soft loopback material</span><br><span> Three-piece hood with drawcords and crossover neckline</span><br><span> Ribbed hem and cuffs</span><br><span> Open pouch pocket to front</span><br><span> Printed Legacy logo to front</span><br><span> 60% Cotton, 40% Polyester</span><br><span> Model is 6\'0 and wears sizeM</span><br><span> Label Colour: Blaze Orange</span><br><br><span>The Legacy Hoodie is an iconic design thats part of Gymsharks history. Boasting a flattering silhouette that stretches effortlessly and a classic printed Gymshark logo, it promises all the function and inspiration that any workout could need.</span>\n</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-hoodieh1', NULL, '2020-04-20 00:20:11', '2020-05-14 22:49:40'),
(309, '417f04b', '<h1 class=\"pinfo__heading\">legacy drop armhole hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>BUILD YOUR LEGACY</strong><br><br>  Slim fit<br>  Drop armhole<br>  Three-piece hood with drawcords and crossover neckline<br>  Printed Legacy logo to front<br>  100% Cotton<br>  Model is 6\'0 and wears size M<br>  Label Colour: Charged Emerald<br><br>A contemporary classic. The Legacy Drop Arm Hoodie was born in bodybuilding but its been rebuilt to help see you through your training. It still features the classic Gymshark logo and durable material youve come to expect from the Legacy range, and its drop armhole design gives you an increased freedom of movement throughout every lift.</div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-drop-armhole-hoodieh1', NULL, '2020-04-20 00:20:11', '2020-05-14 22:49:40'),
(310, '56ffac8', '<h1 class=\"pinfo__heading\">legacy shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<strong>BUILD YOUR LEGACY</strong><br><br><span> Slim fit</span><br><span> Durable loopback material</span><br><span> Elasticated drawcord to waistband</span><br><span> Open side pockets</span><br><span> Printed Legacy logo to thigh</span><br><span> 80% Cotton, 20% Polyester.</span><br><span> Model is 60 and wears size M</span><br><span> Label Colour: Eclipse Blue</span><br><br><span>Train with passion and power in the Legacy Shorts. Slightly shortened to expose your lower quad and finished with our classic Legacy logo, these gym shorts unite a physique-boosting fit with our authentic bodybuilding look.</span><br>\n</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-shortsh1', NULL, '2020-04-20 00:20:12', '2020-05-14 22:49:40'),
