(350, 'ADc0482', '<h1 class=\"pinfo__heading\">lightweight seamless t-shirt</h1>\n', '<div class=\"pdp-accordion__body\">Access your highest performance.<br><br>  Regular fit<br>  Engineered mesh structures<br>  Forward-facing seams<br>  Lightweight material construction<br>  Raglan sleeves with marrow stitching<br>  Clean finish hem and cuffs<br>  77% Polyester, 23% Nylon<br>  Model is 61 and wears size M<br>  Label Colour: Black<br><br>Find the confidence to elevate your training in the Lightweight Seamless T-Shirt. A namely lightweight, polyester-nylon material, co-ordinated mesh structures for ventilation and clean-finish edges combine to unlock your highest potential. Forward-facing seam lines and the contouring details of the mesh patterns promote the profile of your physique.</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglightweight-seamless-t-shirth1', NULL, '2020-04-20 00:20:52', '2020-05-14 22:49:41'),
