(363, 'EF88ca2', '<h1 class=\"pinfo__heading\">speed tank</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>STEP INTO CARDIO</strong><br><br>  Slim fit<br>  NEW movement-inspired vest shape with scooped neck and dropped armholes <br>  Super lightweight material<br>  All-over breathable perforation<br>  Taped shoulder seams<br>  Printed Gymshark logo to chest<br>  Main: 90% Polyester, 10% Elastane. Panel: 91% Polyester, 9% Elastane.<br>  Model is 511 and wears size S<br>  Label Color: Smokey Grey<br><br>Step back from the squat rack; this ones for the running track. The Speed Tank will help you go the distance with a lightweight build to let you run freely, and full perforation to keep this tank top breathing. Featuring an all-new vest shape, with dropped armholes and a scooped neckline that allow unhinged movement, its simply been designed to run.</div>', 32, 25, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingspeed-tankh1', NULL, '2020-04-20 00:21:12', '2020-05-14 22:49:41'),
