(383, 'E9f8d22', '<h1 class=\"pinfo__heading\">speed running jacket</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>STEP INTO CARDIO</strong><br><br>  Regular fit<br>  Super lightweight, water-repellent material<br>  Breathable overlap feature to mid-back<br>  Panelled design with bar tacks<br>  Funnel neck hood with adjustable toggle to back<br>  Zip side pockets<br>  Embossed Gymshark print<br>  100% Polyester<br>  Model is 60 and wears size M<br>  Label Color: Black<br><br>Run with speed come rain or shine in the Speed Running Jacket. Its water repellent, to ensure you stay dry step-after-step, and lightweight and breathable, to keep you cool when the running gets tough. Featured additions include a contemporary funnel neck and an embossed Gymshark x Speed print ensure you dont just talk-the-talk, but run-the-walk too.</div>', 31, 55, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingspeed-running-jacketh1', NULL, '2020-04-20 00:21:30', '2020-05-14 22:49:41'),
(384, '8Aba480', '<h1 class=\"pinfo__heading\">combat cropped leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>FIGHTING FIT</strong><br><br>- Mid rise fit<br>- Elasticated waistband with internal silicone grip<br>- Contouring seams to bum and legs<br>- Patterned printed panels to front legs<br>- Cropped length<br>- Branded woven label to back waistband<br>- 88% Recycled Polyester 12% Lycra Elastane<br>- Model is 5\'6\" and wears size XS<br>- Label Colour: Black<br><br>No matter what kind of martial art youre into. The Combat Cropped Leggings will make sure youre doing it in comfort. Featuring a mid rise fit with an internal silicone grip to ensure no gaping or movement, unique pattern printed panels to the front and flattering contouring seaming to leg and bum. <br>\n</div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcombat-cropped-leggingsh1', NULL, '2020-04-20 00:23:26', '2020-05-14 22:49:41'),
(385, '14aa4b4', '<h1 class=\"pinfo__heading\">combat cropped leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>FIGHTING FIT</strong><br><br><span>- Mid rise fit</span><br><span>- Elasticated waistband with internal silicone grip</span><br><span>- Contouring seams to bum and legs</span><br><span>- Patterned printed panels to front legs</span><br><span>- Cropped length</span><br><span>- Branded woven label to back waistband</span><br><span>- 88% Recycled Polyester 12% Lycra Elastane</span><br><span>- Model is 5\'6\" and wears size XS</span><br><span>- Label Colour: Claret</span><br><br><span>No matter what kind of martial art youre into. The Combat Cropped Leggings will make sure youre doing it in comfort. Featuring a mid rise fit with an internal silicone grip to ensure no gaping or movement, unique pattern printed panels to the front and flattering contouring seaming to leg and bum.</span>\n</div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcombat-cropped-leggingsh1', NULL, '2020-04-20 00:23:27', '2020-05-14 22:49:41'),
(386, 'DC1aa70', '<h1 class=\"pinfo__heading\">combat cropped leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>FIGHTING FIT</strong><br><br><span>- Mid rise fit</span><br><span>- Elasticated waistband with internal silicone grip</span><br><span>- Contouring seams to bum and legs</span><br><span>- Patterned printed panels to front legs</span><br><span>- Cropped length</span><br><span>- Branded woven label to back waistband</span><br><span>- 88% Recycled Polyester 12% Lycra Elastane</span><br><span>- Model is 5\'6\" and wears size XS</span><br><span>- Label Colour: Smokey Grey</span><br><br><span>No matter what kind of martial art youre into. The Combat Cropped Leggings will make sure youre doing it in comfort. Featuring a mid rise fit with an internal silicone grip to ensure no gaping or movement, unique pattern printed panels to the front and flattering contouring seaming to leg and bum.</span>\n</div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcombat-cropped-leggingsh1', NULL, '2020-04-20 00:23:28', '2020-05-14 22:49:41'),
(387, '1B9527e', '<h1 class=\"pinfo__heading\">combat joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>FIGHTING FIT</strong><br><br>- Regular fit<br>- Internal drawcord in waistband<br>- Branded woven label to back of right calf<br>- Open pockets to side <br>- Ribbed panel to lower legs<br>- Ribbed cuffs<br>- Rib to back of waistband<br>- 54% Cotton 46% Polyester<br>- Model is 5\'6\" and wears size XS<br>- Label Colour: Black<br><br>The Combat Joggers give complete freedom of movement, so no matter what your discipline, you can always give your all. The internal drawcord waist and woven label mean no distractions and the tight yet unrestrictive fit mean no holding back. <br><br>\n</div>', 32, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcombat-joggersh1', NULL, '2020-04-20 00:23:29', '2020-05-14 22:49:41'),
(388, '4B740ac', '<h1 class=\"pinfo__heading\">combat joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>FIGHTING FIT</strong><br><br><span>- Regular fit</span><br><span>- Internal drawcord in waistband</span><br><span>- Branded woven label to back of right calf</span><br><span>- Open pockets to side</span><br><span>- Ribbed panel to lower legs</span><br><span>- Ribbed cuffs</span><br><span>- Rib to back of waistband</span><br><span>- 54% Cotton 46% Polyester</span><br><span>- Model is 5\'6\" and wears size XS</span><br><span>- Label Colour: Smokey Grey Marl</span><br><br><span>The Combat Joggers give complete freedom of movement, so no matter what your discipline, you can always give your all. The internal drawcord waist and woven label mean no distractions and the tight yet unrestrictive fit mean no holding back.</span>\n</div>', 32, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcombat-joggersh1', NULL, '2020-04-20 00:23:29', '2020-05-14 22:49:41'),
(389, '1Be8bea', '<h1 class=\"pinfo__heading\">technical leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>TECHNICAL SUPPORT</strong><br><br>- Mid rise fit <br>- Internal silicone flocking (quads, under bum and calves)<br>- Internal silicone grip in waistband<br>- Matte print detail sides of leggings, knees and calves<br>- Reflective logo at back waistband<br>- 70% Polyester, 30% Elastane <br>- Model is 58 and wears size XS<br>- Label Colour: Black<br><br>The Technical Leggings are the perfect combination of form and function. Mid rise style with matte print detailing to the thighs, knees and calves with internal silicone flocking to key muscle areas and a silicone grip in the waistband. <br><br>Note: The Technical Range is a slightly more compressive fit than our other ranges. However, to feel the full effect of the pieces, we recommend purchasing your regular/ recommended size.</div>', 31, 65, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtechnical-leggingsh1', NULL, '2020-04-20 00:23:30', '2020-05-14 22:49:41');
INSERT INTO `products` (`id`, `masp`, `product_name`, `product_description`, `supplier_id`, `product_price`, `available_size`, `available_colors`, `discount`, `product_available`, `discount_available`, `current_order`, `picture`, `second_image`, `ranking`, `note`, `slug`, `category_id`, `created_at`, `updated_at`) VALUES
(390, '685de41', '<h1 class=\"pinfo__heading\">vital seamless leggings</h1>\n', '<div class=\"pdp-accordion__body\"><p>Empowered through strength.<br><br>- High waisted fit<br>- Supportive ribbed waistband<br>- Seamless shading for leg and bum contouring<br>- DRY technology<br>- 55% Nylon, 33% Polyester, 12% Elastane<br>- Model is 5\'8\" and wears a size XS. <br><br>The leggings youll train in, sweat in and perform in. Confidence in the gym is vital and you can be assured of it with the Vital Seamless Leggings offering form and support for your next workout, wherever that is. Available in an easy-to-match Black Marl.</p></div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingvital-seamless-leggingsh1', NULL, '2020-04-20 00:23:31', '2020-05-14 22:49:41'),
(391, '4Eba005', '<h1 class=\"pinfo__heading\">vital seamless leggings</h1>\n', '<div class=\"pdp-accordion__body\"><p><strong>EMPOWERED THROUGH STRENGTH.<br></strong><br>- High waisted fit<br>- Supportive ribbed waistband<br>- Seamless shading contouring patterns<br>- DRY technology<br>- 58% Nylon, 32% Polyester, 10% Elastane<br>- Model is 5\'8\" and wears a size S <br>- Label Colour: Smokey Grey Marl<br><br>Train, sweat and perform in the Vital Seamless Leggings. Combining a high-waisted fit, supportive structure and seamless contours, theyre constructed to ensure confidence and support for a workout, with additional style for good measure.</p></div>', 32, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingvital-seamless-leggingsh1', NULL, '2020-04-20 00:23:32', '2020-05-14 22:49:41'),
(392, '1410c12', '<h1 class=\"pinfo__heading\">camo seamless leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<p class=\"p1\"><strong>COMPLETE THE SET:</strong></p>\n<p><span style=\"text-decoration: underline;\"> <a href=\"https://www.gymshark.com/products/gymshark-camo-seamless-sports-bra-black\">Camo Seamless Sports Bra</a> </span> <br><span style=\"text-decoration: underline;\"> <a href=\"https://www.gymshark.com/products/gymshark-camo-seamless-long-sleeve-crop-top-black\">Camo Seamless Long Sleeve Crop Top</a></span></p>\n<p><b>STAND OUT OF LINE<br></b><br>- All-over jacquard camo pattern<br>- High waisted fit<br>- Ruched detail to bum<br>- Elongated ribbed waistband<br>- Seamless Gymshark logo to hip<br>- 65% Nylon, 27% Polyester, 8% Elastane<br>- Model is 5\'7\" and wears a size S.<br><br>A camouflage pattern, designed to blend out. The Camo Seamless Leggings are what youve been waiting for. Their flattering fit and contouring ruched detail to the bum meet with a supportive and supple seamless fabric to advance your performance.</p>\n</div>', 32, 60, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcamo-seamless-leggingsh1', NULL, '2020-04-20 00:23:33', '2020-05-14 22:49:41'),
(393, '8Abb10c', '<h1 class=\"pinfo__heading\">training leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>IN YOUR LOCKER</strong><br><br>- High rise fit<br>- Single tone<br>- Vertical logo to hip<br>- Logo on back of waistband <br>- 78% Polyester, 22% Elastane <br>- Model is 58 and wears size XS<br>- Label Colour: Black<br><br>High waist and a flattering length, what more could you want from a staple legging? The Training Full Length Leggings have style and comfort in the bag. Available in versatile colours making them the perfect pairing to any sports bra, crop top or t-shirt.</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtraining-leggingsh1', NULL, '2020-04-20 00:23:34', '2020-05-14 22:49:41'),
(394, 'E5b19c1', '<h1 class=\"pinfo__heading\">flex high waisted leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<p><strong>FLEX YOUR WAY</strong><br><br>- High-waisted fit<br>- Figure-contouring shades<br>- Branded back waistband<br>- Full leg inseam<br>- 56% Nylon, 39% Polyester, 5% Elastane<br>- Model is 5\'5\" and wears a size XS<br>- Label Colour: Black/Charcoal</p>\n<br><span>A new era of Flex. The High Waisted Flex Leggings combine the signature sculpting and seamless knit of the original Flex with our famously flattering high-waisted fit. Non-slip, breathable and supportive, theyre still engineered to perform, too.</span>\n</div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingflex-high-waisted-leggingsh1', NULL, '2020-04-20 00:23:35', '2020-05-14 22:49:41'),
(395, 'FD51414', '<h1 class=\"pinfo__heading\">vital seamless leggings</h1>\n', '<div class=\"pdp-accordion__body\"><p><strong>EMPOWERED THROUGH STRENGTH.<br></strong><br><span>- High waisted fit</span><br><span>- Supportive ribbed waistband</span><br><span>- Seamless shading contouring patterns</span><br><span>- DRY technology</span><br><span>- 58% Nylon, 32% Polyester, 10% Elastane</span><br><span>- Model is 5\'8\" and wears a size S</span><br><span>- Label Colour:</span>Hydro Teal Marl<br><br><span>Train, sweat and perform in the Vital Seamless Leggings. Combining a high-waisted fit, supportive structure and seamless contours, theyre constructed to ensure confidence and support for a workout, with additional style for good measure.</span></p></div>', 32, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingvital-seamless-leggingsh1', NULL, '2020-04-20 00:23:36', '2020-05-14 22:49:41'),
(396, '1875efe', '<h1 class=\"pinfo__heading\">energy+ seamless leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>JUST ADD ENERGY</strong><br><br>- Super high-waist fit <br>- Eyelet detailing and glute contouring <br>- Ribbed waistband <br>- 7/8 length <br>- 94% Nylon, 6% Elastane <br>-<meta charset=\"utf-8\">\n<span>Model is 5\'7\" and wears a size S.</span><br><br>Power your performance with the Energy+ High-Waisted Seamless Leggings. Fully functional and fully shape-enhancing, these gym leggings help you through cardio and weights alike with support and confidence.</div>', 32, 55, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingenergy-seamless-leggingsh1', NULL, '2020-04-20 00:23:37', '2020-05-14 22:49:41'),
(397, 'F08146b', '<h1 class=\"pinfo__heading\">camo seamless leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<p><strong>COMMAND ATTENTION<span></span></strong><br><br><span>- All-over jacquard camo pattern</span><br><span>- High waisted fit</span><br><span>- Ruched detail to bum</span><br><span>- Elongated ribbed waistband</span><br><span>- Seamless Gymshark logo to hip</span><br><span><span>-79% Polyamide 15% Polyester 6% Spandex<br></span></span><span>- Model is 5\'8\" and wears a size S.</span><br><span>- Label Color: Aqua Green</span><br><br><span><span>Meet your new secret weapon. The flattering fit, ruched detailing and all-over jacquard camo pattern are carefully designed to blend out. The supportive, high-rise waistband and subtle, seamless fabric ensure comfort and ease of movement. Camo Seamless Leggings have everything you need to attack every workout.</span></span></p>\n<meta charset=\"utf-8\">\n<p><span><span>Part of the Adapt Collection.</span></span><span><br></span></p>\n</div>', 31, 60, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcamo-seamless-leggingsh1', NULL, '2020-04-20 00:23:38', '2020-05-14 22:49:41'),
(398, 'F5e83ff', '<h1 class=\"pinfo__heading\">camo seamless leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>COMMAND ATTENTION<span></span></strong><br><br><span>- All-over jacquard camo pattern</span><br><span>- High waisted fit</span><br><span>- Ruched detail to bum</span><br><span>- Elongated ribbed waistband</span><br><span>- Seamless Gymshark logo to hip</span><br><span><span>-79% Polyamide 15% Polyester 6% Spandex<br></span></span><span>- Model is 5\'8\" and wears a size XS.</span><br><span>- Label Color: Dusky Pink</span><br><br><span><span>Meet your new secret weapon. The flattering fit, ruched detailing and all-over jacquard camo pattern are carefully designed to blend out. The supportive, high-rise waistband and subtle, seamless fabric ensure comfort and ease of movement. Camo Seamless Leggings have everything you need to attack every workout.<br><br></span></span><meta charset=\"utf-8\">\n<span>Part of the Adapt Collection.<br></span>\n</div>', 31, 60, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcamo-seamless-leggingsh1', NULL, '2020-04-20 00:23:38', '2020-05-14 22:49:41'),
(399, 'F3c9c8f', '<h1 class=\"pinfo__heading\">fit printed leggings</h1>\n', '<div class=\"pdp-accordion__body\"><p><strong>FIT FOR PERFORMANCE</strong><br><br>- Low rise <br>- Seamless knit<br>- Elasticated waistband with jacquard Gymshark logo<br>- Internal silicone grip on waistband <br>- Print fabric <br>- 80% Nylon 20% Elastane<br>- Model is 58 and wears size XS<br>- Label Colour: Blue Hues<br><br>Seamless comfort and effortless style combine to form these Fit Printed Leggings. With a stay-put waistband thanks to a silicone grip, and super-stretchy printed material these leggings are ready for whatever workout you have lined up next.</p></div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingfit-printed-leggingsh1', NULL, '2020-04-20 00:23:39', '2020-05-14 22:49:41'),
(400, '93fb20c', '<h1 class=\"pinfo__heading\">illumination leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>ALL THAT GLISTENS</strong> <br><br>- Low rise fit<br>- Pocket to left thigh<br>- Ankle stirrup<br>- Flat lock seams <br>- Heat sealed branding to upper hip and back of waistband<br>- Main: 78% Polyester, 22% Elastane. Secondary: 91% Nylon, 9% Elastane.<br>- Model is 5\'8\" and wears size S<br>- Label Colour: Black<br><br>With leggings, its as much about fit as it is about function. The Illumination Leggings have nailed both. A classic low rise fit with a pocket to the hip and flat lock seams to ensure comfort. Plus, an ankle stirrup you can hook over your foot to make sure they stay put, even when you\'re speeding in spin.</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingillumination-leggingsh1', NULL, '2020-04-20 00:23:40', '2020-05-14 22:49:41'),
(401, '19a1916', '<h1 class=\"pinfo__heading\">illumination leggings</h1>\n', '<div class=\"pdp-accordion__body\"><p><strong>ALL THAT GLISTENS</strong><span></span><br><br><span>- low rise fit</span><br><span>- Pocket to left thigh</span><br><span>- Ankle stirrup</span><br><span>- Flat lock seams</span><br><span>- Heat sealed branding to upper hip and back of waistband</span><br><span>- Main: 78% Polyester, 22% Elastane. Secondary: 91% Nylon, 9% Elastane.</span><br><span>- Model is 5\'8\" and wears size S</span><br><span>- Label Colour:</span>Charged Emerald<br><br><span>With leggings, its as much about fit as it is about function. The Illumination Leggings have nailed both. A classic low rise fit with a pocket to the hip and flat lock seams to ensure comfort. Plus, an ankle stirrup you can hook over your foot to make sure they stay put, even when you\'re speeding in spin.</span></p></div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingillumination-leggingsh1', NULL, '2020-04-20 00:23:41', '2020-05-14 22:49:41'),
(402, '0B06f5a', '<h1 class=\"pinfo__heading\">illumination leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>ALL THAT GLISTENS</strong><span></span><br><br><span>- Low rise fit</span><br><span>- Pocket to left thigh</span><br><span>- Ankle stirrup</span><br><span>- Flat lock seams</span><br><span>- Heat sealed branding to upper hip and back of waistband</span><br><span>- Main: 78% Polyester, 22% Elastane. Secondary: 91% Nylon, 9% Elastane.</span><br><span>- Model is 5\'8\" and wears size S</span><br><span>- Label Colour: Powder Orange</span><br><br><span>With leggings, its as much about fit as it is about function. The Illumination Leggings have nailed both. A classic low rise fit with a pocket to the hip and flat lock seams to ensure comfort. Plus, an ankle stirrup you can hook over your foot to make sure they stay put, even when you\'re speeding in spin.</span>\n</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingillumination-leggingsh1', NULL, '2020-04-20 00:23:42', '2020-05-14 22:49:41'),
(403, '9Ef54f1', '<h1 class=\"pinfo__heading\">illumination seamless leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>ALL THAT GLISTENS</strong> <br><br>- High rise fit<br>- Ribbed waistband <br>- All over jacquard print <br>- Sweat-wicking fabric<br>- Jacquard branding to left hip and back of calves<br>- 74% Polyester, 15% Nylon, 11% Elastane<br>- Model is 5\'8\" and wears size S<br>- Label Colour: Black/Grey<br><br>They dont just look good, the sweat-wicking technology draws sweat from your body, the high, ribbed waistband and seamless knit fabric give you all the support and comfort you need to smash your workout.</div>', 31, 60, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingillumination-seamless-leggingsh1', NULL, '2020-04-20 00:23:43', '2020-05-14 22:49:41'),
(404, 'A280494', '<h1 class=\"pinfo__heading\">illumination seamless leggings</h1>\n', '<div class=\"pdp-accordion__body\"><p><strong>ALL THAT GLISTENS</strong><span></span><br><br><span>- High rise fit</span><br><span>- Ribbed waistband</span><br><span>- All over jacquard neon print</span><br><span>- Sweat-wicking fabric</span><br><span>- Jacquard branding to left hip and back of calves</span><br><span>- 74% Polyester, 15% Nylon, 11% Elastane</span><br><span>- Model is 5\'8\" and wears size S</span><br><span>- Label Colour:</span>Black/Acid Lime<br><br><span>Ready to glow? The Illumination Seamless Leggings feature a unique, neon jacquard print throughout so in the light of a UV studio, as you move, you shine. But they dont just look good, the sweat-wicking technology draws sweat from your body, the high, ribbed waistband and seamless knit fabric give you all the support and comfort you need to smash your workout.</span></p></div>', 31, 60, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingillumination-seamless-leggingsh1', NULL, '2020-04-20 00:23:44', '2020-05-14 22:49:41'),
(405, 'A9effea', '<h1 class=\"pinfo__heading\">illumination seamless leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<p><strong>ALL THAT GLISTENS</strong></p>\n<p><span>- High rise fit<br>- Ribbed waistband<br>- All over jacquard neon print<br>- Sweat-wicking fabric<br>- Jacquard branding to left hip and back of calves<br>- 74% Polyester, 15% Nylon, 11% Elastane<br>- Model is 5\'8\" and wears size S<br>- Label Colour:</span>Hyper Pink/Knock Out Pink<br><span><br>Ready to glow? The Illumination Seamless Leggings feature a unique, neon jacquard print throughout so in the light of a UV studio, as you move, you shine. But they dont just look good, the sweat-wicking technology draws sweat from your body, the high, ribbed waistband and seamless knit fabric give you all the support and comfort you need to smash your workout.</span></p>\n</div>', 32, 60, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingillumination-seamless-leggingsh1', NULL, '2020-04-20 00:23:44', '2020-05-14 22:49:41'),
(406, 'C478780', '<h1 class=\"pinfo__heading\">rewind joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>REMIX YOUR WORKOUT</strong> <br><br>- Regular fit <br>- Drawcords to waist <br>- Pockets to each hip<br>- Two tone fabric panelling <br>- Asymmetric seam details <br>- Multi branding throughout <br>- Main: 54% Cotton 46% Polyester. Secondary: 100% Polyester<br>- Model is 57 and wears size S<br>- Label Colour: Black<br><br>Pants, remixed. We took a little bit of Gymshark old, a little bit of Gymshark new and blended them together to create the Rewind Pants. Featuring asymmetric seam details, multi branding and two-toned fabric panelling, these pants are as stylish as they are comfortable.</div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingrewind-joggersh1', NULL, '2020-04-20 00:23:45', '2020-05-14 22:49:41'),
(407, '0E3ea19', '<h1 class=\"pinfo__heading\">rewind joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>REMIX YOUR WORKOUT</strong> <br><br>- Regular fit <br>- Drawcords to waist <br>- Pockets to each hip<br>- Two tone fabric panelling <br>- Asymmetric seam details <br>- Multi branding throughout <br>- Main: 54% Cotton 46% Polyester. Secondary: 100% Polyester<br>- Model is 57 and wears size S<br>- Label Colour: Shell Pink<br><br>Pants, remixed. We took a little bit of Gymshark old, a little bit of Gymshark new and blended them together to create the Rewind Pants. Featuring asymmetric seam details, multi branding and two-toned fabric panelling, these pants are as stylish as they are comfortable.</div>', 32, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingrewind-joggersh1', NULL, '2020-04-20 00:23:46', '2020-05-14 22:49:41'),
(408, '92f97bb', '<h1 class=\"pinfo__heading\">camo seamless leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<p class=\"p1\"><strong>COMPLETE THE SET:</strong></p>\n<p><span style=\"text-decoration: underline;\"> <a href=\"https://www.gymshark.com/products/gymshark-camo-seamless-sports-bra-lilac\">Camo Seamless Sports Bra</a></span><br><span style=\"text-decoration: underline;\"> <a href=\"https://www.gymshark.com/products/gymshark-camo-seamless-long-sleeve-crop-top-lilac\">Camo Seamless Long Sleeve Crop Top</a></span></p>\n<p><strong>COMMAND ATTENTION<span></span></strong><br><br><span>- All-over jacquard camo pattern</span><br><span>- High waisted fit</span><br><span>- Ruched detail to bum</span><br><span>- Elongated ribbed waistband</span><br><span>- Seamless Gymshark logo to hip</span><br><span>- 65% Nylon, 27% Polyester, 8% Elastane</span><br><span>- Model is 5\'9\" and wears a size XS.</span><br><span>- Label Color: Lilac grey</span><br><br><span>Meet your new secret weapon. The flattering fit, ruched detailing and all-over jacquard camo pattern are carefully designed to blend out. The supportive, high-rise waistband and subtle, seamless fabric ensure comfort and ease of movement. Camo Seamless Leggings have everything you need to attack every workout.</span></p>\n</div>', 32, 60, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcamo-seamless-leggingsh1', NULL, '2020-04-20 00:23:47', '2020-05-14 22:49:41'),
(409, 'F74931d', '<h1 class=\"pinfo__heading\">camo seamless leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<p class=\"p1\"><strong>COMPLETE THE SET:</strong></p>\n<p><span style=\"text-decoration: underline;\"> <a href=\"https://www.gymshark.com/products/gymshark-camo-seamless-sports-bra-berry-red\">Camo Seamless Sports Bra</a></span><br><span style=\"text-decoration: underline;\"> <a href=\"https://www.gymshark.com/products/gymshark-camo-seamless-long-sleeve-crop-top-berry-red\">Camo Seamless Long Sleeve Crop Top</a></span></p>\n<p><strong>COMMAND ATTENTION </strong><br><br>- All-over jacquard camo pattern<br>- High waisted fit<br>- Ruched detail to bum<br>- Elongated ribbed waistband<br>- Seamless Gymshark logo to hip<br>- 65% Nylon, 27% Polyester, 8% Elastane<br>- Model is 5\'5\" and wears a size XS<br>- Label Color: Winter Berry<br><br>Meet your new secret weapon. The flattering fit, ruched detailing and all-over jacquard camo pattern are carefully designed to blend out. The supportive, high-rise waistband and subtle, seamless fabric ensure comfort and ease of movement. Camo Seamless Leggings have everything you need to attack every workout.</p>\n</div>', 32, 60, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcamo-seamless-leggingsh1', NULL, '2020-04-20 00:23:48', '2020-05-14 22:49:41'),
(410, '0D9ada0', '<h1 class=\"pinfo__heading\">flex high waisted leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<p><strong>FLEX YOUR WAY</strong><br><br>- High-waisted fit<br>- Figure-contouring shades<br>- Branded back waistband<br>- Full leg inseam<br>- 56% Nylon, 39% Polyester, 5% Elastane<br>- Model is 5\'5\" and wears a size XS<br>- Label Colour: Charcoal Marl/Smokey Teal</p>\n<br><span>A new era of Flex. The High Waisted Flex Leggings combine the signature sculpting and seamless knit of the original Flex with our famously flattering high-waisted fit. Non-slip, breathable and supportive, theyre still engineered to perform, too.</span>\n</div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingflex-high-waisted-leggingsh1', NULL, '2020-04-20 00:23:49', '2020-05-14 22:49:41'),
(411, '4B9dd61', '<h1 class=\"pinfo__heading\">fit leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<span>Fit for performance.</span><br><br><span>- Unrestricted fit</span><br><span>- Seamless knit</span><br><span>- Elasticated Gymshark waistband</span><br><span>- Internal silicone grip</span><br><span>- 80% Nylon, 20% Elastane</span><br><span>- Model is 5\'5\" and wears a size XS</span><br><span>- Label Colour:Black/Black<br></span><br><span>Feel the liberated range of movement, experience the seamless support and style the gorgeous colourways in the Fit gym leggings, a guaranteed winner for your next workout.</span>\n</div>', 31, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingfit-leggingsh1', NULL, '2020-04-20 00:23:50', '2020-05-14 22:49:41'),
(412, '941e814', '<h1 class=\"pinfo__heading\">legacy fitness panel leggings</h1>\n', '<div class=\"pdp-accordion__body\">*To achieve the Gymshark fit youre used to, we recommend sizing up in the Legacy Fitness Panel Leggings.<br><br>The Legacy continues.<br><br>  High-rise fit<br>  Contouring seam lines<br>  Side pockets<br>  Cut-off classic Gymshark logo<br>  74% Nylon, 26% Elastane<br>  Model is 55 and wears size XS<br>  Label Color: Black/White<br><br>Featuring a printed, classic Gymshark logo to the leg, the Legacy Fitness Panel Leggings bring part of our history into the present. Mixing our vintage stamp and loud colourways with a high-waisted fit and contouring seam lines, theyre an old school take on contemporary design.<br><br>Note: Ready for out-and-out lifting, the Legacy Fitness Panel Leggings are built for durability, support and reinforcement through every rep. We recommend sizing up to achieve the Gymshark fit youre used to.</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-fitness-panel-leggingsh1', NULL, '2020-04-20 00:23:51', '2020-05-14 22:49:41'),
(413, 'E0193a5', '<h1 class=\"pinfo__heading\">camo seamless leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<p class=\"p1\"><strong>COMPLETE THE SET:</strong></p>\n<p><span style=\"text-decoration: underline;\"> <a href=\"https://www.gymshark.com/products/gymshark-camo-seamless-sports-bra-lavender-grey\">Camo Seamless Sports Bra</a></span><br><span style=\"text-decoration: underline;\"> <a href=\"https://www.gymshark.com/products/gymshark-camo-seamless-long-sleeve-crop-top-lavender-grey\">Camo Seamless Long Sleeve Crop Top</a></span></p>\n<p><b>STAND OUT OF LINE<br></b><br><span>- All-over jacquard camo pattern</span><br><span>- High waisted fit</span><br><span>- Ruched detail to bum</span><br><span>- Elongated ribbed waistband</span><br><span>- Seamless Gymshark logo to hip</span><br><span>- 65% Nylon, 27% Polyester, 8% Elastane</span><br><span>- Model is 5\'7\" and wears a size S.</span><br><br><span>A camouflage pattern, designed to blend out. The Camo Seamless Leggings are what youve been waiting for. Their flattering fit and contouring ruched detail to the bum meet with a supportive and supple seamless fabric to advance your performance.</span></p>\n</div>', 31, 60, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcamo-seamless-leggingsh1', NULL, '2020-04-20 00:23:52', '2020-05-14 22:49:41'),
(414, '26eaa46', '<h1 class=\"pinfo__heading\">origin seamless leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>BE ORIGINAL </strong><br><br>- Slim fit <br>-<meta charset=\"utf-8\">\n<span>Mid rise</span><br>- Seamless rib to waistband and leg <br>- Seamless eyelet detail<br>- Full length <br>- Heatseal branding to hip and back waistband <br>- 59% Nylon, 36% Polyester, 5% Elastane<br>- Model is 5\'3\" and wears size XS<br>- Label colour: Black Marl<br><br>The Origin Seamless Leggings maintain everything good about our Original Seamless Leggings with some slight changes that make them better than ever. The mid-rise ribbed waistband and eyelet detailing are super flattering while the slightly more compressive fit give you support and confidence for your workouts. The under bum shading has also been refined to reduce sheerness.</div>', 31, 55, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingorigin-seamless-leggingsh1', NULL, '2020-04-20 00:23:52', '2020-05-14 22:49:41'),
