(432, 'B901dc1', '<h1 class=\"pinfo__heading\">training 7/8 leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>IN YOUR LOCKER</strong><br><br>- High rise fit<br>- 7/8 length<br>- Single tone<br>- Vertical logo to hip<br>- Logo on back of waistband <br>- 78% Polyester, 22% Elastane <br>- Model is 54 and wears size XS<br>- Label Colour: Black<br><br>Not as short as a cropped legging, not as long as a full-length legging, the Training 7/8 Leggings are the perfect in-between. Their flattering length, high waist and range of colours make them the ideal addition to your locker.</div>', 32, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtraining-78-leggingsh1', NULL, '2020-04-20 00:24:08', '2020-05-14 22:49:41'),
