(439, '0D528e3', '<h1 class=\"pinfo__heading\">training leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>IN YOUR LOCKER</strong><br><br>- High rise fit<br>- Single tone<br>- Vertical logo to hip<br>- Logo on back of waistband <br>- 78% Polyester, 22% Elastane <br>- Model is 58 and wears size XS<br>- Label Colour: Intense Steel Blue<br><br>High waist and a flattering length, what more could you want from a staple legging? The Training Full Length Leggings have style and comfort in the bag. Available in versatile colours making them the perfect pairing to any sports bra, crop top or t-shirt.</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtraining-leggingsh1', NULL, '2020-04-20 00:24:15', '2020-05-14 22:49:41'),
