(442, 'A312473', '<h1 class=\"pinfo__heading\">lightweight seamless tights</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>TAKE AIR</strong><br><span><br> High-rise fit</span><br><span> Dotted seamless contouring</span><br><span> Ribbed waistband and ankle cuffs</span><br><span> Sweat-wicking DRY technology</span><br><span> Printed Gymshark logo to hip</span><br><span> 74% Polyester, 26% Nylon</span><br><span> Model is 55 and wears size XS</span><br><span> Label Colour: Stormy Turquoise</span><br><br><span>Your performance has never felt this free. In the Lightweight Seamless Tights, movement becomes effortless in a superlatively weightless material combining polyester and nylon. Supplemented with a shape-accentuating high-waisted fit and seamless contouring details, the design provides a boost of confidence every step of your cardio.</span><br><br><span>Note: Due to the lightweight nature of the material, the Lightweight Seamless Tights may not appear fully squat-proof when stretched.</span>\n</div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglightweight-seamless-tightsh1', NULL, '2020-04-20 00:24:17', '2020-05-14 22:49:41');
