(444, '4416a91', '<h1 class=\"pinfo__heading\">camo seamless long sleeve crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>COMMAND ATTENTION</strong><br><br><span>- All-over jacquard camo pattern</span><br><span>- Midriff crop</span><br><span>- Ruched detail to centre chest</span><br><span>- Subtle back openings</span><br><span>- Seamless Gymshark logo to waist</span><br><span>- Thumbholes</span><br><span><span>-79% Polyamide 15% Polyester 6% Spandex<br></span></span><span>- Model is 5\'8\" and wears a size XS</span><br><span>- Label Color: Aqua Green</span><br><br><span><span>Attention! This midriff crop boasts distinct jacquard camo colourways, ruched chest detailing, and back openings make it flexible, comfortable and ready for even the most intense of workouts. Whatever your mission, the Camo Seamless Long Sleeve Crop Top will see you through in style.<br><br></span></span><meta charset=\"utf-8\">\n<span>Part of the Adapt Collection.<br></span>\n</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcamo-seamless-long-sleeve-crop-toph1', NULL, '2020-04-20 00:24:31', '2020-05-14 22:49:41'),
(445, '0F16b7a', '<h1 class=\"pinfo__heading\">camo seamless long sleeve crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>COMMAND ATTENTION</strong><br><br><span>- All-over jacquard camo pattern</span><br><span>- Midriff crop</span><br><span>- Ruched detail to centre chest</span><br><span>- Subtle back openings</span><br><span>- Seamless Gymshark logo to waist</span><br><span>- Thumbholes</span><br><span><span>-79% Polyamide 15% Polyester 6% Spandex<br></span></span><span>- Model is 5\'8\" and wears a size S</span><br><span>- Label Color: Dusky Pink</span><br><br><span><span>Attention! This midriff crop boasts distinct jacquard camo colourways, ruched chest detailing, and back openings make it flexible, comfortable and ready for even the most intense of workouts. Whatever your mission, the Camo Seamless Long Sleeve Crop Top will see you through in style.<br><br></span></span><meta charset=\"utf-8\">\n<span>Part of the Adapt Collection.<br></span>\n</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcamo-seamless-long-sleeve-crop-toph1', NULL, '2020-04-20 00:24:32', '2020-05-14 22:49:41'),
(446, '23c01a4', '<h1 class=\"pinfo__heading\">camo seamless long sleeve crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<p class=\"p1\"><strong>COMPLETE THE SET:</strong></p>\n<p><span style=\"text-decoration: underline;\"> <a href=\"https://www.gymshark.com/products/gymshark-camo-seamless-leggings-black\">Camo Seamless Leggings</a></span><br><span style=\"text-decoration: underline;\"> <a href=\"https://www.gymshark.com/products/gymshark-camo-seamless-sports-bra-black\">Camo Seamless Sports Bra</a></span></p>\n<p><b>STAND OUT OF LINE<br></b><br>- All-over jacquard camo pattern<br>- Midriff crop<br>- Ruched detail to centre chest<br>- Subtle back openings<br>- Seamless Gymshark logo to waist<br>- Thumbholes<br>- 79% Nylon, 16% Polyester, 5% Elastane<br>- Model is 5\'5\" and wears a size XS.<br><br>Its everything for performance, everything for aesthetics and everything youve been waiting for. Available in distinct jacquard camo colourways that combine with flattering midriff crops, ruched chest details and subtle back openings, the Camo Seamless Long Sleeve Crop Top boasts a camouflage pattern, designed to blend out.</p>\n</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcamo-seamless-long-sleeve-crop-toph1', NULL, '2020-04-20 00:24:33', '2020-05-14 22:49:41'),
(447, '680ef5c', '<h1 class=\"pinfo__heading\">camo seamless long sleeve crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<p class=\"p1\"><strong>COMPLETE THE SET:</strong></p>\n<p><span style=\"text-decoration: underline;\"> <a href=\"https://www.gymshark.com/products/gymshark-camo-seamless-leggings-berry-red\">Camo Seamless Leggings</a></span><br><span style=\"text-decoration: underline;\"> <a href=\"https://www.gymshark.com/products/gymshark-camo-seamless-sports-bra-berry-red\">Camo Seamless Sports Bra</a></span></p>\n<p><strong>COMMAND ATTENTION</strong><br><br>- All-over jacquard camo pattern<br>- Midriff crop<br>- Ruched detail to centre chest<br>- Subtle back openings<br>- Seamless Gymshark logo to waist<br>- Thumbholes<br>- 79% Nylon, 16% Polyester, 5% Elastane<br>- Model is 5\'9\" and wears a size XS<br>- Label Color: Winter Berry<br><br>Attention! This midriff crop boasts distinct jacquard camo colourways, ruched chest detailing, and back openings make it flexible, comfortable and ready for even the most intense of workouts. Whatever your mission, the Camo Seamless Long Sleeve Crop Top will see you through in style.<br><br></p>\n</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcamo-seamless-long-sleeve-crop-toph1', NULL, '2020-04-20 00:24:34', '2020-05-14 22:49:41'),
(448, '2A0fdbb', '<h1 class=\"pinfo__heading\">geo seamless long sleeve crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>FREEDOM TIL THE FINISH</strong><br><br>  Body fit<br>  Cropped length<br>  Gradient-fade design<br>  Figure-contouring seamless patterns<br>  Long raglan sleeves with thumbholes<br>  Seamless ribbed hem<br>  Cut-out to centre back<br>  Jacquard Gymshark logo to chest<br>  54% Nylon, 38% Polyester, 8% Elastane<br>  Model is 5\'9 and wears size XS<br>  Label Color: Black Tones<br><br>Everything you loved about a famous, faded Gymshark look has been brought into the design of the Geo Seamless Long Sleeve Crop Top. The innovative seamless knit, the figure-accentuating shades and the stunning colour-gradient blend is back. And with thumbholes to the sleeves, a breathable cut-out to the back and a slim, body-following fit, this top stays with you and your movement throughout your training. Let your style fade, not your performance.</div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinggeo-seamless-long-sleeve-crop-toph1', NULL, '2020-04-20 00:24:35', '2020-05-14 22:49:41'),
(449, '36adfd0', '<h1 class=\"pinfo__heading\">geo seamless long sleeve crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>FREEDOM TIL THE FINISH</strong><br><br>  Body fit<br>  Cropped length<br>  Gradient-fade design<br>  Figure-contouring seamless patterns<br>  Long raglan sleeves with thumbholes<br>  Seamless ribbed hem<br>  Cut-out to centre back<br>  Jacquard Gymshark logo to chest<br>  54% Nylon, 38% Polyester, 8% Elastane<br>  Model is 5\'8 and wears size XS<br>  Label Color: Teal Tones<br><br>Everything you loved about a famous, faded Gymshark look has been brought into the design of the Geo Seamless Long Sleeve Crop Top. The innovative seamless knit, the figure-accentuating shades and the stunning colour-gradient blend is back. And with thumbholes to the sleeves, a breathable cut-out to the back and a slim, body-following fit, this top stays with you and your movement throughout your training. Let your style fade, not your performance.</div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinggeo-seamless-long-sleeve-crop-toph1', NULL, '2020-04-20 00:24:36', '2020-05-14 22:49:41'),
(450, '1214f18', '<h1 class=\"pinfo__heading\">ultra seamless crop top</h1>\n', '<div class=\"pdp-accordion__body\">Let yourself glow.<br><br>  Slim fit<br>  Cropped length<br>  Seamless jacquard contouring<br>  Cut-outs to back<br>  Short raglan sleeves<br>  Ribbed hem<br>  Jacquard Gymshark logo to centre chest<br>  54% Nylon, 38% Polyester, 8% Elastane<br>  Model is 59 and wears size S <br>  Label Colour: Spearmint Green<br><br>Give your performance the light it deserves in the Ultra Seamless Crop Top. Uniting a flattering, close-to-skin fit with a midriff crop and secure ribbed hem, this gym top reinforces every movement of your workout, while seamless contouring details, elegant cut-outs and intense colourways are sure to turn heads. Ultra Seamless is a collection as vibrant as you are; a collection that empowers you to let yourself glow.</div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingultra-seamless-crop-toph1', NULL, '2020-04-20 00:24:37', '2020-05-14 22:49:41'),
(451, '62d8817', '<h1 class=\"pinfo__heading\">ultra seamless crop top</h1>\n', '<div class=\"pdp-accordion__body\">Let yourself glow.<br><br>  Slim fit<br>  Cropped length<br>  Seamless jacquard contouring<br>  Cut-outs to back<br>  Short raglan sleeves<br>  Ribbed hem<br>  Jacquard Gymshark logo to centre chest<br>  54% Nylon, 38% Polyester, 8% Elastane<br>  Model is 59 and wears size XS <br>  Label Colour: Black<br><br>Give your performance the light it deserves in the Ultra Seamless Crop Top. Uniting a flattering, close-to-skin fit with a midriff crop and secure ribbed hem, this gym top reinforces every movement of your workout, while seamless contouring details, elegant cut-outs and intense colourways are sure to turn heads. Ultra Seamless is a collection as vibrant as you are; a collection that empowers you to let yourself glow.</div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingultra-seamless-crop-toph1', NULL, '2020-04-20 00:24:38', '2020-05-14 22:49:41'),
(452, 'F682598', '<h1 class=\"pinfo__heading\">slounge crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>THE PERFECT REST DAY</strong><br><br><span> Slim fit</span><br><span> Cropped length</span><br><span> Super soft Slounge material</span><br><span> Ribbed marl design</span><br><span> Raglan cap sleeves</span><br><span> Ribbed hem, cuffs and high crew neck</span><br><span> Woven tab logo to hem</span><br><span> 60% Polyester, 38% Viscose, 2% Elastane</span><br><span> Model is 59 and wears size S</span><br><span> Label Colour: Black Marl</span><br><br><span>Enhancing your figure and following your body shape, the Slounge Crop Top ensures a relaxing freedom of movement. Get a customisable feel for consistent comfort with the sumptuously soft Slounge material and a ribbed-marl design.</span>\n</div>', 32, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingslounge-crop-toph1', NULL, '2020-04-20 00:24:39', '2020-05-14 22:49:41'),
(453, 'A1f8d51', '<h1 class=\"pinfo__heading\">fraction crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<span>Cut to the point.</span><br><br><span>- Midriff crop</span><br><span>- Capped roll up sleeves</span><br><span>- Cut off Gymshark graphic at hem</span><br><span>-</span><span>95% Cotton, 5% Elastane</span><br><span>- Model is 5\'5\" and wears a size XS<br></span><span>- Label Colour: Slate Lavender/White</span><br><br><span>A slice of unique athleisure, the Fraction Crop Top is charming and convenient. Available in versatile colours, style any workout or rest day outfit with this short sleeve crop top.</span>\n</div>', 31, 25, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingfraction-crop-toph1', NULL, '2020-04-20 00:24:40', '2020-05-14 22:49:41'),
(454, '7C1ffa4', '<h1 class=\"pinfo__heading\">camo seamless long sleeve crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<p class=\"p1\"><strong>COMPLETE THE SET:</strong></p>\n<p><span style=\"text-decoration: underline;\"> <a href=\"https://www.gymshark.com/products/gymshark-camo-seamless-leggings-sage-green\">Camo Seamless Leggings</a></span><br><span style=\"text-decoration: underline;\"> <a href=\"https://www.gymshark.com/products/gymshark-camo-seamless-sports-bra-sage-green\">Camo Seamless Sports Bra</a> </span></p>\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<p><b>STAND OUT OF LINE<br></b><br><span>- All-over jacquard camo pattern</span><br><span>- Midriff crop</span><br><span>- Ruched detail to centre chest</span><br><span>- Subtle back openings</span><br><span>- Seamless Gymshark logo to waist</span><br><span>- Thumbholes</span><br><span><span>-</span></span></p>\n<meta charset=\"utf-8\">\n<p><span>79% Nylon, 16% Polyester, 5% Elastane</span><br><span>- Model is 5\'7\" and wears a size XS.</span><br><br><span>Its everything for performance, everything for aesthetics and everything youve been waiting for. Available in distinct jacquard camo colourways that combine with flattering midriff crops, ruched chest details and subtle back openings, the Camo Seamless Long Sleeve Crop Top boasts a camouflage pattern, designed to blend out.</span></p>\n</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcamo-seamless-long-sleeve-crop-toph1', NULL, '2020-04-20 00:24:41', '2020-05-14 22:49:41'),
