(464, '78e8401', '<h1 class=\"pinfo__heading\">legacy fitness long sleeve crop top</h1>\n', '<div class=\"pdp-accordion__body\"><p class=\"p1\"><strong>THE LEGACY CONTINUES.</strong><br><br>  Regular fit<br>  Super cropped length<br>  Slightly scooped neck with button down<br>  Loopback pique fabric<br>  Thumbholes<br>  Printed classic Gymshark logo to back<br>  100% Cotton<br>  Model is 59 and wears size XS<br>  Label Color: Washed Lavender<br><br>Our classic logo on your favourite gym top style. Including a super soft cotton fabric, flattering high-crop and optional thumbholes, the Legacy Fitness Long Sleeve Crop Top features everything you love about gym long sleeves, with a central old school Gymshark logo to the back to make a proud statement.</p></div>', 32, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-fitness-long-sleeve-crop-toph1', NULL, '2020-04-20 00:24:50', '2020-05-14 22:49:41'),
(465, 'DF1fff4', '<h1 class=\"pinfo__heading\">geo seamless long sleeve crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>FREEDOM TIL THE FINISH</strong><br><br>  Body fit<br>  Cropped length<br>  Gradient-fade design<br>  Figure-contouring seamless patterns<br>  Long raglan sleeves with thumbholes<br>  Seamless ribbed hem<br>  Cut-out to centre back<br>  Jacquard Gymshark logo to chest<br>  54% Nylon, 38% Polyester, 8% Elastane<br>  Model is 5\'8 and wears size XS<br>  Label Color: Rose Tones<br><br>Everything you loved about a famous, faded Gymshark look has been brought into the design of the Geo Seamless Long Sleeve Crop Top. The innovative seamless knit, the figure-accentuating shades and the stunning colour-gradient blend is back. And with thumbholes to the sleeves, a breathable cut-out to the back and a slim, body-following fit, this top stays with you and your movement throughout your training. Let your style fade, not your performance.</div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinggeo-seamless-long-sleeve-crop-toph1', NULL, '2020-04-20 00:24:51', '2020-05-14 22:49:41'),
(466, '0B9ddea', '<h1 class=\"pinfo__heading\">ultra seamless crop top</h1>\n', '<div class=\"pdp-accordion__body\">Let yourself glow.<br><br>  Slim fit<br>  Cropped length<br>  Seamless jacquard contouring<br>  Cut-outs to back<br>  Short raglan sleeves<br>  Ribbed hem<br>  Jacquard Gymshark logo to centre chest<br>  54% Nylon, 38% Polyester, 8% Elastane<br>  Model is 55 and wears size XS <br>  Label Colour: Cyber Pink<br><br>Give your performance the light it deserves in the Ultra Seamless Crop Top. Uniting a flattering, close-to-skin fit with a midriff crop and secure ribbed hem, this gym top reinforces every movement of your workout, while seamless contouring details, elegant cut-outs and intense colourways are sure to turn heads. Ultra Seamless is a collection as vibrant as you are; a collection that empowers you to let yourself glow.</div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingultra-seamless-crop-toph1', NULL, '2020-04-20 00:24:52', '2020-05-14 22:49:41'),
