(472, 'EA5b3c7', '<h1 class=\"pinfo__heading\">ribbon crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<span>Graft in glamour.</span><br><br><span>- Regular fit</span><br><span>- Midi length</span><br><span>- Ribbon fastening to waist</span><br><span>- Lightweight fabric</span><br><span>- 95% Cotton, 5% Elastane</span><br><span>- Model is 5\'5\" and wears size XS</span><br><span>- Label Colour:Black</span><br><br><span>The Gymshark Ribbon Crop Top offers the perfect blend of fashion and function. Cropped to ensure you stay cool during even the toughest workout, the stylish ribbons add a customisable and feminine touch to make sure you always look as good as you feel. A must-have piece, not just for the gym.</span>\n</div>', 31, 25, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingribbon-crop-toph1', NULL, '2020-04-20 00:24:58', '2020-05-14 22:49:41'),
(473, '482ca89', '<h1 class=\"pinfo__heading\">recess crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<span>The before and after collection.</span><br><br><span> Boxy fit</span><br><span> Cropped length</span><br><span> Mesh panelling to sides and back</span><br><span> Large cut-outs to back</span><br><span> Dropped shoulder</span><br><span> Branded Gymshark piping</span><br><span> Cut-off printed Gymshark logo to chest</span><br><span> 100% Polyester</span><br><span> Model is 57 and wears size S</span><br><span> Label Colour: Oyster White</span><br><br><span>The Recess Crop Top, with statement Gymshark wording to the front, is a design that makes itself known. A range for pre and post-training, the Recess collection keeps you fresh through warm-ups and refreshed through cool-downs with breathable mesh inserts and a supple polyester-build. Always street-conscious, it includes details like a casual boxy, cropped fit and large cut-outs to the back.</span>\n</div>', 32, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingrecess-crop-toph1', NULL, '2020-04-20 00:24:59', '2020-05-14 22:49:41'),
(474, '9D6b915', '<h1 class=\"pinfo__heading\">move crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<span>Make your Move.</span><br><br><span> Boxy fit</span><br><span> Cropped length</span><br><span> Contouring seam details to shoulders and arms</span><br><span> Inserted mesh panel to chest</span><br><span> Self-inserted neck</span><br><span> Tonal raised rubber logo to hem</span><br><span> Main: 100% Cotton. Mesh: 91% Nylon, 9% Elastane.</span><br><span> Model is 57 and wears size S</span><br><span> Label Colour: Sour Pistachio</span><br><br><span>The Move Crop Top is an assertive gym style with three electric colourways, a relaxed boxy fit and an inserted mesh panel to the chest. Its features are multifunctional, too, providing an unrestricted range of movement and breathability through the mesh, so the only focus while training, is training.</span>\n</div>', 32, 25, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingmove-crop-toph1', NULL, '2020-04-20 00:25:00', '2020-05-14 22:49:41'),
