(476, '8Dc85ec', '<h1 class=\"pinfo__heading\">fraction crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<span>Cut to the point.</span><br><br><span>- Midriff crop</span><br><span>- Capped roll up sleeves</span><br><span>- Cut off Gymshark graphic at hem</span><br><span>-</span><span>95% Cotton, 5% Elastane</span><br><span>- Model is 5\'5\" and wears a size XS<br></span><span>- Label Colour: Pink Salt/White</span><br><br><span>A slice of unique athleisure, the Fraction Crop Top is charming and convenient. Available in versatile colours, style any workout or rest day outfit with this short sleeve crop top.</span>\n</div>', 31, 25, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingfraction-crop-toph1', NULL, '2020-04-20 00:25:05', '2020-05-14 22:49:41'),
(477, '234b7c1', '<h1 class=\"pinfo__heading\">revival zip up crop top</h1>\n', '<div class=\"pdp-accordion__body\">Bring back the 90s.<br><br>  Regular fit<br>  Cropped length<br>  Sleeveless<br>  Contouring seam lines<br>  1/2 zip to front<br>  Ribbed collar<br>  Gymshark taping to sides<br>  Main: 50% Cotton, 50% Polyester. Trim: 84% Polyester, 16% Elastane.<br>  Model is 57 and wears size S <br>  Label Colour: Black/Grey<br><br>The Revival Zip Up Crop Top resurrects the urban street vibes of the 90s. With a woven, high-sheen material, branded taping to the sides and a midriff crop, its a flattering cut with an assertive aesthetic, from the sofa to the streets.</div>', 32, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingrevival-zip-up-crop-toph1', NULL, '2020-04-20 00:25:06', '2020-05-14 22:49:41'),
(478, '8D7544e', '<h1 class=\"pinfo__heading\">energy+ seamless crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>JUST ADD ENERGY</strong><br><br>- Shape-enhancing eyelet detailing<br>- Removable padding<br>- Midriff crop<br>- 94% Nylon, 6% Elastane<br>- Model is 5\'7\" and wears a size XS<br>- Label Colour: Malibu Blue<br><br>Engineered to power your performance, the Energy+ Seamless Crop Top offers a custom support in the gym with removable padding, while a ribbed underband ensures it stays put while you move. Seamless eyelet contouring and sumptuously soft fabrics make it some of our most premium work yet.</div>', 32, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingenergy-seamless-crop-toph1', NULL, '2020-04-20 00:25:07', '2020-05-14 22:49:41'),
(479, '47246f1', '<h1 class=\"pinfo__heading\">pro perform crop top</h1>\n', '<div class=\"pdp-accordion__body\">Compete with the elite.<br><br> - Midriff crop<br> - Stripe mesh panels<br> - Perforation to chest and under arm<br> - Reflective tape detailing<br> - Crossover detail to front<br> - Printed Gymshark logos to waistband<br> - Main: 69% Polyester, 31% Elastane. Mesh: 80% Nylon, 20% Elastane.<br> - Model is 5\'7\" and wears a size S<br><br>Integrating elegance and performance, the Pro Perform Crop Top promises to deliver style and results. With perforation detailing for breathability, stretchy fabrics for a liberated range of movement and a distinct open back with crossover straps for a touch of style, its simply designed to be exquisite.<meta charset=\"utf-8\">\n</div>', 32, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingpro-perform-crop-toph1', NULL, '2020-04-20 00:25:08', '2020-05-14 22:49:41'),
(480, '9369666', '<h1 class=\"pinfo__heading\">camo seamless long sleeve crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<p class=\"p1\"><strong>COMPLETE THE SET:</strong></p>\n<p><span style=\"text-decoration: underline;\"> <a href=\"https://www.gymshark.com/products/gymshark-camo-seamless-leggings-lavender-grey\">Camo Seamless Leggings</a></span><br><span style=\"text-decoration: underline;\"> <a href=\"https://www.gymshark.com/products/gymshark-camo-seamless-sports-bra-lavender-grey\">Camo Seamless Sports Bra</a></span></p>\n<p><b>STAND OUT OF LINE<br></b><br><span>- All-over jacquard camo pattern</span><br><span>- Midriff crop</span><br><span>- Ruched detail to centre chest</span><br><span>- Subtle back openings</span><br><span>- Seamless Gymshark logo to waist</span><br><span>- Thumbholes</span><br><span><span>-</span></span></p>\n<meta charset=\"utf-8\">\n<p><span>79% Nylon, 16% Polyester, 5% Elastane</span><br><span><span>- Main Image: Left Model is 5\'8\" and wears a size M<br></span></span></p>\n<meta charset=\"utf-8\">\n<p><span> Main Image: Right Model is 53 and wears size XS<br></span><br><span>Its everything for performance, everything for aesthetics and everything youve been waiting for. Available in distinct jacquard camo colourways that combine with flattering midriff crops, ruched chest details and subtle back openings, the Camo Seamless Long Sleeve Crop Top boasts a camouflage pattern, designed to blend out.</span></p>\n</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcamo-seamless-long-sleeve-crop-toph1', NULL, '2020-04-20 00:25:08', '2020-05-14 22:49:41'),
(481, '8B1db02', '<h1 class=\"pinfo__heading\">flawless knit long sleeve crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<span>Settle for nothing less than Flawless.</span><br><br><span> Fitted design with midriff crop</span><br><span> Eyelet and rib patterns</span><br><span> Crew neckline</span><br><span> Ventilation detailing</span><br><span> Thumbholes</span><br><span> 95% Nylon, 5% Elastane</span><br><span> Model is 5\'5\" and wears a size XS.</span><br><br><span>Experience the Flawless performance. The features of the Flawless Knit Long Sleeve Crop Top have been designed to deliver workout support and a stunning aesthetic alike; this gym top boasts flattering contours, enhanced breathability and supple fabrics.</span>\n</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingflawless-knit-long-sleeve-crop-toph1', NULL, '2020-04-20 00:25:09', '2020-05-14 22:49:41'),
(482, '2C8af17', '<h1 class=\"pinfo__heading\">flex long sleeve crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<p>Combining our signature seamless knit with superior, sculpting design.</p>\n<p><span><br> Figure-enhancing contouring shades<br> Jacquard elasticated mid-rise waistband<br> DRY technology<br> 56% Nylon, 41% Polyester, 3% Elastane<br></span> Model is 5\"5\' and wears a size XS<br><span><br>Featuring a new long sleeve design, the Flex Long Sleeve Crop Top is flattering and functional. Built from soft and supple fabrics that are comfortable and supportive, youre promised ease of movement in the gym for your next workout.</span></p>\n</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingflex-long-sleeve-crop-toph1', NULL, '2020-04-20 00:25:10', '2020-05-14 22:49:41'),
