(485, '5C82a4d', '<h1 class=\"pinfo__heading\">slounge crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<p><span>The perfect rest day.</span><br><br><span> Our softest fabric blend yet</span><br><span> Wide racerback design with high neck</span><br><span> Flattering cropped length and dipped hem</span><br><span> Non-adjustable drawstring neck</span><br><span> 60% Polyester, 38% Viscose, 2% Elastane</span><br><span> Model is 5\'7\" and wears a size S.</span><br><br><span>Enhancing your figure and following your body shape, the Slounge Crop Top ensures a relaxing freedom of movement. Get a customisable feel for consistent comfort with soft and supple fabrics and a ribbed-marl design.</span></p>\n</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingslounge-crop-toph1', NULL, '2020-04-20 00:25:13', '2020-05-14 22:49:41'),
