(497, '6A00699', '<h1 class=\"pinfo__heading\">vital seamless shrug</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<p><span></span><span><strong>EMPOWERED THROUGH STRENGTH.</strong><br><br>- Super cropped<br>- Raglan sleeves detailed with dotted contouring<br>- DRY technology<br>- Thumb holes<br>- 59% Nylon, 34% Polyester, 7% Elastane<br>- Model is 5\'8\" and wears a size S<br>- Label Colour:</span>Washed Jade Marl<br><span><br>No ordinary shrug; A Gymshark kinda shrug. Pairing perfectly with the Sports Bra, the Vital Seamless Shrug is a super stylish addition to your workout wardrobe. In a versatile Black Marl, complete the gym look with ease.</span></p>\n</div>', 32, 20, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingvital-seamless-shrugh1', NULL, '2020-04-20 00:25:23', '2020-05-14 22:49:42'),
