(499, '4Bb6cdc', '<h1 class=\"pinfo__heading\">fraction crop top</h1>\n', '<div class=\"pdp-accordion__body\"><p>Cut to the point.<br><br>- Midriff crop<br>- Capped roll up sleeves<br>- Cut off Gymshark graphic at hem<br>- 72% Product, 28% Material<br>- Model is 5\'8\" and wears a size S.<br>- Label Colour: White/Black<br><br>A slice of unique athleisure, the Fraction Crop Top is charming and convenient. Available in five versatile colours, style any workout or rest day outfit with this short sleeve crop top.</p></div>', 32, 25, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingfraction-crop-toph1', NULL, '2020-04-20 00:25:25', '2020-05-14 22:49:42'),
(500, '4Fc7ef2', '<h1 class=\"pinfo__heading\">relaxed crop top</h1>\n', '<div class=\"pdp-accordion__body\">Relaxed by name, Relaxed by nature.<br><br>  Relaxed fit<br>  Cropped length<br>  Drop armhole cut<br>  Super soft, lightweight material<br>  Panelled, double-layer aesthetic<br>  Centre slit to back<br>  Wide V-neck<br>  Woven tab logo to hem<br>  95% Viscose, 5% Elastane<br>  Model is 5\'7\" and wears size S.<br>  Label Colour: Black<br><br>Style up for your chill out in the Relaxed Crop Top. Living up to its name, this laid-back lounge top emanates true relaxed vibes with an incredibly soft hand-feel and spacious fit alongside a flattering midriff crop and drop armhole cut.</div>', 32, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingrelaxed-crop-toph1', NULL, '2020-04-20 00:25:26', '2020-05-14 22:49:42'),
(501, 'E0a25a9', '<h1 class=\"pinfo__heading\">slounge crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<p><span>The perfect rest day.</span><br><br><span> Our softest fabric blend yet</span><br><span> Wide racerback design with high neck</span><br><span> Flattering cropped length and dipped hem</span><br><span> Non-adjustable drawstring neck</span><br><span> 60% Polyester, 38% Viscose, 2% Elastane</span><br><span> Model is 5\'7\" and wears a size XS.</span><br><br><span>Enhancing your figure and following your body shape, the Slounge Crop Top ensures a relaxing freedom of movement. Get a customisable feel for consistent comfort with soft and supple fabrics and a ribbed-marl design.</span></p>\n</div>', 32, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingslounge-crop-toph1', NULL, '2020-04-20 00:25:27', '2020-05-14 22:49:42'),
(502, '1C37b0c', '<h1 class=\"pinfo__heading\">slounge bralette</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<p><span>The perfect rest day.</span><br><br><span>- Multi-elasticated strapping</span><br><span>- Cross back detailing</span><br><span>- Ribbed fabric</span><br><span>- Removable cups<br></span><span>- 69% Cotton, 30% Polyester, 1% Elastane</span><br><span>- Model is 5\'7\" and wears a size S.</span><br><br><span>The Slounge Bralette Crop Top finds the perfect harmony between support and comfort with lightly elasticated strapping and removable cups alongside a sumptuously soft fabric-blend. Wear underneath the Slounge Cropped Hoodie to complete your perfect rest day.</span></p>\n</div>', 32, 25, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingslounge-braletteh1', NULL, '2020-04-20 00:25:27', '2020-05-14 22:49:42'),
(503, '3Eb8be1', '<h1 class=\"pinfo__heading\">true texture bralette</h1>\n', '<div class=\"pdp-accordion__body\">Comfort with character.<br><br> - Multi-fabric blend<br> - Cross over panelling to front<br> - Dipped neckline<br> - Cross over bow straps to back<br> - Removable padding<br> - Tab logo to hem<br> - Main: 47% Polyester, 43% Nylon, 10% Elastane. Front Bottom Panel: 92% Polyester, 8% Elastane. Front Side Panel: 95% Polyester, 5% Elastane. Back Side Panel: 89% Polyester, 11% Elastane.<br> - Model is 5\'7\" and wears a size S. <br><br>Up the elegance of your rest day with the multi-fabric and multi-purpose True Texture Bralette. Its pure, graceful design features a delicate silhouette, a soft fabric blend and customisable support.</div>', 31, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtrue-texture-braletteh1', NULL, '2020-04-20 00:25:28', '2020-05-14 22:49:42'),
(504, '40840cb', '<h1 class=\"pinfo__heading\">combat sleeveless hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>FIGHTING FIT</strong><br><br>- Combat print to upper back<br>- 2 piece hood<br>- Drawcord to hood<br>- Kangaroo pocket<br>- Ribbed waistband<br>- Branded woven tab logo to front waistband<br>- 54% Cotton 46% Polyester<br>- Model is 5\'6\" and wears size XS<br>- Label Colour: Black<br><br>The Combat Sleeveless Hoodie is a must for anyone training in martial arts (and pretty useful for anyone who isnt too). With a cropped length, kangaroo pocket and drawcord hood, it provides an extra layer without inhibiting movement or performance, and also gives you a distinct combat aesthetic. <br>\n</div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcombat-sleeveless-hoodieh1', NULL, '2020-04-20 00:25:33', '2020-05-14 22:49:42'),
(505, '229f5ab', '<h1 class=\"pinfo__heading\">combat sleeveless hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>FIGHTING FIT</strong><br><br><span>- Combat print to upper back</span><br><span>- 2 piece hood</span><br><span>- Drawcord to hood</span><br><span>- Kangaroo pocket</span><br><span>- Ribbed waistband</span><br><span>- Branded woven tab logo to front waistband</span><br><span>- 54% Cotton 46% Polyester</span><br><span>- Model is 5\'6\" and wears size XS</span><br><span>- Label Colour: Claret</span><br><br><span>The Combat Sleeveless Hoodie is a must for anyone training in martial arts (and pretty useful for anyone who isnt too). With a cropped length, kangaroo pocket and drawcord hood, it provides an extra layer without inhibiting movement or performance, and also gives you a distinct combat aesthetic.</span>\n</div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcombat-sleeveless-hoodieh1', NULL, '2020-04-20 00:25:33', '2020-05-14 22:49:42'),
(506, '00a084e', '<h1 class=\"pinfo__heading\">combat sleeveless hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>FIGHTING FIT</strong><br><br><span>- Combat print to upper back</span><br><span>- 2 piece hood</span><br><span>- Drawcord to hood</span><br><span>- Kangaroo pocket</span><br><span>- Ribbed waistband</span><br><span>- Branded woven tab logo to front waistband</span><br><span>- 54% Cotton 46% Polyester</span><br><span>- Model is 5\'6\" and wears size XS</span><br><span>- Label Colour: Smokey Grey Marl</span><br><br><span>The Combat Sleeveless Hoodie is a must for anyone training in martial arts (and pretty useful for anyone who isnt too). With a cropped length, kangaroo pocket and drawcord hood, it provides an extra layer without inhibiting movement or performance, and also gives you a distinct combat aesthetic.</span>\n</div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcombat-sleeveless-hoodieh1', NULL, '2020-04-20 00:25:34', '2020-05-14 22:49:42'),
(507, 'DE6105c', '<h1 class=\"pinfo__heading\">lightweight seamless hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>TAKE AIR</strong><br><br><span> Regular fit</span><br><span> Subtle ribbed and mesh material structures</span><br><span> Ventilating seamless knit to underarm</span><br><span> Contouring seamless knit detailing</span><br><span> Sweat-wicking DRY technology</span><br><span> Functional toggle drawcord feature to back</span><br><span> Raglan sleeves with thumbholes</span><br><span> Funnel neck hood</span><br><span> Jacquard Gymshark logo to centre chest</span><br><span> 74% Polyester, 26% Nylon</span><br><span> Model is 58 and wears size S</span><br><span> Label Colour: Black</span><br><br><span>Training never felt so free with the Lightweight Seamless Hoodie: a dependable throw-on as you warm-up or an airy top layer through sprints and squats. This seamless pullover makes moving feel effortless with an unrestrictive and customisable fit - thanks to a light Polyester-Nylon blend and toggle drawcord to the back - while adding in seamless contouring and ribbed and mesh material panels to accentuate your efforts in the gym.</span>\n</div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglightweight-seamless-hoodieh1', NULL, '2020-04-20 00:25:35', '2020-05-14 22:49:42'),
(508, 'FA54867', '<h1 class=\"pinfo__heading\">legacy fitness short sleeve hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>THE LEGACY CONTINUES</strong><br><br><span> Boxy fit</span><br><span> Cropped length</span><br><span> Three-piece hood with drawcords</span><br><span> V-rib stitching to neck</span><br><span> Short cap sleeves</span><br><span> Legacy Gymshark logo to centre back</span><br><span> 100% Cotton</span><br><span> Model is 59 and wears size XS</span><br><span> Label Colour: Washed Lavender</span><br><br><span>We built the Legacy Fitness Short Sleeve Hoodie with a durable cotton material, unrestrictive boxy fit and short cap sleeves so you can train with full power. We added a large classic Legacy logo to the back so you can train with full pride too.</span>\n</div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-fitness-short-sleeve-hoodieh1', NULL, '2020-04-20 00:25:36', '2020-05-14 22:49:42'),
