(512, 'DB98e04', '<h1 class=\"pinfo__heading\">apollo hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>A TRUE GYMSHARK ORIGINAL</strong><br><br><span> Regular fit</span><br><span> Raglan sleeves</span><br><span> Functional drawcords to crossover neckline</span><br><span> Open pouch pocket</span><br><span> Printed Gymshark logo to centre chest</span><br><span> 60% Cotton, 40% Polyester</span><br><span> Model is 59 and wears size XS</span><br><span> Label Colour:Slate Lavender</span><br><br><span>Whether its a warm-up for your gym workout or a keep-active rest day, the Apollo Hoodie is a reliable throw-on with a proud Gymshark design. Functional features such as a ribbed hem and cuffs and a fleece lined interior provide a fit and comfort that last, as you move or as you relax.</span>\n</div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingapollo-hoodieh1', NULL, '2020-04-20 00:25:40', '2020-05-14 22:49:42'),
