(516, 'FFe0ec6', '<h1 class=\"pinfo__heading\">aura hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>PEACE BY PEACE</strong><br><br><span> Oversized fit</span><br><span> Cropped length to front hem and extreme drop to back hem</span><br><span> Mesh material to lower front and back</span><br><span> Mesh and solid panels to arms</span><br><span> Oversized funnel neck hood with drawcords</span><br><span> Ruched detail to wrist cuffs</span><br><span> Woven tab logo to hood</span><br><span> Main: 54% Nylon, 37% Polyester, 9% Elastane. Mesh: 66% Nylon, 34% Elastane.</span><br><span> Model is 59 and wears size XS</span><br><span> Label Colour: Black</span><br><br><span>Give it a rest day in the Aura Hoodie. Consistent comfort and relaxation is never in question with an incredibly soft-touch material and a roomy, oversized fit, while it still incorporates touches of distinction with mesh layers to the lower half and a large, casual drawcord funnel neck. This relaxed pullover is all about you, yourself and your mind.</span>\n</div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingaura-hoodieh1', NULL, '2020-04-20 00:25:44', '2020-05-14 22:49:42'),
(517, '9E6cb68', '<h1 class=\"pinfo__heading\">solo cropped hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>TRAIN ON TREND</strong><br><br><span> Boxy fit</span><br><span> Cropped length</span><br><span> Three-piece hood with drawcords</span><br><span> Dropped shoulder</span><br><span> V-rib stitching to neck</span><br><span> Contrast Gymshark logo</span><br><span> 70% Cotton, 30% Polyester</span><br><span> Model is 55 and wears size XS</span><br><span><span> Label Colour:</span></span><meta charset=\"utf-8\">\n<span>Stormy Turquoise</span><br><br><span>Stay on form and on style in the Solo Cropped Hoodie. From warm up to workout, you can rely on this gym hoodie with its boxy fit and supportive fabric-blend that allows unlimited movement. The additions of a ribbed V-neck insert and tonal colour shades bring a touch of city-style into the weight room.</span>\n</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingsolo-cropped-hoodieh1', NULL, '2020-04-20 00:25:45', '2020-05-14 22:49:42'),
