(521, '03c041b', '<h1 class=\"pinfo__heading\">cropped crest hoodie</h1>\n', '<div class=\"pdp-accordion__body\"><p>The perfect cover-up.<br><br>  Relaxed fit<br>  Midriff crop<br>  Raglan sleeve construction<br>  Lined three-piece hood<br>  Adjustable drawcords<br>  Printed Gymshark logo to chest<br>  60% Cotton, 40% Polyester<br>  Model is 5\'7\" and wears a size S<br>  Label Colour: Black<br><br>The Cropped Crest Hoodie is contemporary and stylish but, above all, reliable. Its soft, supple cotton-polyester blend allows a supported warm-up and focused workout. With its flattering midriff crop and statement branding, its a versatile streetwear addition, too. You cant go wrong with Crest.</p></div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcropped-crest-hoodieh1', NULL, '2020-04-20 00:25:48', '2020-05-14 22:49:42'),
