(532, '3D90d49', '<h1 class=\"pinfo__heading\">vital seamless 1/2 zip pullover</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<strong>EMPOWERED THROUGH STRENGTH<span></span></strong><br><br><span>- Body fit</span><br><span>- Zip to mid chest</span><br><span>- High neck</span><br><span>- Thumbholes</span><br><span>- Logo to left chest and centre back</span><br><span>- 59% Nylon, 34% Polyester, 7% Elastane</span><br><span>- Model is 58\" and wears size XS</span><br><span>- Label Colour: Washed Jade Marl</span><br><br><span>Half the zip, all the performance. The Vital Seamless Half Zip Pullover perfectly blends a stylish silhouette with our signature seamless fabric to ensure maximum comfort while you train. This versatile piece is perfect for taking your training outdoors, whether were talking a hardcore HIIT or a relaxing hike.</span><br>\n</div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingvital-seamless-12-zip-pulloverh1', NULL, '2020-04-20 00:25:58', '2020-05-14 22:49:42'),
(533, 'BA0ab97', '<h1 class=\"pinfo__heading\">vital seamless 1/2 zip pullover</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>EMPOWERED THROUGH STRENGTH </strong><br><br>- Body fit <br>- Zip to mid chest <br>- High neck <br>- Thumbholes <br>- Logo to left chest and centre back<br>- 59% Nylon, 34% Polyester, 7% Elastane<br>- Model is 58\" and wears size XS<br>- Label Colour: Black Marl<br><br>Half the zip, all the performance. The Vital Seamless Half Zip Pullover perfectly blends a stylish silhouette with our signature seamless fabric to ensure maximum comfort while you train. This versatile piece is perfect for taking your training outdoors, whether were talking a hardcore HIIT or a relaxing hike.</div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingvital-seamless-12-zip-pulloverh1', NULL, '2020-04-20 00:25:59', '2020-05-14 22:49:42'),
(534, '76f7e92', '<h1 class=\"pinfo__heading\">training zip up jacket</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>IN YOUR LOCKER</strong><br><br>- Body fit<br>- High neck <br>- Full zip <br>- Zipped pockets<br>- Logo to collar<br>- All-over panelling<br>- 81% Polyester, 19% Elastane <br>- Model is 5\'3\" and wears size XS<br>- Label Colour: Smokey Grey<br><br>The zip up youll want in your gym locker. High neck, deep zipped pockets and full-length zip, made of breathable material, perfect to see you through any outdoor workout, or throw on after any indoor one.</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtraining-zip-up-jacketh1', NULL, '2020-04-20 00:26:00', '2020-05-14 22:49:42'),
