(536, 'CF2c100', '<h1 class=\"pinfo__heading\">training zip up jacket</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>IN YOUR LOCKER</strong><br><br>- Body fit<br>- High neck <br>- Full zip <br>- Zipped pockets<br>- Logo to collar<br>- All-over panelling<br>- 81% Polyester, 19% Elastane <br>- Model is 5\'3\" and wears size XS<br>- Label Colour: Black<br><br>The zip up youll want in your gym locker. High neck, deep zipped pockets and full-length zip, made of breathable material, perfect to see you through any outdoor workout, or throw on after any indoor one.</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtraining-zip-up-jacketh1', NULL, '2020-04-20 00:26:02', '2020-05-14 22:49:42'),
(537, 'A4cc0c2', '<h1 class=\"pinfo__heading\">lightweight seamless hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>TAKE AIR</strong><br><br><span> Regular fit</span><br><span> Subtle ribbed and mesh material structures</span><br><span> Ventilating seamless knit to underarm</span><br><span> Contouring seamless knit detailing</span><br><span> Sweat-wicking DRY technology</span><br><span> Functional toggle drawcord feature to back</span><br><span> Raglan sleeves with thumbholes</span><br><span> Funnel neck hood</span><br><span> Jacquard Gymshark logo to centre chest</span><br><span> 74% Polyester, 26% Nylon</span><br><span> Model is 55 and wears size XS</span><br><span> Label Colour: Slate Lavender</span><br><br><span>Training never felt so free with the Lightweight Seamless Hoodie: a dependable throw-on as you warm-up or an airy top layer through sprints and squats. This seamless pullover makes moving feel effortless with an unrestrictive and customisable fit - thanks to a light Polyester-Nylon blend and toggle drawcord to the back - while adding in seamless contouring and ribbed and mesh material panels to accentuate your efforts in the gym.</span>\n</div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglightweight-seamless-hoodieh1', NULL, '2020-04-20 00:26:02', '2020-05-14 22:49:42'),
(538, 'F8178df', '<h1 class=\"pinfo__heading\">legacy fitness track top</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>THE LEGACY CONTINUES</strong><br><br><span>- Boxy fit</span><br><span>- Zip up</span><br><span>- Exposed seams</span><br><span>- Cropped length</span><br><span>- Drawcord hood</span><br><span>- Large offset logo to back</span><br><span>- 100% Cotton</span><br><span>- Model is 59 and wears size XS</span><br><span>- Label Colour: Slate Lavender</span><br><br><span>Legacies, just like bodies, dont build themselves. The Legacy Fitness Track Top is your new perfect training top-layer, ready to help you build both. Loose fitting and soft fabric making it easy to move in and cropped length so it will perfectly complement your high waisted leggings/ shorts.</span>\n</div>', 32, 60, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-fitness-track-toph1', NULL, '2020-04-20 00:26:03', '2020-05-14 22:49:42'),
(539, '578dd0b', '<h1 class=\"pinfo__heading\">legacy fitness track top</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>THE LEGACY CONTINUES</strong><br><br>- Boxy fit<br>- Zip up <br>- Exposed seams<br>- Cropped length <br>- Drawcord hood<br>- Large offset logo to back<br>- 100% Cotton<br>- Model is 58 and wears size S<br>- Label Colour: Black<br><br>Legacies, just like bodies, dont build themselves. The Legacy Fitness Track Top is your new perfect training top-layer, ready to help you build both. Loose fitting and soft fabric making it easy to move in and cropped length so it will perfectly complement your high waisted leggings/ shorts.</div>', 32, 60, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-fitness-track-toph1', NULL, '2020-04-20 00:26:04', '2020-05-14 22:49:42'),
(540, '2C991c5', '<h1 class=\"pinfo__heading\">legacy fitness super cropped hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>THE LEGACY CONTINUES</strong><br><br>- Boxy fit<br>- Super cropped length<br>- Raw exposed seams<br>- Drawcord hood<br>- Shaped hem<br>- Large print to back<br>- Rib cuffs<br>- 100% Cotton<br>- Model is 59 and wears size XS<br>- Label Colour:Black<br><br>Its important, every now and then, to look back and celebrate how far youve come. Which is exactly what weve done with our Legacy collection, and what we want you to do when youre wearing it. With raw exposed seams, super cropped length and our classic logo on the back, the Legacy Fitness Super Crop Hoodie is perfect for looking back, and propelling forward.</div>', 32, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-fitness-super-cropped-hoodieh1', NULL, '2020-04-20 00:26:05', '2020-05-14 22:49:42'),
(541, '65c9ff8', '<h1 class=\"pinfo__heading\">legacy fitness longline hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>THE LEGACY CONTINUES</strong><br><br><span>- Boxy fit</span><br><span>- Exposed seams</span><br><span>- Kangaroo pocket</span><br><span>- Zips at side seams</span><br><span>- Longline length</span><br><span>- Hood</span><br><span>- 100% Cotton</span><br><span>- Model is 5\'8 and wears size S</span><br><span>- Label Colour: Slate Lavender</span><br><br><span>Sometimes a hoodie is just too restrictive, and thats where the Legacy Fitness Longline Hoodie comes in. Shorter sleeves and zips at the seams ensure ease of movement, while still having a longline length, loose fit and comfy feel you want from a hoodie. It also boasts our legacy logo on the back and a useful kangaroo pocket to the front</span>\n</div>', 32, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-fitness-longline-hoodieh1', NULL, '2020-04-20 00:26:06', '2020-05-14 22:49:42'),
(542, 'C15db84', '<h1 class=\"pinfo__heading\">legacy fitness longline hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>THE LEGACY CONTINUES</strong><br><br>- Boxy fit<br>- Exposed seams<br>- Kangaroo pocket<br>- Zips at side seams <br>- Longline length<br>- Hood <br>- 100% Cotton<br>- Model is 5\'9 and wears size XS<br>- Label Colour: Black<br><br>Sometimes a hoodie is just too restrictive, and thats where the Legacy Fitness Longline Hoodie comes in. Shorter sleeves and zips at the seams ensure ease of movement, while still having a longline length, loose fit and comfy feel you want from a hoodie. It also boasts our legacy logo on the back and a useful kangaroo pocket to the front</div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-fitness-longline-hoodieh1', NULL, '2020-04-20 00:26:07', '2020-05-14 22:49:42'),
(543, '9D5d466', '<h1 class=\"pinfo__heading\">studio sweater</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>MASTER YOUR MOBILITY</strong><br><br>- Regular fit <br>- Ribbed fabric<br>- One shoulder feature<br>- Mesh back<br>- Thumbholes to cuffs <br>- Outline logo to front hem<br>- Main: 94% cotton, 6% Elastane. Mesh: 91% Nylon, 9% Elastane.<br>- Model is 57 and wears size S<br>- Label Color: Smokey Teal<br><br>Two words to sum up the Studio Sweater: soft and stretchy. Made to move in, this sweater combines ribbed cotton and mesh for your ultimate comfort. Plus, it features a fun shoulder detail so you can make a style statement in any studio you walk into.</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingstudio-sweaterh1', NULL, '2020-04-20 00:26:08', '2020-05-14 22:49:42'),
