(546, '926e64f', '<h1 class=\"pinfo__heading\">studio recovery hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>MASTER YOUR MOBILITY</strong><br><br><span>- Regular fit</span><br><span>- Wrap feature with tie</span><br><span>- Hood</span><br><span>- Thumbholes</span><br><span>- Decal logo</span><br><span>- 94% Cotton, 6% Elastane</span><br><span>- Model is 57 and wears size S</span><br><span>- Label Color: Black</span><br><br><span>Sometimes mobility can get chilly. But we have the perfect antidote: The Studio Recovery Hoodie. The super soft ribbed fabric makes it perfect to stretch in and the wrap around feature adds some style, all the while providing that all important extra layer in those cold studios.</span>\n</div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingstudio-recovery-hoodieh1', NULL, '2020-04-20 00:26:10', '2020-05-14 22:49:42'),
(547, '270abb5', '<h1 class=\"pinfo__heading\">studio recovery hoodie</h1>\n', '<div class=\"pdp-accordion__body\"><p><strong>MASTER YOUR MOBILITY</strong><br><br>- Regular fit<br>- Wrap feature with tie<br>- Hood<br>- Thumbholes <br>- Decal logo<br>- 94% Cotton, 6% Elastane<br>- Model is 58 and wears size S<br>- Label Color: Winter Berry<br><br>Sometimes mobility can get chilly. But we have the perfect antidote: The Studio Recovery Hoodie. The super soft ribbed fabric makes it perfect to stretch in and the wrap around feature adds some style, all the while providing that all important extra layer in those cold studios.</p></div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingstudio-recovery-hoodieh1', NULL, '2020-04-20 00:26:12', '2020-05-14 22:49:42'),
(548, '0D66eec', '<h1 class=\"pinfo__heading\">speed full zip jacket</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>STEP INTO CARDIO.</strong><br><br>- Body fit<br>- Full zip up<br>- Side pockets<br>- Mesh panelling<br>- Thumbholes <br>- Logo to back of neck <br>- Wrist watch detailing<br>- Main: 80% Nylon, 20% Elastane. Mesh: 64% Nylon, 36% Elastane.<br>- Model is 58 and wears size XS<br>- Label Color: Winter Berry<br><br>The Speed Zip Through is perfect for keeping warm on those cold, dark winter runs. Snug fit with mesh panelling to high-sweat areas make it cosy yet breathable. With easy-access pockets and mesh at the wrist for watch-checking, its the perfect pavement-pounding partner. <br><br>\n</div>', 32, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingspeed-full-zip-jacketh1', NULL, '2020-04-20 00:26:12', '2020-05-14 22:49:42'),
(549, '47f4287', '<h1 class=\"pinfo__heading\">speed 1/4 zip jacket</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>STEP INTO CARDIO.</strong><br><br>- Boxy fit<br>- Kangaroo pocket <br>- Drawcord at waist <br>- Hood<br>- Base: 100% Polyester, Mesh: 68% Nylon, 32% Elastane<br>- Model is 58 and wears size XS<br>- Label Color: Black<br><br>Even the rain wont rain on your running parade. The Speed 1/4 Zip Jacket is the extra layer you need, its water repellent to keep you protected, and light enough to keep you from burning up. Featuring a zipped kangaroo pocket, drawcord waist and gaiter sleeve to ensure maximum comfort on your journey, no matter how long. <br>\n</div>', 32, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingspeed-14-zip-jacketh1', NULL, '2020-04-20 00:26:13', '2020-05-14 22:49:42'),
(550, 'D0127c7', '<h1 class=\"pinfo__heading\">legacy fitness longline sweater</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>THE LEGACY CONTINUES</strong><br><br><span> Regular fit</span><br><span> Super longline length</span><br><span> Three-piece hood with drawcords</span><br><span> Double pouch pocket feature to front</span><br><span> Long side splits to hem</span><br><span> Legacy Gymshark logo to centre chest</span><br><span> 100% Cotton</span><br><span> Model is 5\'9 and wears size XS</span><br><span> Label Colour: Washed Black</span><br><br><span>A laid back, rest-day-ready look, inspired by the highest intensity training. The Legacy FitnessLongline Sweater features a super longline build and soft cotton material that are perfect for post-workout relaxation. With a large classic Legacy logo to the centre of the chest, its still rooted in our lifting heritage.</span>\n</div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-fitness-longline-sweaterh1', NULL, '2020-04-20 00:26:14', '2020-05-14 22:49:42'),
