(552, '9F5f2bf', '<h1 class=\"pinfo__heading\">legacy fitness sweater</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>THE LEGACY CONTINUES</strong><br><br><span> Oversized fit</span><br><span> Cropped length</span><br><span> Dropped shoulder</span><br><span> Raglan tape feature to arms</span><br><span> Ribbed neck and cuffs</span><br><span> Printed classic Gymshark logo to centre chest</span><br><span> 65% Polyester, 35% Cotton</span><br><span> Model is 57 and wears size S</span><br><span> Label Colour:Washed Black</span><br><br><span>Become part of the Legacy. The Legacy Fitness Sweater is stooped in our history, featuring a printed, classic Gymshark logo front-and-centre to the chest. Not a complete recall to the past, the design of this cropped pullover features the contemporary characteristics of an oversized fit, dropped shoulder and tape to the arms.<br></span>\n</div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-fitness-sweaterh1', NULL, '2020-04-20 00:26:16', '2020-05-14 22:49:42'),
