(555, '01fdbc0', '<h1 class=\"pinfo__heading\">legacy fitness crop zip hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<p class=\"p1\"><strong>THE LEGACY CONTINUES.</strong></p>\n Regular fit<br>  Cropped length<br>  Dropped shoulder<br>  Full zip front<br>  Ribbed hem and cuffs<br>  Contrast drawcords to hood<br>  Classic Gymshark logo to centre back<br>  Main: 65% Cotton, 35% Polyester. Lining: 65% Polyester, 35% Cotton.<br>  Model is 59 and wears size XS<br>  Label Color: Washed Lavender<br><br>Zip up and train on in the Legacy Fitness Cropped Zip Hoodie. Youre free to give every rep your all with an unrestrictive fit and ribbed, stay-put hem and cuffs that provide comfort and confidence. A large classic Gymshark logo to the back means youll train with pride too.</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglegacy-fitness-crop-zip-hoodieh1', NULL, '2020-04-20 00:26:18', '2020-05-14 22:49:42'),
