(557, '3B64878', '<h1 class=\"pinfo__heading\">movement mesh cropped hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>AN ATHLETES ATTITUDE</strong><br><br>- Cropped, boxy fit<br>- Mesh kangaroo pocket<br>- Drawcord hood<br>- Mesh hem<br>- Base: 87% VISCOSE 8% POLYESTER 5% ELASTANE, mesh: 80% Nylon 20% Elastane and 91% Nylon 9% Elastane, <br>- Model is 5\'8\" and wears a size S<br>- Label Color: Black<br><br>Whether the work is only beginning, or its behind you, the Movement Mesh Cropped Hoodie is the perfect cover up. With a boxy, cropped fit and mesh kangaroo pocket, its the pullover youll always want in your gym bag. <br><br>\n</div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingmovement-mesh-cropped-hoodieh1', NULL, '2020-04-20 00:26:20', '2020-05-14 22:49:42'),
(558, '03e9e53', '<h1 class=\"pinfo__heading\">power down cropped hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>LOW POWER MODE</strong><br><br> Boxy fit<br> Midi length<br> Super-soft material<br> Dropped shoulder<br> Raw-edge hem<br> Functional button feature to sides<br> Oversized three-piece hood with functional elongated drawcords<br> Printed Gymshark logo to chest<br> Woven tab logo to hood<br> 62% Polyester, 33% Cotton, 5% Elastane<br> Model is 5\'7 and wears size S<br> Label Color: Taupe<br><br>Delicate design. Elegant style. Extreme comfort. The Power Down Cropped Hoodie is all about rest, recovery and recuperation with a luxuriously soft polyester-cotton blend and leisurely boxy fit. A midriff crop, dropped shoulder and functional button feature to the sides adds a subtle touch of character.<br><br>Rest and recovery is vital for not just your body, but your mind, and the Power Down range is built for rest day.</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingpower-down-cropped-hoodieh1', NULL, '2020-04-20 00:26:21', '2020-05-14 22:49:42'),
(559, 'ADd8a88', '<h1 class=\"pinfo__heading\">power down cropped hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<p><strong>LOW POWER MODE</strong><br><br> Boxy fit<br> Midi length<br> Super-soft material<br> Dropped shoulder<br> Raw-edge hem<br> Functional button feature to sides<br> Oversized three-piece hood with functional elongated drawcords<br> Printed Gymshark logo to chest<br> Woven tab logo to hood<br> 62% Polyester, 33% Cotton, 5% Elastane<br> Model is 5\'7 and wears size S<br> Label Color: Black</p>\n<p>Delicate design. Elegant style. Extreme comfort. The Power Down Cropped Hoodie is all about rest, recovery and recuperation with a luxuriously soft polyester-cotton blend and leisurely boxy fit. A midriff crop, dropped shoulder and functional button feature to the sides adds a subtle touch of character.<br><br>Rest and recovery is vital for not just your body, but your mind, and the Power Down range is built for rest day.</p>\n</div>', 31, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingpower-down-cropped-hoodieh1', NULL, '2020-04-20 00:26:22', '2020-05-14 22:49:42'),
(560, '73716ed', '<h1 class=\"pinfo__heading\">non stop cropped hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>LIVE NON-STOP</strong><br><br>  Boxy fit<br>  Cropped length<br>  Full interior lining<br>  Zip pocket to inner right forearm<br>  Double-access pouch pocket to front<br>  Three-piece hood<br>  Elasticated wrist cuffs with printed Gymshark logos<br>  Main: 100% Polyester. Lining: 100% Polyester.<br>  Model is 5\'5 and wears size XS<br>  Label Colour: Black<br><br>The commuters best friend. The Non-Stop Cropped Hoodie features a pocket to the right forearm for your cards and passes, and a dual pouch pocket to the front - with a zip to the right side - for all your other daily essentials. Complete with a soft, interior lining and woven polyester exterior, you can move through life at the pace you want.</div>', 31, 50, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingnon-stop-cropped-hoodieh1', NULL, '2020-04-20 00:26:23', '2020-05-14 22:49:42'),
(561, '7A2b693', '<h1 class=\"pinfo__heading\">slounge cropped hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>THE PERFECT REST DAY</strong><br><br><span> Slim fit</span><br><span> Cropped length</span><br><span> Super soft Slounge material</span><br><span> Ribbed marl design</span><br><span> Long raglan sleeves</span><br><span> Dropped hem to front</span><br><span> Adjustable drawcord to three-piece hood</span><br><span> Woven tab logo to hem</span><br><span> 60% Polyester, 38% Viscose, 2% Elastane</span><br><span> Model is 57 and wears sizeS</span><br><span> Label Colour: Black Marl</span><br><br><span>The Slounge Cropped Hoodies slim fit enhances your figure and follows your shape closely to ensure freedom of movement. The sumptuously soft Slounge material promises a customisable feel for consistent comfort.</span>\n</div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingslounge-cropped-hoodieh1', NULL, '2020-04-20 00:26:24', '2020-05-14 22:49:42'),
(562, 'F2f308e', '<h1 class=\"pinfo__heading\">cropped crest hoodie</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<span>The perfect cover-up.</span><br><br><span> Relaxed fit</span><br><span> Midriff crop</span><br><span> Raglan sleeve construction</span><br><span> Lined three-piece hood</span><br><span> Adjustable drawcords</span><br><span> Printed Gymshark logo to chest</span><br><span> 60% Cotton, 40% Polyester</span><br><span> Model is 5\'5\" and wears a size XS</span><br><span> Label Colour: Stormy Turquoise</span><br><br><span>The Cropped Crest Hoodie is contemporary and stylish but, above all, reliable. Its soft, supple cotton-polyester blend allows a supported warm-up and focused workout. With its flattering midriff crop and statement branding, its a versatile streetwear addition, too. You cant go wrong with Crest.</span>\n</div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcropped-crest-hoodieh1', NULL, '2020-04-20 00:26:24', '2020-05-14 22:49:42'),
