(564, 'EE6799e', '<h1 class=\"pinfo__heading\">combat shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>FIGHTING FIT</strong><br><br><span>- Mid rise fit</span><br><span>- No front seam</span><br><span>- Elasticated waistband with internal silicone grip</span><br><span>- Branded woven tab to back waistband</span><br><span>- Contouring seams to bum</span><br><span>- 88% Recycled Polyester 12% Lycra Elastane</span><br><span>- Model is 5\'6\" and wears size XS</span><br><span>- Label Colour: Smokey Grey<br></span><br><span>Meet your new favourite sparring partner. The Combat Shorts are your perfect shorts for any kind of combat training, with a stretchy fabric, elasticated waistband and flattering contouring seams. Plus, with an internal silicone grip on the waistband you can be confident therell be no budging and no distractions, even during your hardest hitting session.</span>\n</div>', 32, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcombat-shortsh1', NULL, '2020-04-20 00:26:32', '2020-05-14 22:49:42'),
(565, '2874611', '<h1 class=\"pinfo__heading\">technical cycling shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>TECHNICAL SUPPORT</strong><br><br>- Mid rise fit<br>- Internal silicone flocking (quads, under bum and calves)<br>- Internal silicone grip in waistband<br>- Matte print detail to side of shorts, knee and under bum<br>- Reflective logo at back of waistband<br>- 70% Polyester, 30% Elastane <br>- Model is 58 and wears size XS<br>- Label Colour: Black<br><br>The Technical Cycling Shorts are just as technically sound as you are. Featuring innovative internal flocking in key muscle areas, matte print detailing to sides, knee and under bum, they are sure to help you take your performance to the next level. <br><br>Note: The Technical Range is a slightly more compressive fit than our other ranges. However, to feel the full effect of the pieces, we recommend purchasing your regular/ recommended size.</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtechnical-cycling-shortsh1', NULL, '2020-04-20 00:26:33', '2020-05-14 22:49:42'),
