(574, '4D6deb4', '<h1 class=\"pinfo__heading\">flex cycling shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<p><strong>FLEX YOUR WAY</strong><br><br> High-rise fit<br> Figure-contouring shades<br> Seamless ribbed waistband<br> DRY technology<br> Jacquard Gymshark logo to back waistband<br> Printed Gymshark logo to front hip<br> 56% Nylon, 39% Polyester, 5% Elastane<br> Model is 55 and wears size XS<br> Label Colour: Charcoal Marl/Smokey Teal</p>\n<p><br>The Flex Cycling Shorts combine signature Gymshark design - with contouring knitted shades and a high-waisted fit - with the trend-focused silhouette of cycling shorts. Adding in a supportive, breathable and sweat-wicking nylon-polyester fabric blend, these shorts are conditioned for conditioning.</p>\n</div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingflex-cycling-shortsh1', NULL, '2020-04-20 00:26:41', '2020-05-14 22:49:42'),
(575, 'F0bebbd', '<h1 class=\"pinfo__heading\">flex cycling shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<p><strong>FLEX YOUR WAY</strong><br><br> High-rise fit<br> Figure-contouring shades<br> Seamless ribbed waistband<br> DRY technology<br> Jacquard Gymshark logo to back waistband<br> Printed Gymshark logo to front hip<br> 56% Nylon, 39% Polyester, 5% Elastane<br> Model is 55 and wears size XS<br> Label Colour: Black/Charcoal</p>\n<p><br>The Flex Cycling Shorts combine signature Gymshark design - with contouring knitted shades and a high-waisted fit - with the trend-focused silhouette of cycling shorts. Adding in a supportive, breathable and sweat-wicking nylon-polyester fabric blend, these shorts are conditioned for conditioning.</p>\n</div>', 32, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingflex-cycling-shortsh1', NULL, '2020-04-20 00:26:42', '2020-05-14 22:49:42'),
(576, 'F738017', '<h1 class=\"pinfo__heading\">flex cycling shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<p><strong>FLEX YOUR WAY</strong><br><br>  High-rise fit<br>  Figure-contouring shades<br>  Seamless ribbed waistband<br>  DRY technology<br>  Jacquard Gymshark logo to back waistband<br>  Printed Gymshark logo to front hip<br>  56% Nylon, 39% Polyester, 5% Elastane<br>  Model is 57 and wears size S<br>  Label Colour: Winter Berry Marl/Rose Slate</p>\n<p><br>The Flex Cycling Shorts combine signature Gymshark design - with contouring knitted shades and a high-waisted fit - with the trend-focused silhouette of cycling shorts. Adding in a supportive, breathable and sweat-wicking nylon-polyester fabric blend, these shorts are conditioned for conditioning.</p>\n</div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingflex-cycling-shortsh1', NULL, '2020-04-20 00:26:43', '2020-05-14 22:49:42'),
(577, '0Bfc246', '<h1 class=\"pinfo__heading\">flex shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<p>Combining our signature seamless knit with superior, sculpting design. The Flex Shorts boast moisture-wicking technology and form flattering contour shading woven into sumptuously soft fabric.</p>\n<p>Jacquard elasticated mid-rise waistband offers non-slip support, whilst soft stretch breathable fabric guarantees ease of movement. Style with the FlexCrop top for an outfit engineered to perform.</p>\n<p>56% Nylon, 41% Polyester, 3% Elastane.</p>\n<p><span>Model is 5\'7\" and wears a size S</span></p>\n</div>', 32, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingflex-shortsh1', NULL, '2020-04-20 00:26:44', '2020-05-14 22:49:42'),
(578, '98b2327', '<h1 class=\"pinfo__heading\">flex shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<p>Combining our signature seamless knit with superior, sculpting design. The Flex Shorts boast moisture-wicking technology and form flattering contour shading woven into sumptuously soft fabric.</p>\n<p>Jacquard elasticated mid-rise waistband offers non-slip support, whilst soft stretch breathable fabric guarantees ease of movement. Style with the FlexCrop top for an outfit engineered to perform.</p>\n<p>56% Nylon, 41% Polyester, 3% Elastane.</p>\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<p><span>Model is 5\"7\' and wears a size S</span></p>\n</div>', 31, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingflex-shortsh1', NULL, '2020-04-20 00:26:45', '2020-05-14 22:49:42'),
(579, 'F9f282a', '<h1 class=\"pinfo__heading\">vital seamless shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>EMPOWERED THROUGH STRENGTH</strong><br><br>- Body fit <br>- Seamless shorts <br>- Heat-sealed logo to left hip <br>- Seamless rib to waistband <br>- High build seamless line to back<br>- 55% Nylon, 33% Polyester, 12% Elastane<br>- Model is 58 and wears size XS<br>- Label Colour: Washed Jade Marl<br><br>Feel your power in the Vital Seamless Shorts. With the same material and design features as the Vital Seamless Leggings, they are just as flattering and just as performance ready. With contouring shading, a high waist and a range of stylish colours, youll be more than ready for any workout.</div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingvital-seamless-shortsh1', NULL, '2020-04-20 00:26:46', '2020-05-14 22:49:42'),
(580, '95bf037', '<h1 class=\"pinfo__heading\">24/7 shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>ALL DAY, ANY DAY.</strong><br><br>  High-rise fit<br>  Boxy shape<br>  Adjustable tape drawcords to elasticated waistband<br>  Contouring seam-lines to glutes<br>  Open patch pocket to back<br>  Asymmetric taping with Gymshark logo pattern<br>  100% Cotton<br>  Model is 59 and wears size XS<br>  Label Colour: Black<br><br>With a complete cotton build and unrestrictive boxy fit, the 24/7 Shorts are a comfort supreme. Theyve been made for the journey you take them on with convenient side pockets and functional drawcords to the waistband, and designed to flatter your shape along the way with a high-waisted silhouette and shaping seam lines.</div>', 32, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-heading247-shortsh1', NULL, '2020-04-20 00:26:47', '2020-05-14 22:49:42'),
(581, '86355d5', '<h1 class=\"pinfo__heading\">fit shorts</h1>\n', '<div class=\"pdp-accordion__body\"><p><strong>FIT FOR PERFORMANCE.</strong><br><br>- Mid-rise fit<br>- Elasticated printed waistband<br>- 4-way stretch material<br>- 83% Nylon, 17% Elastane<br>- Model is 54 and wears a size XS<br>- Label Colour: Charcoal/Black<br><br>Your favourite Fit Leggings made in to your new favourite shorts. Designed with the same soft blend material, to provide that stretchy, supple fit.</p></div>', 31, 25, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingfit-shortsh1', NULL, '2020-04-20 00:26:47', '2020-05-14 22:49:42'),
