(586, '37204ee', '<h1 class=\"pinfo__heading\">speed shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>STEP INTO CARDIO.</strong><br><br>- Regular fit<br>- Double layer shorts: Body fit underlayer with loose overlayer <br>- Side pockets on under layer<br>- Adjustable drawcord waistband<br>- Main: 86% Polyester, 14% Elastane, Mesh: 64% Nylon, 36% Elastane <br>- Model is 58 and wears size XS<br>- Label Color: Black<br><br>Meet the perfect 2-in-1 shorts to see your through any run. The Speed Shorts are lightweight with mesh pockets and heat pressed seams on the underlayer, so theres no irritation and youre free to run. <br>\n</div>', 31, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingspeed-shortsh1', NULL, '2020-04-20 00:26:52', '2020-05-14 22:49:42'),
