(588, 'A43d0d0', '<h1 class=\"pinfo__heading\">power down shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>LOW POWER MODE</strong><br><br> High-rise fit<br> Super-soft seamless material<br> Ribbed seamless pattern to waistband<br> Elongated waistband<br> Printed Gymshark logo to leg<br> 80% Modal, 15% Nylon, 5% Elastane<br> Main Image/Left Model is 5\'3\" and wears a size XS<br>- Right Model is 5\'8\" and wears a size M<br> Label Color: Black<br><br>The sofa collection. The Power Down Shorts are for all-out resting with a sumptuously soft-hand feel material and body-hugging fit. Ribbed seamless patterns and a lengthened waistband have restorative, recovery properties so that when you rest day, you rest day right, with extreme comfort and leisure.<br><br>Rest and recovery is vital for not just your body, but your mind, and the Power Down range is built for rest day.</div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingpower-down-shortsh1', NULL, '2020-04-20 00:26:54', '2020-05-14 22:49:42'),
