(592, '5Cb5da5', '<h1 class=\"pinfo__heading\">lustre 2 in 1 shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>LIGHT UP THE WEIGHT ROOM</strong><br><br>  High-rise fit<br>  Under-layer tights with over-layer shorts<br>  High-sheen embossed material undershorts<br>  Adjustable drawcords to elasticated waistband<br>  Printed tonal Gymshark logo to over-shorts<br>  Under-layer: 87% Polyester, 13% Elastane. Over-layer: 72% Nylon, 28% Elastane.<br>  Model is 5\'7 and wears size S<br>  Label Colour: Winter Berry<br><br>The Lustre Shorts feature a mesmerising embossed print on a structure thats built for endurance. Their reflective material catches light, and attention, while a double-layer construction combines a supportive, reinforcing under-layer with a super-stretchy over-layer, so you can move with purpose.</div>', 32, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headinglustre-2-in-1-shortsh1', NULL, '2020-04-20 00:26:58', '2020-05-14 22:49:42'),
(593, 'C7c9b55', '<h1 class=\"pinfo__heading\">vital seamless shorts</h1>\n', '<div class=\"pdp-accordion__body\"><p><strong>EMPOWERED THROUGH STRENGTH</strong><br><br>- Body fit <br>- Seamless shorts <br>- Heat-sealed logo to left hip <br>- Seamless rib to waistband <br>- High build seamless line to back<br>- 55% Nylon, 33% Polyester, 12% Elastane<br>- Model is 58 and wears size XS<br>- Label Colour: Black Marl<br><br>Feel your power in the Vital Seamless Shorts. With the same material and design features as the Vital Seamless Leggings, they are just as flattering and just as performance ready. With contouring shading, a high waist and a range of stylish colours, youll be more than ready for any workout.</p></div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingvital-seamless-shortsh1', NULL, '2020-04-20 00:26:59', '2020-05-14 22:49:42'),
(594, 'C3a99a9', '<h1 class=\"pinfo__heading\">energy+ seamless shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>JUST ADD ENERGY</strong><br><br>- High-waisted fit <br>- Seamless eyelet details <br>- Seamless rib to waistband <br>- Under-bum contouring <br>- Heat-sealed logo to hip and back waistband <br>- 93% Nylon, 7% Elastane<br>- Model is 53\" and wears size XS<br>- Label Colour: Beet<br><br>Your favourite Energy+ Seamless Leggings, but short. The Energy+ Seamless Shorts have everything youve come to love about the Energy+ collection; the high-waist, the seamless fabric, the eyelet detailing and that all-important bum contouring. All in a short, simple design, perfect for those workout sessions.</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingenergy-seamless-shortsh1', NULL, '2020-04-20 00:27:00', '2020-05-14 22:49:42'),
