(597, '8510962', '<h1 class=\"pinfo__heading\">training shorts</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>IN YOUR LOCKER</strong><br><br><span>- High rise fit</span><br><span>- Logo to right hip</span><br><span>- Flattering seams</span><br><span>- Logo to rear</span><br><span>- 78% Polyester, 22% Elastane</span><br><span>- Model is 58 and wears sizeS</span><br><span>- Label Colour: Sunset Pink</span><br><br><span>We get the feeling the Training Shorts are about to become your new favourites. High waist? Check. Flattering seams? Check. Available in a range of colours to match all your other favourite tops? Check.</span>\n</div>', 32, 25, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtraining-shortsh1', NULL, '2020-04-20 00:27:03', '2020-05-14 22:49:42'),
