(599, '4Ba1bc6', '<h1 class=\"pinfo__heading\">camo seamless long sleeve crop top</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>COMMAND ATTENTION</strong><br><br><span>- All-over jacquard camo pattern</span><br><span>- Midriff crop</span><br><span>- Ruched detail to centre chest</span><br><span>- Subtle back openings</span><br><span>- Seamless Gymshark logo to waist</span><br><span>- Thumbholes</span><br><span><span>-79% Polyamide 15% Polyester 6% Spandex<br></span></span><span>- Model is 5\'8\" and wears a size XS</span><br><span>- Label Color: Aqua Green</span><br><br><span><span>Attention! This midriff crop boasts distinct jacquard camo colourways, ruched chest detailing, and back openings make it flexible, comfortable and ready for even the most intense of workouts. Whatever your mission, the Camo Seamless Long Sleeve Crop Top will see you through in style.<br><br></span></span><meta charset=\"utf-8\">\n<span>Part of the Adapt Collection.<br></span>\n</div>', 32, 45, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcamo-seamless-long-sleeve-crop-toph1', NULL, '2020-04-20 00:27:36', '2020-05-14 22:49:42'),
