(718, '79cd902', '<h1 class=\"pinfo__heading\">fit leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<p class=\"p1\">Fit for performance.<br><br>  Unrestricted fit<br>  Seamless knit<br>  Elasticated Gymshark waistband<br>  Internal silicone grip<br>  80% Nylon, 20% Elastane<br>  Model is 5\'5\" and wears a size XS. <br><br>Feel the liberated range of movement, experience the seamless support and style the gorgeous colour-ways in the Fit gym leggings, a guaranteed winner for your next workout.</p>\n</div>', 31, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingfit-leggingsh1', NULL, '2020-04-20 00:29:56', '2020-05-14 22:49:43'),
(719, '8976d52', '<h1 class=\"pinfo__heading\">fit leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<p class=\"p1\"><span>Fit for performance.</span><br><br><span>- Unrestricted fit</span><br><span>- Seamless knit</span><br><span>- Elasticated Gymshark waistband</span><br><span>- Internal silicone grip</span><br><span>- 80% Nylon, 20% Elastane</span><br><span>- Model is 5\'5\" and wears a size XS.</span><br><br><span>Feel the liberated range of movement, experience the seamless support and style the gorgeous colour-ways in the Fit gym leggings, a guaranteed winner for your next workout.</span></p>\n</div>', 31, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingfit-leggingsh1', NULL, '2020-04-20 00:29:57', '2020-05-14 22:49:43'),
(720, '908bd79', '<h2>fit sports bra</h2>', '<p>Fit for performance.<br><br>- Medium support sports bra<br>- High-stretch material<br>- Removable padding<br>- Elasticated underband with jacquard logo<br>- 83% Nylon, 17% Elastane<br>- Model is 5\'7\" and wears a size S.&nbsp;<br>- Label Colour: Slate Lavender/Rose Slate<br><br>Made to be worn underneath a lightweight gym vest, the Fit Sports Bra promises a liberated range of movement, assured support and versatile style in gorgeous colourways. A guaranteed winner for your next workout.</p>', 32, 30, NULL, NULL, 10, 1, 1, NULL, NULL, NULL, NULL, NULL, 'h2fit-sports-brah2', NULL, '2020-04-20 00:29:58', '2020-05-14 22:49:43'),
(721, '21ad456', '<h1 class=\"pinfo__heading\">fit printed leggings</h1>\n', '<div class=\"pdp-accordion__body\"><p><strong>FIT FOR PERFORMANCE</strong><br><br>- Low rise <br>- Seamless knit<br>- Elasticated waistband with jacquard Gymshark logo<br>- Internal silicone grip on waistband <br>- Print fabric <br>- 80% Nylon 20% Elastane<br>- Model is 58 and wears size XS<br>- Label Colour: Blue Hues<br><br>Seamless comfort and effortless style combine to form these Fit Printed Leggings. With a stay-put waistband thanks to a silicone grip, and super-stretchy printed material these leggings are ready for whatever workout you have lined up next.</p></div>', 31, 40, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingfit-printed-leggingsh1', NULL, '2020-04-20 00:29:59', '2020-05-14 22:49:43'),
(722, '2F1b135', '<h1 class=\"pinfo__heading\">fit printed sports bra</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>FIT FOR PERFORMANCE</strong><br><br>- Medium support <br>- High stretch material<br>- Racer back<br>- Removable padding<br>- Elasticated underband with jacquard logo<br>- Print fabric<br>- 80% Nylon 20% Elastane<br>- Model is 58 and wears size XS<br>- Label Colour: Blue Hues<br><br>The Fit Printed Sports Bra is not the kind of bra you want to hide under a t-shirt - although you can if you want to keep it your little secret. Its stylish print makes it a statement piece you want to get seen. And with medium support and high stretch material it also has all the functionality you need.</div>', 32, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingfit-printed-sports-brah1', NULL, '2020-04-20 00:30:00', '2020-05-14 22:49:43'),
(723, 'A5e2bb0', '<h1 class=\"pinfo__heading\">fit leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<span>Fit for performance.</span><br><br><span>- Unrestricted fit</span><br><span>- Seamless knit</span><br><span>- Elasticated Gymshark waistband</span><br><span>- Internal silicone grip</span><br><span>- 80% Nylon, 20% Elastane</span><br><span>- Model is 5\'7\" and wears a size S.<br>- Label Colour: MoroccanBrick/Peach Bellini/Moroccan Brick<br></span><br><span>Feel the liberated range of movement, experience the seamless support and style the gorgeous colourways in the Fit gym leggings, a guaranteed winner for your next workout.</span>\n</div>', 31, 35, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingfit-leggingsh1', NULL, '2020-04-20 00:30:01', '2020-05-14 22:49:43'),
(724, 'F49bec6', '<h1 class=\"pinfo__heading\">fit cropped leggings</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<p><span>Fit for performance.</span><br><br><span>- Unrestricted fit</span><br><span>- Seamless knit</span><br><span>- Elasticated Gymshark waistband</span><br><span>- Internal silicone grip</span><br><span>- 80% Nylon, 20% Elastane</span><br><span>- Model is 5\'7\" and wears a size S.<br>- Label Colour: MoroccanBrick/Peach Bellini/Moroccan Brick<br></span><br><span>The Fit Cropped Leggings have been engineered with a seamless knit to provide a liberated range of movement and an assured support. Available in gorgeous colourways, these seamless gym leggings are a guaranteed winner for your next workout.</span></p>\n</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingfit-cropped-leggingsh1', NULL, '2020-04-20 00:30:02', '2020-05-14 22:49:43'),
(725, 'D019ea4', '<h1 class=\"pinfo__heading\">fit sports bra</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<meta charset=\"utf-8\">\n<p>Fit for performance.<br><br>- Medium support sports bra<br>- High-stretch material<br>- Elasticated underband with jacquard logo<br>- 83% Nylon, 17% Elastane<br>- Model is 5\'5\" and wears a size XS. <br>- Label Colour: Dusky Teal/Light Grey<br><br>Made to be worn underneath a lightweight gym vest, the Fit Sports Bra promises a liberated range of movement, assured support and versatile style in gorgeous colourways. A guaranteed winner for your next workout.</p>\n</div>', 31, 30, NULL, NULL, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingfit-sports-brah1', NULL, '2020-04-20 00:30:03', '2020-05-14 22:49:43'),
(726, '08d9a91', '<h2><strong>MEDIUM RESISTANCE BAND</strong></h2>', '<p>An entire workout with just a band.<br><br>- Medium resistance<br>- Premium fabric band<br>- Durable, lightweight build<br>- Silicone taping for non-slip hold<br>- Raised rubber tab logo<br>- Carry bag included<br>- 55% Latex, 45% Polyester Cotton.&nbsp;<br>- Length: 38cm. Width: 7.5cm.<br>-&nbsp;25-35lbs(12-16kg)<br>- Label Colour: Gymshark Cobalt&nbsp;<br><br>The Medium Resistance Band offers a moderate resistance without all the equipment, making it easy to take your leg training with you anywhere. Alternatively, up the ante by adding it into your next weight session.</p>', 31, 20, NULL, NULL, 0, 1, 1, NULL, NULL, NULL, NULL, NULL, 'h2strongmedium-resistance-bandstrongh2', NULL, '2020-04-25 14:00:49', '2020-05-14 22:49:43'),
(727, '005c163', '<h2>energy+ seamless cropped leggings</h2>', '<p>Just add Energy.<br><br>&nbsp;</p><p> High-waisted leggings<br> Eyelet detailing and glute contouring<br> Ribbed waistband<br> 3/4 length<br> 94% Nylon, 6% Elastane<br> Model is 5\'7\" and wears size S</p><p>The Energy+ Seamless Cropped Leggings are engineered to power your performance. Step into the gym full of confidence thanks to a high-waist fit and seamless contouring. Enter full of support thanks to soft fabrics and a ribbed waistband providing a stay-put fit.</p>', 31, 56, NULL, NULL, 1, 1, 1, NULL, NULL, NULL, NULL, NULL, 'h2energy-seamless-cropped-leggingsh2', NULL, '2020-05-02 02:20:10', '2020-07-19 11:21:38');
